ontend / Dialog / Table HeadlineProcessing Location'=>'Standortverarbeitung','Backend / Dialog Settings / HintIf enabled, the appearance of the <translation-key id="Dialog">Dialog</translation-key> is delayed for two seconds.'=>'Wenn diese Option aktiviert ist, wird das Erscheinen des <translation-key id="Dialog">Dialogs</translation-key> um zwei Sekunden verzögert.','Backend / Dashboard / HintThis setting should only be activated when urgently required. When activated, it generates a large number of log entries that can affect the performance of the website. The log entries can be found under <translation-key id="Navigation-System">System</translation-key> &raquo; <translation-key id="Navigation-System-Logs">Logs</translation-key>.'=>'Diese Einstellung sollte ausschließlich bei dringendem Bedarf aktiviert werden. Bei Aktivierung erzeugt sie eine umfangreiche Menge an Log-Einträgen, die die Performance der Website beeinträchtigen können. Die Log-Einträge finden Sie unter <translation-key id="Navigation-System">System</translation-key> &raquo; <translation-key id="Navigation-System-Logs">Logs</translation-key>.','Backend / Init / Alert MessageSome <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> files have been blocked by a browser extension. Please deactivate your ad blocker or cookie notice blocker.'=>'Einige <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> Dateien wurden durch eine Browsererweiterung blockiert. Bitte deaktivieren Sie Ihren Werbeblocker oder Cookie-Hinweis-Blocker.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Feature">Feature</translation-key>'=>'<translation-key id="IAB-TCF-Feature">Feature</translation-key>','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Purpose">Purpose</translation-key>'=>'<translation-key id="IAB-TCF-Purpose">Zweck</translation-key>','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="