ranslation-key id="Multisite-Network">Multisite Network</translation-key>, therefore you do not have do modify this setting in most cases.'=>'Ihr WordPress ist kein <translation-key id="Multisite-Network">Multisite-Netzwerk</translation-key>, daher müssen Sie diese Einstellung in den meisten Fällen nicht ändern.','Backend / IAB TCF Configure Vendors / Things to knowThis view is used solely to activate all vendors based on the purposes, features, etc. The TCF aims to display adverts from vendors for which consent has been given based on these features. Therefore, the checkboxes will not be selected again when you call them up again.'=>'Diese Ansicht dient allein dazu, alle Vendoren basierend auf den Zwecken, Features usw. zu aktivieren. Das TCF zielt darauf ab, u.a. Werbung von Vendoren auszuspielen, für die aufgrund dieser Merkmale eine Einwilligung vorliegt. Beim erneuten Aufrufen werden daher die Checkboxen erneut nicht ausgewählt sein.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-Code">Code</translation-key>: Enter the language code of the language you want to add, e.g. <strong><em>de</em></strong>. The language code must be in <translation-key id="ISO-639-1">ISO 639-1</translation-key> format. You can find a list of all language codes <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes" target="_blank"><strong><em>here</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'<translation-key id="Language-Switcher-Code">Code</translation-key>: Geben Sie den Sprachcode der Sprache ein, die Sie hinzufügen möchten, z. B. <strong><em>de</em></strong>. Der Sprachcode muss im Format <translation-key id="ISO-639-1">ISO 639-1</translation-key> vorliegen. Eine Liste aller Sprachcodes finden Sie <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes" target="_blank"><strong><em>hier</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-Name">Name</translation-key>: Enter the name of the language, e.g. <strong><em>German</em></strong>.'=>'<translation-key id="Language-Switcher-Name">Name</translation-key>: Geben Sie den Namen der Sprache ein, z. B. <strong><em>Deutsch</em></strong>.','Backend / Dialog Settings / Things to know / Text<translation-key id="Language-Switcher-URL">URL</translation-key>: Enter the URL of the page of the language.'=>'<translation-key id="Language-Switcher-URL">URL</translation-key>: Geben Sie die URL der Seite der Sprache ein.','Backend / Dialog Settings / Things to know / TextThe <translation-key id="Language-Switcher">Language Switcher</translation-key> allows visitors to change the website\'s language using the <translation-key id="Dialog">Dialog</translation-key>. Once they choose a language, they\'re automatically taken to the website\'s version in that language. This feature requires a multilingual plugin or a <translation-key id="Multisite-Network">Multisite Network</translation-key>.'=>'Mit dem <translation-key id="Language-Switcher">Sprachumschalter</translation-key> können Besucher die Sprache der Website über den <translation-key id="Dialog">Dialog</translation-key> ändern. Sobald sie eine Sprache ausgewählt haben, werden sie automatisch auf die Version der Website in dieser Sprache weitergeleitet. Für diese Funktion ist ein mehrsprachiges Plugin oder ein <translation-key id="Multisite-Network">Multisite-Netzwerk</translation-key> erforderlich.','Backend / Dialog Settings / TableLanguage'=>'Sprache','Backend / Dialog Settings / TableLanguage Code'=>'Sprachcode','Backend / Dialog Settings / TableURL'=>'URL','Backend / Dialog Settings / Things to know / HeadlineWhat is the purpose of the <translation-key id="Language-Switcher">Language Switcher</translation-key> section?'=>'Wozu dient der <translation-key id="Language-Switcher">Sprachumschalter</translation-key>?','Backend / Dialog Settings / Things to know / HeadlineInput fields explained'=>'Eingabefelder erklärt','Frontend / Dialog / Link TextLanguage'=>'Sprache','Backend / Dialog Localization / LabelLanguage Switcher - Link Text'=>'Sprachumschalter - Link-Text','Backend / Dialog Settings / Alert MessageNo <translation-key id="Language-Option">Language Option</translation-key> configured.'=>'Keine <translation-key id="Language-Option">Sprachoption</translation-key> konfiguriert.','Backend / Dialog Settings / Button TitleAdd Language Option'=>'Sprachoption hinzufügen','Backend / Dialog Settings / HeadlineLanguage Switcher'=>'Sprachumschalter','Backend / System Check / Table HeadlineConsent Statistic by Day - <translation-key id="Service-Groups">Service Groups</translation-key>'=>'Einwilligungsstatistiken nach Tag - <translation-key id="Service-Groups">Service-Gruppen</translation-key>','Backend / System Check / Table HeadlineConsent Statistic by Day -  <translation-key id="Services">Services</translation-key>'=>'Einwilligungsstatistiken nach Tag - <translation-key id="Services">Services</translation-key>','Backend / System Check / Table HeadlineConsent Statistic by Hour - <translation-key id="Service-Groups">Service Groups</translation-key>'=>'Einwilligungsstatistiken nach Stunden - <translation-key id="Service-Groups">Service-Gruppen</translation-key>','Backend / System Check / Table HeadlineConsent Statistic by Hour - <translation-key id="Services">Services</translation-key>'=>'Einwilligungsstatistiken nach Stunden - <translation-key id="Services">Services</translation-key>','Backend / Page Manager / Menu Title- Import &amp; Export'=>'- Import &amp; Export','Backend / Page Manager / Menu TitleImport &amp; Export'=>'Import &amp; Export','Backend / Validation / Alert MessageThe value in the <strong>{{ fieldName }}</strong> field is not valid JSON.'=>'Der Wert im Feld <strong>{{ fieldName }}</strong> ist kein gültiges JSON.','Backend / Library / HintIf enabled, the code (<translation-key id="Opt-in-Code">Opt-in Code</translation-key>, <translation-key id="Opt-out-Code">Opt-out Code</translation-key> and <translation-key id="Fallback-Code">Fallback Code</translation-key>) will be overwritten with the code provided by the package. To retain your code modifications while only updating the component settings, you may disable this option.'=>'Wenn diese Option aktiviert ist, wird der Code (<translation-key id="Opt-in-Code">Opt-in-Code</translation-key>, <translation-key id="Opt-out-Code">Opt-out-Code</translation-key> und <translation-key id="Fallback-Code">Fallback-Code</translation-key>) mit dem vom Paket bereitgestellten Code überschrieben. Um Ihre Codeänderungen beizubehalten und nur die Komponenteneinstellungen zu aktualisieren, können Sie diese Option deaktivieren.','Backend / Services / LabelDisable Code Execution'=>'Code-Ausführung deaktivieren','Backend / Services / HintIf enabled, this <translation-key id="Service">Service</translation-key> refrains from executing any JavaScript code. This feature can be valuable if you solely require the consent of the <translation-key id="Service">Service</translation-key> and intend to execute code through a tag management system (TMS).'=>'Wenn diese Option aktiviert ist, führt dieser <translation-key id="Service">Service</translation-key> keinen JavaScript-Code aus. Diese Funktion kann nützlich sein, wenn Sie nur die Einwilligung des <translation-key id="Service">Services</translation-key> benötigen und beabsichtigen, Code über ein Tag-Management-System (TMS) auszuführen.','Backend / Library / Alert MessagePlease use the successor package <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="{{ link }}" target="_blank"><strong><em>{{ name }}</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'Bitte verwenden Sie das Nachfolgerpaket <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" hre