 Export / Things to knowHow to export settings'=>'Wie man Einstellungen exportiert','Backend / Import & Export / Things to knowHow to import settings'=>'Wie man Einstellungen importiert','Backend / Import & Export / Things to knowImporting settings from <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> 2.x is currently not feasible and will remain impossible in the future.'=>'Der Import von Einstellungen aus <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> 2.x ist derzeit nicht möglich und wird es auch in Zukunft nicht sein.','Backend / Import & Export / Things to knowExporting settings such as <translation-key id="Services">Services</translation-key>, <translation-key id="Content-Blockers">Content Blockers</translation-key>, <translation-key id="Providers">Providers</translation-key>, etc. is not feasible and will remain impossible in the future.'=>'Der Export von Einstellungen wie <translation-key id="Services">Services</translation-key>, <translation-key id="Content-Blockers">Content-Blockern</translation-key>, <translation-key id="Providers">Providern</translation-key> usw. ist nicht möglich und wird auch in Zukunft nicht möglich sein.','Backend / Import & Export / Things to knowTo ensure you have the most up-to-date data, it is advisable to consistently rely on the library.'=>'Um sicherzustellen, dass Sie über die aktuellsten Daten verfügen, ist es ratsam, sich stets auf die Bibliothek zu verlassen.','Backend / Global / Navigation Entry<translation-key id="Navigation-System-Import-Export">Import &amp; Export</translation-key>'=>'<translation-key id="Navigation-System-Import-Export">Import &amp; Export</translation-key>','Backend / Content Blockers / Label<translation-key id="Initialization">Initialization</translation-key>'=>'<translation-key id="Initialization">Initialisierung</translation-key>','Backend / Content Blockers / Label<translation-key id="Preview-Blocked-Content-CSS">CSS</translation-key>'=>'<transla