me</translation-key> is recognized in an <strong><em>&lt;a&gt;</em></strong> tag, the consent will be added to the link via the <strong><em>gdpr_consent</em></strong> parameter.'=>'Ein <translation-key id="Hostname">Hostname</translation-key> pro Zeile. Wenn ein <translation-key id="Hostname">Hostname</translation-key> in einem <strong><em>&lt;a&gt;</em></strong>-Tag erkannt wird, wird die Einwilligung über den Parameter <strong><em>gdpr_consent</em></strong> zum Link hinzugefügt.','Backend / Cloud Scan / HintAdd one URL per line.'=>'Fügen Sie eine URL pro Zeile hinzu.','Backend / Dashboard / URLhttps://cdn-public.borlabs.io/videos/en/borlabs-cookie-3-0-setup.mp4'=>'https://cdn-public.borlabs.io/videos/de/borlabs-cookie-3-0-einrichtung.mp4','Backend / IAB TCF Cookie Box / Headline<translation-key id="IAB-TCF-Features">Features</translation-key> - Headline'=>'<translation-key id="IAB-TCF-Features">Features</translation-key> - Überschrift','Backend / IAB TCF Cookie Box / Headline<translation-key id="IAB-TCF-Purposes">Purposes</translation-key> - Headline'=>'<translation-key id="IAB-TCF-Purposes">Zwecke</translation-key> - Überschrift','Backend / IAB TCF Cookie Box / Headline<translation-key id="IAB-TCF-Special-Features">Special Features</translation-key> - Headline'=>'<translation-key id="IAB-TCF-Special-Features">Spezielle Features</translation-key> - Überschrift','Backend / IAB TCF Cookie Box / Headline<translation-key id="IAB-TCF-Special-Purposes">Special Purposes</translation-key> - Headline'=>'<translation-key id="IAB-TCF-Special-Purposes">Spezielle Zwecke</translation-key> - Überschrift','Backend / Global / Alert MessageDeleting <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> failed.'=>'Löschen von <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> ist fehlgeschlagen.','Backend / IAB TCF Settings / Field<translation-key id="Hostnames-for-Consent-Addition">Hostnames for Consent Addition</translation-key>'=>'<translation-key id="Hostnames-for-Consent-Addition">Hostnamen für Einwilligungsergänzung</translation-key>','Backend / IAB TCF Settings / FieldThird-Party <translation-key id="Hostnames-for-Consent-Addition">Hostnames for Consent Addition</translation-key> List'=>'Drittanbieter <translation-key id="Hostnames-for-Consent-Addition">Hostnamen für Einwilligungsergänzung</translation-key>-Liste','Backend / Dialog Settings / LabelShow "<translation-key id="Dialog-Close-Button">Close</translation-key>" Button'=>'Button "<translation-key id="Dialog-Close-Button">Schließen</translation-key>" anzeigen','Backend / Dialog Settings / HintIf enabled, the <translation-key id="Dialog-Close-Button">Close</translation-key> button will be shown to the visitor. Clicking the button is equivalent to choosing <translation-key id="Accept-Only-Essential">Accept Only Essential</translation-key>. This button can be toggled on or off specifically for the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>.'=>'Wenn diese Option aktiviert ist, wird dem Besucher der Button "<translation-key id="Dialog-Close-Button">Schließen</translation-key>" angezeigt. Ein Klick auf den Button ist gleichbedeutend mit der Auswahl von <translation-key id="Accept-Only-Essential">Nur essenzielle akzeptieren</translation-key>. Dieser Button kann speziell für den <translation-key id="Dialog-Entrance">Dialog-Einstieg</translation-key> ein- oder ausgeschaltet werden.','Backend / Local Scanner / TextClick on <a class="brlbs-cmpnt-link" href="##SIGNED_URL##" target="_bank">this link</a> to scan manually.'=>'Klicken Sie auf <a class="brlbs-cmpnt-link" href="##SIGNED_URL##" target="_bank">diesen Link</a>, um manuell zu scannen.','Backend / Package Manager Components / AlertA <strong>{{ resource }}</strong> with the key <strong><em>{{ key }}</em></strong> already exists. Please delete the <strong>{{ resource }}</strong> first.'=>'Ein <strong>{{ resource }}</strong> mit dem Key <strong><em>{{ key }}</em></strong> existiert bereits. Bitte löschen Sie zuerst den <strong>{{ resource }}</strong>.','Backend / Dialog Settings / HintIf enabled, the <translation-key id="Save-Selection">Save Selection</translation-key> button will be shown to the visitor, with which the visitor can save their consent preferences. This button can be toggled on or off specifically for the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>, but it will always be visible for the <translation-key id="Dialog-Details">Dialog Details</translation-key>.'=>'Wenn diese Option aktiviert ist, wird dem Besucher der Button <translation-key id="Save-Selection">Auswahl speichern</translation-key> angezeigt, mit dem er seine Einwilligungen speichern kann. Dieser Button kann speziell für den <translation-key id="Dialog-Entrance">Dialog-Einstieg</translation-key> ein- oder ausgeschaltet werden, ist aber für den <translation-key id="Dialog-Details">Dialog-Details</translation-key> immer sichtbar.','Backend / IAB TCF Settings / Field<translation-key id="Compact-Layout">Compact Layout</translation-key>'=>'<translation-key id="Compact-Layout">Kompaktes Layout</translation-key>','Backend / IAB TCF Settings / HintWhen <translation-key id="Compact-Layout">Compact Layout</translation-key> is enabled, the IAB TCF dialog will be displayed in a compact layout, to improve usability on mobile devices.'=>'Wenn <translation-key id="Compact-Layout">Kompaktes Layout</translation-key> aktiviert ist, wird der IAB TCF Dialog in einem kompakten Layout angezeigt, um die Benutzerfreundlichkeit auf mobilen Geräten zu verbessern.','Backend / System Check / Table HeadlineWordPress REST API'=>'WordPress REST API','Backend / Dialog Settings / Alert MessageDepending on applicable law, this option may not be allowed to be turned off.'=>'Je nach geltendem Recht darf diese Option möglicherweise nicht deaktiviert werden.','Backend / Dialog Settings / LabelShow "<translation-key id="Save-Selection">Save Selection</translation-key>" Button'=>'Button "<translation-key id="Save-Selection">Auswahl speichern</translation-key>" anzeigen','Backend / Global / Things to know / TextWe use the term <translation-key id="Synchronize-Translation">Translation</translation-key> to denote the texts associated with this entry. Synchronizing the <translation-key id="Translation">Translation</translation-key> will replace the texts in the selected languages with those from this entry.'=>'Wir verwenden den Begriff <translation-key id="Synchronize-Translation">Übersetzung</translation-key>, um die mit diesem Eintrag verbundenen Texte zu bezeichnen. Wenn Sie die <translation-key id="Translation">Übersetzung</translation-key> synchronisieren, werden die Texte in den ausgewählten Sprachen durch die Texte dieses Eintrags ersetzt.','Backend / Cloud Scan / AlertUninstalling the <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> failed.'=>'Deinstallation von <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> ist fehlgeschlagen.','Backend / Cloud Scan / AlertUninstalling the <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> failed: {{ message }}'=>'Deinstallation von <strong>{{ type }}</strong> <strong><em>{{ name }}</em></strong> ist fehlgeschlagen: {{ message }}','Backend / Cloud Scan / AlertThe package <strong><em>{{ name }}</em></strong> was successfully uninstalled.'=>'Das Paket <strong><em>{{ name }}</em></strong> wurde erfolgreich deinstalliert.','Backend / Global / Things to know / TextWe use the term <translation-key id="Synchronize-Configuration">Configuration</translation-key> to denote all settings except the texts associated with this entry. Synchronizing the <translation-key id="Configuration">Configuration</translation-key> will set the settings in the selected languages to those of this entry.'=>'Mit dem Begriff <translation-key id="Synchronize-Configuration">Konfiguration</translation-key> bezeichnen wir alle Einstellungen außer den Texten, die mit diesem Eintrag verbunden sind. Wenn Sie die <translation-key id="Configuration">Konfiguration</translation-key> synchronisieren, werden die Einstellungen in den ausgewählten Sprachen auf die dieses Eintrags gesetzt.','Backend / Cloud Scan / FieldHTTP authentication required'=>'HTTP-Authentifizierung erforderlich','Backend / Cloud Scan / FieldHTTP authentication - Password'=>'HTTP-Authentifizierung - Passwort','Backend / Cloud Scan / FieldHTTP authentication - Username'=>'HTTP-Authentifizierung - Benutzername','Backend / Cloud Scan / TipHTTP authentication'=>'HTTP-Authentifizierung','Backend / Cloud Scan / TipIf your website is protected by HTTP authentication, you can enter the username and password here, to allow the scanner to access your website. The credentials will be deleted after 7 days automatically.'=>'Wenn Ihre Website durch HTTP-Authentifizierung geschützt ist, können Sie hier den Benutzernamen und das Passwort eingeben, um dem Scanner den Zugriff auf Ihre Website zu ermöglichen. Die Anmeldedaten werden nach 7 Tagen automatisch gelöscht.','Backend / Global / Alert MessageThe <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> is still in use by the <strong>{{ blockingModelName }}</strong> <strong><em>{{ blockingModelLabel }}</em></strong>.'=>'Der <strong>{{ modelName }}</strong> <strong><em>{{ modelLabel }}</em></strong> wird noch vom <strong>{{ blockingModelName }}</strong> verwendet <strong><em>{{ blockingModelLabel }}</em></strong>.','Backend / Global / LabelAdditional Languages'=>'Zusätzliche Sprachen','Backend / Global / LabelSynchronize Configuration'=>'Konfiguration synchronisieren','Backend / Global / LabelSynchronize Translation'=>'Übersetzung synchronisieren','Backend / Global / HintCreate this entry also for other languages.'=>'Diesen Eintrag auch für andere Sprachen erstellen.','Backend / Global / HintSets all settings of this configuration as the configuration for the selected languages.'=>'Legt alle Einstellungen dieser Konfiguration als Konfiguration für die ausgewählten Sprachen fest.','Backend / Global / HintSet the configuration of this entry as the configuration for the selected languages.'=>'Legt die Konfiguration dieses Eintrags als die Konfiguration für die ausgewählten Sprachen fest.','Backend / Global / HintSets all texts of this translation as the texts for the selected languages. The texts are translated automatically.'=>'Legt alle Texte dieser Übersetzung als Texte für die ausgewählten Sprachen fest. Die Texte werden automatisch übersetzt.','Backend / Global / HintSet the translation of this entry as the translation for the selected languages. The texts are translated automatically.'=>'Legt die Übersetzung dieses Eintrags als Übersetzung für die ausgewählten Sprachen fest. Die Texte werden automatisch übersetzt.','Backend / Global / Things to know / HeadlineSynchronize <translation-key id="Synchronize-Configuration">Configuration</translation-key> Explained'=>'<translation-key id="Synchronize-Configuration">Konfiguration</translation-key> synchronisieren erklärt','Backend / Global / Things to know / HeadlineSynchronize <translation-key id="Synchronize-Translation">Translation</translation-key> Explained'=>'<translation-key id="Synchronize-Translation">Übersetzung</translation-key> synchronisieren erklärt','Backend / License / Alert MessageA valid license is required to use this feature of Borlabs Cookie. <a href="?page=borlabs-cookie-license">Click here</a> to enter your license key, or <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Um diese Funktion von Borlabs Cookie nutzen zu können, ist eine gültige Lizenz erforderlich. <a href="?page=borlabs-cookie-license">Klicken Sie hier</a>, um Ihren Lizenzschlüssel einzugeben, oder <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>klicken Sie hier</span><span class="brlbs-cmpnt-external-link-icon"></span></a>, um sich in Ihr Konto einzuloggen und eine Lizenzverlängerung zu erwerben.','Backend / License / Alert MessageYour license key is not valid for this version. This version of Borlabs Cookie was released after your license has expired, therefore you have to <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Ihr Lizenzschlüssel ist für diese Version nicht gültig. Diese Version von Borlabs Cookie wurde veröffentlicht, nachdem Ihre Lizenz abgelaufen ist, deshalb müssen Sie <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span>hier klicken</span><span class="brlbs-cmpnt-external-link-icon"></span></a>, um sich in Ihr Konto einzuloggen und eine Lizenzverlängerung zu erwerben.','Backend / License / Alert MessagePlease renew your license key to receive updates. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Bitte erneuern Sie Ihren Lizenzschlüssel, um Updates zu erhalten. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Klicken Sie hier</span><span class="brlbs-cmpnt-external-link-icon"></span></a>, um sich bei Ihrem Konto anzumelden und eine Lizenzverlängerung zu erwerben.','Backend / License / Alert MessageYour license has expired. This feature is not available with an expired license. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a> to log into your account and purchase a license renewal.'=>'Ihre Lizenz ist abgelaufen. Diese Funktion ist mit einer abgelaufenen Lizenz nicht verfügbar. <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" target="_blank" rel="nofollow noreferrer"><span>Klicken Sie hier</span><span class="brlbs-cmpnt-external-link-icon"></span></a>, um sich bei Ihrem Konto anzumelden und eine Lizenzverlängerung zu erwerben.','Backend / Dialog Settings / Things to know / TextCSS Class'=>'CSS-Klasse','Backend / Cloud Scan / AlertNo valid pages to scan where sent to the Borlabs Cloud API.'=>'Es wurden keine gültigen Seiten zum Scannen an die Borlabs Cloud API gesendet.','Backend / Cloud Scan / AlertThe scan includes too many pages.'=>'Der Scan umfasst zu viele Seiten.','Backend / Cloud Scan / AlertNo cookie found.'=>'Kein Cookie gefunden.','Frontend / Dialog / TextWe need your consent before you can continue on our website.'=>'Wir benötigen Ihre Einwilligung, bevor Sie unsere Website weiter besuchen können.','Backend / Dashboard / HintYou can choose how <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> updates automatically. Select from one of the four available options.<br><br>'=>'Sie können wählen, wie <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> automatisch aktualisiert wird. Wählen Sie eine der vier verfügbaren Optionen aus.<br><br>','Backend / Dashboard / Hint<translation-key id="All-versions">All versions</translation-key>: All updates are installed automatically.<br><br>'=>'<translation-key id="All-versions">Alle Versionen</translation-key>: Alle Updates werden automatisch installiert.<br><br>','Backend / Dashboard / HintA standard version number follows the format 1.0.3.0, where the segments represent <translation-key id="MAJOR">MAJOR</translation-key>, <translation-key id="MINOR">MINOR</translation-key>, <translation-key id="PATCH">PATCH</translation-key>, and <translation-key id="HOTFIX">HOTFIX</translation-key>, respectively.<br><br>'=>'Eine standardisierte Versionsnummer hat das Format 1.0.3.0, wobei die Segmente <translation-key id="MAJOR">MAJOR</translation-key>, <translation-key id="MINOR">MINOR</translation-key>, <translation-key id="PATCH">PATCH</translation-key> bzw. <translation-key id="HOTFIX">HOTFIX</translation-key> darstellen.<br><br>','Backend / Dashboard / Hint<translation-key id="No-automatic-update">No automatic update</translation-key>: Automatic updates are disabled; you must update manually.'=>'<translation-key id="No-automatic-update">Keine automatische Aktualisierung</translation-key>: Automatische Aktualisierungen sind deaktiviert; Sie müssen manuell aktualisieren.','Backend / Cloud Scan / TipNote: This column may be empty if the cookie is loaded from another resource, but for which a package is suggested. Once the suggested package is installed, the entry with the blank suggestion column is likely to be removed in the subsequent scan.'=>'Hinweis: Diese Spalte kann leer sein, wenn das Cookie von einer anderen Ressource geladen wird, für die aber ein Paket vorgeschlagen wird. Sobald das vorgeschlagene Paket installiert ist, wird der Eintrag mit der leeren Vorschlagsspalte beim nächsten Scan wahrscheinlich entfernt.','Backend / Cloud Scan / TipNote: This column may be empty if the resource is loaded from another resource, but for which a package is suggested. Once the suggested package is installed, the entry with the blank suggestion column is likely to be removed in the subsequent scan.'=>'Hinweis: Diese Spalte kann leer sein, wenn die Ressource von einer anderen Ressource geladen wird, für die aber ein Paket vorgeschlagen wird. Sobald das vorgeschlagene Paket installiert ist, wird der Eintrag mit der leeren Vorschlagsspalte beim nächsten Scan wahrscheinlich entfernt.','Backend / Settings / HintNumber of days until the visitor is asked again for their consent, if the user has only given consent to essential <translation-key id="Services">Services</translation-key>. Remember to adjust the <translation-key id="Cookie-Lifetime">Cookie Lifetime</translation-key> information of the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Cookie">Cookie</translation-key> under <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Anzahl der Tage, bis der Besucher erneut um seine Einwilligung gebeten wird, wenn der Benutzer nur für essenzielle <translation-key id="Services">Services</translation-key> seine Einwilligung gegeben hat. Denken Sie daran, die Informationen zur <translation-key id="Cookie-Lifetime">Lebensdauer</translation-key> des <translation-key id="Cookie">Cookies</translation-key> von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> unter <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> anzupassen.','Backend / Library / Alert MessageAll copyrights, trademarks, and other intellectual property rights mentioned or displayed in this library belong to their respective owners. Unless explicitly stated, these entities are not affiliated, endorsed by, or in any way associated with us.'=>'Alle Urheberrechte, Warenzeichen und sonstigen Rechte an geistigem Eigentum, die in dieser Bibliothek erwähnt oder angezeigt werden, gehören ihren jeweiligen Eigentümern. Sofern nicht ausdrücklich angegeben, sind diese Unternehmen nicht mit uns verbunden, werden nicht von uns unterstützt und stehen in keiner Weise mit uns in Verbindung.','Backend / System Check / Table HeadlineLibrary Database Last Check with API'=