n-key id="Service-Groups">Service Groups</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Service-Groups">Service-Gruppen</translation-key>?','Backend / Settings / FieldsFoo'=>'Foo','Backend / Service Groups / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Service Groups / Things to know / Text<translation-key id="Services">Services</translation-key> can be grouped thematically into <translation-key id="Service-Groups">Service Groups</translation-key> which are displayed to the visitor. Unused <translation-key id="Service-Groups">Service Groups</translation-key> can be disabled, new ones can be added. The <translation-key id="Service-Group">Service Group</translation-key>: <translation-key id="Essential">Essential</translation-key> cannot be deactivated. All <translation-key id="Services">Services</translation-key> belonging to <translation-key id="Essential">Essential</translation-key> are always issued. An active <translation-key id="Service-Group">Service Group</translation-key> is only displayed in the <translation-key id="Dialog">Dialog</translation-key>, if at least one active <translation-key id="Service">Service</translation-key> is assigned to it.'=>'<translation-key id="Services">Services</translation-key> können thematisch in <translation-key id="Service-Groups">Service-Gruppen</translation-key> gruppiert werden, die dem Besucher angezeigt werden. Nicht genutzte <translation-key id="Service-Groups">Service-Gruppen</translation-key> können deaktiviert werden, neue können hinzugefügt werden. Die <translation-key id="Service-Group">Service-Gruppe</translation-key>: <translation-key id="Essential">Essenziell</translation-key> kann nicht deaktiviert werden. Alle zu <translation-key id="Essential">Essenziell</translation-key> gehörenden <translation-key id="Services">Services</translation-key> werden immer ausgegeben. Eine aktive <translation-key id="Service-Group">Service-Gruppe</translation-key> wird im <translation-key id="Dialog">Dialog</translation-key> nur dann angezeigt, wenn ihr mindestens ein aktiver <translation-key id="Service">Service</translation-key> zugewiesen ist.','Backend / Service Groups / Things to know / TextThe <translation-key id="Service-Group">Service Group</translation-key> is active and displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service-Group">Service Group</translation-key>: <translation-key id="Essential">Essential</translation-key>.'=>'Die <translation-key id="Service-Group">Service-Gruppe</translation-key> ist aktiv und wird im <translation-key id="Dialog">Dialog</translation-key> angezeigt. Nicht verfügbar für die <translation-key id="Service-Group">Service-Gruppe</translation-key>: <translation-key id="Essential">Essenziell</translation-key>.','Backend / Service Groups / Things to know / TextDelete the <translation-key id="Service-Group">Service Group</translation-key>. Not available for default <translation-key id="Service-Groups">Service Groups</translation-key>.'=>'Löschen Sie die <translation-key id="Service-Group">Service-Gruppe</translation-key>. Nicht verfügbar für Standard <translation-key id="Service-Groups">Service-Gruppen</translation-key>.','Backend / Service Groups / Things to know / TextEdit the <translation-key id="Service-Group">Service Group</translation-key>.'=>'Bearbeiten Sie die <translation-key id="Service-Group">Service-Gruppe</translation-key>.','Backend / Service Groups / Things to know / TextThe <translation-key id="Service-Group">Service Group</translation-key> is inactive and not displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service-Group">Service Group</translation-key>: <translation-key id="Essential">Essential</translation-key>.'=>'Die <translation-key id="Service-Group">Service-Gruppe</translation-key> ist inaktiv und wird im <translation-key id="Dialog">Dialog</translation-key> nicht angezeigt. Nicht verfügbar für die <translation-key id="Service-Group">Service-Gruppe</translation-key>: <translation-key id="Essential">Essenziell</translation-key>.','Backend / Settings / Alert MessageYour configured domain is different from the website domain. The setting may be incorrect and will cause the Dialog to reappear on each page.'=>'Ihre konfigurierte Domain unterscheidet sich von der Domain der Website. Die Einstellung ist möglicherweise falsch und führt dazu, dass der Dialog auf jeder Seite erneut angezeigt wird.','Backend / Settings / Alert MessageYou have enabled <translation-key id="Do-Not-Track">&quot;Do Not Track&quot;</translation-key> in your browser therefore you will not see the <translation-key id="Dialog">Dialog</translation-key> on your website.'=>'Sie haben <translation-key id="Do-Not-Track">&quot;Do Not Track&quot;</translation-key> in Ihrem Browser aktiviert, daher werden Sie den <translation-key id="Dialog">Dialog</translation-key> auf Ihrer Website nicht sehen.','Backend / Settings / Alert MessageIf this option is active, most likely all visits will be counted as "Direct visits" and the origin will be lost. We therefore recommend not to activate this option!'=>'Wenn diese Option aktiviert ist, werden höchstwahrscheinlich alle Besuche als "Direktbesuche" gezählt und der Ursprung geht verloren. Wir empfehlen daher, diese Option nicht zu aktivieren!','Backend / Settings / Alert MessageOnly activate this option if you need to reload your page after consent. Less than 1 &#37; of all <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> customers need this option enabled. If you don\'t know if you need this option, you won\'t need it.'=>'Aktivieren Sie diese Option nur, wenn Sie Ihre Seite nach der Einwilligung neu laden müssen. Weniger als 1 &#37; aller <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> Kunden benötigen diese Option. Wenn Sie nicht wissen, ob Sie diese Option benötigen, werden Sie sie nicht brauchen.','Backend / Settings / BreadcrumbSettings'=>'Einstellungen','Backend / Settings / LabelAggregate Consents'=>'Einwilligungen aggregieren','Backend / Settings / LabelAutomatic Domain and Path Detection'=>'Automatische Erkennung von Domain und Pfaden','Backend / Settings / Label<translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>'=>'<translation-key id="Borlabs-Cookie-Status">Borlabs Cookie-Status</translation-key>','Backend / Settings / LabelDomain'=>'Domain','Backend / Settings / LabelCookie Lifetime in Days'=>'Cookie-Lebensdauer in Tagen','Backend / Settings / LabelCookie Lifetime in Days - Essential Only'=>'Cookie-Lebensdauer in Tagen - nur Essenziell','Backend / Settings / LabelPath'=>'Pfad','Backend / Settings / Label<translation-key id="Secure-Attribute">Secure attribute</translation-key>'=>'<translation-key id="Secure-Attribute">Secure-Attribut</translation-key>','Backend / Settings / LabelCookie Version'=>'Cookie-Version','Backend / Settings / LabelCookies for Bots/Crawlers'=>'Cookies für Bots/Crawler','Backend / Settings / LabelCross Cookie Domains'=>'Cross-Cookie-Domains','Backend / Settings / LabelDisplay Meta Box'=>'Meta-Box anzeigen','Backend / Settings / LabelReload After Opt-in'=>'Nach Opt-in neu laden','Backend / Settings / LabelReload After Opt-out'=>'Nach Opt-out neu laden','Backend / Settings / LabelSetup Mode'=>'Setup-Modus','Backend / Settings / Label<translation-key id="UpdateCookieVersionForceRe-Selection">Update Cookie Version &amp; Force Re-Selection</translation-key>'=>'<translation-key id="UpdateCookieVersionForceRe-Selection">Cookie-Version aktualisieren &amp; Neuauswahl erzwingen</translation-key>','Backend / Settings / HeadlineCookie Settings'=>'Cookie-Einstellungen','Backend / Settings / HeadlineGeneral Settings'=>'Allgemeine Einstellungen','Backend / Cookie Box / HeadlineReset General Settings'=>'Allgemeine Einstellungen zurücksetzen','Backend / Settings / HintAggregate the consents of all WordPress sites in one table.'=>'Aggregieren Sie die Einwilligungen aller WordPress-Sites in einer Tabelle.','Backend / Settings / Hint<translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> tries to automatically detect domain and path.'=>'<translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> versucht, Domain und Pfad automatisch zu erkennen.','Backend / Settings / HintActivates <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> on your website. Displays the <translation-key id="Dialog">Dialog</translation-key> and blocks iframes and other external media.'=>'Aktiviert <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> auf Ihrer Website. Zeigt den <translation-key id="Dialog">Dialog</translation-key> an und blockiert Iframes und andere externe Medien.','Backend / Settings / HintSpecify the domain scheme for which the cookie is valid. Example: If you enter <strong><em>example.com</em></strong> the cookie is also valid for subdomains like <strong><em>shop.example.com</em></strong>.'=>'Geben Sie das Domain-Schema an, für das das Cookie gültig ist. Beispiel: Wenn Sie <strong><em>example.com</em></strong> eingeben, ist das Cookie auch für Subdomains gültig wie <strong><em>shop.example.com</em></strong>.','Backend / Settings / HintNumber of days until the visitor is asked again for their consent. Remember to adjust the <translation-key id="Cookie-Lifetime">Cookie Lifetime</translation-key> information of the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Cookie">Cookie</translation-key> under <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Anzahl der Tage, bis der Besucher erneut nach seiner Einwilligung gefragt wird. Denken Sie daran, die Informationen zur <translation-key id="Cookie-Lifetime">Lebensdauer</translation-key> des <translation-key id="Cookie">Cookies</translation-key> von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> unter <translation-key id="Services">Services</translation-key> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> anzupassen.','Backend / Settings / HintThe path for which the cookie is valid. Default path: <strong>{{ networkPath }}</strong>'=>'Der Pfad, für den das Cookie gültig ist. Standard-Pfad: <strong>{{ networkPath }}</strong>','Backend / Settings / HintThe <translation-key id="SameSite-Attribute">SameSite attribute</translation-key> defines how the browser should handle cookies in cross-site requests. We recommend using the <strong>Lax</strong> option.'=>'Das <translation-key id="SameSite-Attribute">SameSite-Attribut</translation-key> legt fest, wie der Browser Cookies bei seitenübergreifenden Anfragen behandeln soll. Wir empfehlen die Verwendung der Option <strong>Lax</strong>.','Backend / Settings / HintA cookie with the <translation-key id="Secure-Attribute">Secure attribute</translation-key> is sent to the server only in case of an encrypted request via the HTTPS protocol.'=>'Ein Cookie mit dem <translation-key id="Secure-Attribute">Secure-Attribut</translation-key> wird nur im Falle einer verschlüsselten Anfrage über das HTTPS-Protokoll an den Server gesendet.','Backend / Settings / HintShows the version of the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Increases with activating <translation-key id="UpdateCookieVersionForceRe-Selection">Update Cookie Version &amp; Force Re-Selection</translation-key>.'=>'Zeigt die Version des Cookies von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> an. Erhöht sich mit der Aktivierung von <translation-key id="UpdateCookieVersionForceRe-Selection">Cookie-Version aktualisieren &amp; Neuauswahl erzwingen</translation-key>.','Backend / Settings / HintA bot/crawler is treated like a visitor who accepted all <translation-key id="Services">Services</translation-key>.'=>'Ein Bot/Crawler wird wie ein Besucher behandelt, der alle <translation-key id="Services">Services</translation-key> akzeptiert hat.','Backend / Settings / HintAdd one URL per line. Insert WordPress Address (URL). URL must end with <strong>/</strong>. Consent will be shared between websites.'=>'Fügen Sie eine URL pro Zeile ein. Fügen Sie die WordPress-Adresse (URL) ein. Die URL muss mit <strong>/</strong> enden. Die Einwilligungen werden zwischen Websites weitergegeben.','Backend / Settings / HintDisplay the <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Meta-Box">Meta Box</translation-key> on the selected post types. The <translation-key id="Meta-Box">Meta Box</translation-key> allows you to add custom JavaScript on specific pages.'=>'Zeigen Sie die <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> <translation-key id="Meta-Box">Meta-Box</translation-key> auf den ausgewählten Beitragstypen an. Die <translation-key id="Meta-Box">Meta-Box</translation-key> ermöglicht es Ihnen, benutzerdefiniertes JavaScript auf bestimmten Seiten hinzuzufügen.','Backend / Settings / HintIf enabled, the website will be reloaded after the visitor saves their consent.'=>'Wenn diese Option aktiviert ist, wird die Website neu geladen, nachdem der Besucher seine Einwilligung gespeichert hat.','Backend / Settings / HintIf enabled, the website will be reloaded after the visitor opt out.'=>'Wenn diese Option aktiviert ist, wird die Website nach dem Opt-out des Besuchers neu geladen.','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Settings">Settings</translation-key> settings. They will be reset to their default settings.'=>'Bitte bestätigen Sie, dass Sie alle <translation-key id="Settings">Einstellungen</translation-key> zurücksetzen möchten. Sie werden auf ihre Standardeinstellungen zurückgesetzt.','Backend / Settings / HintA visitor with active <translation-key id="Do-Not-Track">&quot;Do Not Track&quot;</translation-key> setting will not see the <translation-key id="Dialog">Dialog</translation-key> and <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> automatically selects the <translation-key id="Accept-Only-Essential">Accept Only Essential</translation-key> option.'=>'Ein Besucher mit aktiver <translation-key id="Do-Not-Track">&quot;Do Not Track&quot;</translation-key>-Einstellung wird den <translation-key id="Dialog">Dialog</translation-key> nicht sehen und <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> wählt automatisch die <translation-key id="Accept-Only-Essential">Nur essenzielle akzeptieren</translation-key>-Option.','Backend / Settings / HintWith Setup Mode enabled, you can test your setup without having to enable <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>. Only you will see the <translation-key id="Dialog">Dialog</translation-key> on your website.'=>'Wenn der Setup-Modus aktiviert ist, können Sie Ihr Setup testen, ohne den <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie-Status</translation-key> aktivieren zu müssen. Nur Sie werden den <translation-key id="Dialog">Dialog</translation-key> auf Ihrer Website sehen.','Backend / Settings / HintUpdates the version of the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. This will cause the <translation-key id="Dialog">Dialog</translation-key> to reappear for visitors who have already selected an option.'=>'Aktualisiert die Version des Cookies von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. Dies führt dazu, dass der <translation-key id="Dialog">Dialog</translation-key> für Besucher, die bereits eine Option ausgewählt haben, erneut angezeigt wird.','Backend / Settings / TextVersion'=>'Version','Backend / Settings / Things to know / TextWhen you have to aggregate the consent:'=>'Wann Sie die Einwilligung aggregieren müssen:','Backend / Settings / Things to know / Text- if one site is using only the domain (e.g. <strong><em>example.com</em></strong>) and the other site a subdomain (e.g. <strong><em>shop.example.com</em></strong>)'=>'- wenn eine Website nur die Domain verwendet (z. B. <strong><em>example.com</em></strong>) und die andere Site eine Subdomain (z. B. <strong><em>shop.example.com</em></strong>)','Backend / Settings / Things to know / Text- if one site is using the root folder <strong>/</strong> and the other site a subfolder (e.g. <strong>/shop</strong>)'=>'- wenn eine Website den Stammordner <strong>/</strong> und die andere Website einen Unterordner (z. B. <strong>/shop</strong>) verwendet','Backend / Settings / Things to know / TextWhen you can separate the consent:'=>'Wann Sie die Einwilligung trennen können:','Backend / Settings / Things to know / Text- if all sites are using different domains (e.g. <strong><em>example.com</em></strong> and <strong><em>my-example.com</em></strong>) or different subdomains (e.g. <strong><em>www.example.com</em></strong> and <strong><em>shop.example.com</em></strong>)'=>'- wenn alle Sites unterschiedliche Domains verwenden (z. B. <strong><em>example.com</em></strong> und <strong><em>my-example.com</em></strong>) oder verschiedene Subdomains (z. B. <strong><em>www.example.com</em></strong> and <strong><em>shop.example.com</em></strong>)','Backend / Settings / Things to know / Text- if all sites are using different subfolders (e.g. <strong>/en</strong> and <strong>/de</strong>)'=>'- wenn alle Seiten (Instanzen) unterschiedliche Unterordner verwenden (z. B. <strong>/en</strong> und <strong>/de</strong>)','Backend / Settings / Things to know / TextThe visitor\'s consent is transferred to all specified domains and WordPress installations, provided the websites are set up in the same way (<translation-key id="Service">Service</translation-key> and <translation-key id="Service-Group">Service Group</translation-key> IDs must match). Any consent or modification by the visitor will be shared with the specified domains.'=>'Die Einwilligung des Besuchers wird auf alle angegebenen Domains und WordPress-Installationen übertragen, sofern die Websites auf dieselbe Weise eingerichtet sind  (die IDs des <translation-key id="Service">Services</translation-key> und der <translation-key id="Service-Group">Service-Gruppe</translation-key> müssen übereinstimmen). Jede Einwilligung oder Änderung des Besuchers wird an die angegebenen Domains weitergegeben.','Backend / Settings / Things to know / Text<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>More information about <translation-key id="Cross-Cookie-Domains">Cross Cookie Domains</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>'=>'<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Weitere Informationen über <translation-key id="Cross-Cookie-Domains">Cross-Cookie-Domains</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>','Backend / Settings / Things to know / HeadlineAggregate Consents'=>'Einwilligungen aggregieren','Backend / Settings / Things to know / Headline<translation-key id="Cross-Cookie-Domains">Cross Cookie Domains</translation-key>'=>'<translation-key id="Cross-Cookie-Domains">Cross-Cookie-Domains</translation-key>','Backend / Settings / Things to know / HeadlineWhat is the Cookie Version?'=>'Was ist die Cookie-Version?','Backend / Settings / Things to know / HeadlineWhat is the Meta Box?'=>'Was ist die Meta-Box?','Backend / Settings / Things to know / TextThe cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> is assigned a version number. It is used to ask the visitor again for their consent if changes have been made to the <translation-key id="Services">Services</translation-key>. If the version number in the cookie differs from the current version number, the <translation-key id="Dialog">Dialog</translation-key> appears to the visitor.'=>'Das Cookie von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> ist mit einer Versionsnummer versehen. Es wird verwendet, um den Besucher erneut um seine Einwilligung zu bitten, wenn Änderungen an den <translation-key id="Services">Services</translation-key> vorgenommen wurden. Wenn die Versionsnummer im Cookie von der aktuellen Versionsnummer abweicht, wird dem Besucher der <translation-key id="Dialog">Dialog</translation-key> angezeigt.','Backend / Settings / Things to know / TextIf active the <translation-key id="Meta-Box">Meta Box</translation-key> is displayed in the selected post types. This allows you to execute code (JavaScript, HTML, <translation-key id="Shortcodes">Shortcodes</translation-key>) on the page and e.g. trigger a conversion pixel.'=>'Wenn aktiv, wird die <translation-key id="Meta-Box">Meta-Box</translation-key> in den ausgewählten Beitragstypen angezeigt. Damit können Sie Code (JavaScript, HTML, <translation-key id="Shortcodes">Shortcodes</translation-key>) auf der Seite ausführen und z. B. ein Conversion-Pixel auslösen.','Backend / Settings / URLhttps://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis'=>'https://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis','Backend / Style Blocker / BreadcrumbEdit: {{ name }}'=>'Bearbeiten: {{ name }}','Backend / Style Blocker / BreadcrumbStyle Blockers'=>'Style-Blocker','Backend / Style Blocker / BreadcrumbNew'=>'Neu','Backend / Script Blocker / Field LabelContent Blocker Global JavaScript'=>'Content-Blocker Global-JavaScript','Backend / Style Blocker / LabelHandles'=>'Handles','Backend / Style Blocker / LabelID'=>'ID','Backend / Style Blocker / LabelName'=>'Name','Backend / Style Blocker / LabelPhrases'=>'Phrasen','Backend / Script Blocker / LabelService Opt-in Script Tag'=>'Service Opt-in Script-Tag','Backend / Style Blocker / LabelStatus'=>'Status','Backend / Style Blocker / HeadlineStyle Blocker Configuration'=>'Style-Blocker-Konfiguration','Backend / Style Blocker / HeadlineStyle Blocker Information'=>'Style-Blocker-Informationen','Backend / Style Blocker / HeadlineStyle Blocker Settings'=>'Style-Blocker-Einstellungen','Backend / Script Blocker / HintIf your intention is to unblock previously blocked <translation-key id="Styles">Styles</translation-key> upon unblocking a <translation-key id="Content-Blocker">Content Blocker</translation-key>, please insert the provided JavaScript into the <translation-key id="Global">Global</translation-key> field within your <translation-key id="Content-Blocker">Content Blocker</translation-key> settings.'=>'Wenn Sie beabsichtigen, zuvor gesperrte <translation-key id="Styles">Styles</translation-key> bei der Entsperrung eines <translation-key id="Content-Blocker">Content-Blockers</translation-key> zu entsperren, fügen Sie bitte das bereitgestellte JavaScript in das Feld <translation-key id="Global">Global</translation-key> in Ihren <translation-key id="Content-Blocker">Content-Blocker</translation-key>-Einstellungen ein.','Backend / Style Blocker / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'<translation-key id="ID">ID</translation-key> muss festgelegt werden. Die <translation-key id="ID">ID</translation-key> muss mindestens 3 Zeichen lang sein und darf nur enthalten: <strong><em>a-z - _</em></strong>','Backend / Style Blocker / HintThe name of the <translation-key id="Style-Blocker">Style Blocker</translation-key>.'=>'Der Name des <translation-key id="Style-Blocker">Style-Blockers</translation-key>.','Backend / Script Blocker / HintTo allow the unblocking of previously blocked <translation-key id="Styles">Styles</translation-key> through user consent for a <translation-key id="Service">Service</translation-key>, please insert the ensuing script tag into the field labeled <translation-key id="Opt-in-Code">Opt-in Code</translation-key> within your <translation-key id="Service">Service</translation-key>.'=>'Um die Entsperrung von zuvor gesperrten <translation-key id="Styles">Styles</translation-key> durch die Einwilligung des Nutzers für einen <translation-key id="Service">Service</translation-key> zu ermöglichen, fügen Sie bitte den folgenden Script-Tag in das Feld <translation-key id="Opt-in-Code">Opt-in-Code</translation-key> in Ihrem <translation-key id="Service">Service</translation-key> ein.','Backend / Style Blocker / HintThe status of this <translation-key id="Style-Blocker">Style Blocker</translation-key>. If the <translation-key id="Style-Blocker">Style Blocker</translation-key> is disabled, it will not block stylesheets and style-tags.'=>'Der Status dieses <translation-key id="Style-Blocker">Style-Blockers</translation-key>. Wenn der <translation-key id="Style-Blocker">Style-Blocker</translation-key> deaktiviert ist, werden Stylesheets und Style-Tags nicht blockiert.','Backend / Style Blockers / Alert MessageNo <translation-key id="Style-Blocker">Style Blocker</translation-key> configured.'=>'Kein <translation-key id="Style-Blocker">Style-Blocker</translation-key> konfiguriert.','Backend / Style Blockers / BreadcrumbStyle Blockers'=>'Style-Blocker','Backend / Style Blockers / HeadlineStyle Blockers'=>'Style-Blocker','Backend / Style Blockers / Table HeadlineHandles'=>'Handles','Backend / Style Blockers / Table HeadlineID'=>'ID','Backend / Style Blockers / Table HeadlineName'=>'Name','Backend / Style Blockers / Table HeadlinePhrases'=>'Phrasen','Backend / Style Blockers / Table HeadlineStatus'=>'Status','Backend / Style Blockers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Style-Blockers">Style Blockers</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Style-Blockers">Style-Blocker</translation-key>?','Backend / Style Blockers / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Style Blockers / Tip / HeadlineLanguage independent'=>'Sprachunabhängig','Backend / Style Blockers / Tip / Text<translation-key id="Style-Blockers">Style Blockers</translation-key> are configured independently for all languages.'=>'<translation-key id="Style-Blockers">Style-Blocker</translation-key> werden für alle Sprachen unabhängig voneinander konfiguriert.','Backend / Style Blockers / Things to know / TextThe <translation-key id="Style-Blockers">Style Blockers</translation-key> section allows you to block <translation-key id="CSS">CSS</translation-key> from <translation-key id="Plugins">Plugins</translation-key> that, for example, embed <translation-key id="CSS">CSS</translation-key> to load external fonts like <translation-key id="Google-Fonts">Google Fonts</translation-key>.'=>'Im Bereich <translation-key id="Style-Blockers">Style-Blocker</translation-key> können Sie <translation-key id="CSS">CSS</translation-key> von <translation-key id="Plugins">Plugins</translation-key> blockieren, die z. B. <translation-key id="CSS">CSS</translation-key> zum Laden externer Schriftarten wie <translation-key id="Google-Fonts">Google Fonts</translation-key> einbetten.','Backend / Style Blockers / Things to know / TextOnce a <translation-key id="Style-Blocker">Style Blocker</translation-key> is created, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> provides an unblock JavaScript that can be entered into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>. The <translation-key id="CSS">CSS</translation-key> becomes unblocked once a visitor consents to the <translation-key id="Service">Service</translation-key>.'=>'Sobald ein <translation-key id="Style-Blocker">Style-Blocker</translation-key> erstellt wurde, stellt <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> ein JavaScript zur Verfügung, das in das <translation-key id="Opt-in-Code">Opt-in-Code</translation-key>-Feld eines <translation-key id="Service">Services</translation-key> eingegeben werden kann. Das <translation-key id="CSS">CSS</translation-key> wird entsperrt, sobald ein Besucher dem <translation-key id="Service">Service</translation-key> einwilligt.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Style-Blocker">Style Blocker</translation-key> is enabled and actively prevents <translation-key id="CSS">CSS</translation-key> execution if the <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key> matches a term configured in the system.'=>'Der <translation-key id="Style-Blocker">Style-Blocker</translation-key> ist aktiviert und verhindert aktiv die Ausführung von <translation-key id="CSS">CSS</translation-key>, wenn die <translation-key id="Handles">Handles</translation-key> oder <translation-key id="Phrases">Phrasen</translation-key> mit einem im System konfigurierten Begriff übereinstimmen.','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Style-Blocker">Style Blocker</translation-key>. Not available for a <translation-key id="Style-Blocker">Style Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Löschen Sie den <translation-key id="Style-Blocker">Style-Blocker</translation-key>. Nicht verfügbar für einen <translation-key id="Style-Blockers">Style-Blocker</translation-key>, der über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installiert wurde.','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Style-Blocker">Style Blocker</translation-key>.'=>'Bearbeiten Sie den <translation-key id="Style-Blocker">Style-Blocker</translation-key>.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Style-Blocker">Style Blocker</translation-key> is inactive, allowing all <translation-key id="CSS">CSS</translation-key> are executed without filtering or restricting based on <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key>.'=>'Der <translation-key id="Style-Blocker">Style-Blocker</translation-key> ist inaktiv, so dass alle <translation-key id="CSS">CSS</translation-key> ohne Filterung oder Einschränkung auf der Grundlage von <translation-key id="Handles">Handles</translation-key> oder <translation-key id="Phrases">Phrasen</translation-key> ausgeführt werden.','Backend / GeoIp / Alert MessageConnecting to the API failed. Please check that Wordpress has access to the Internet or retry later.'=>'Der Verbindungsaufbau zur API ist fehlgeschlagen. Bitte prüfen Sie, ob Wordpress Zugriff auf das Internet hat oder versuchen Sie es später erneut.','Backend / GeoIp / Alert MessageMoving the database file failed.'=>'Das Verschieben der Datenbankdatei ist fehlgeschlagen.','Backend / GeoIp / Alert MessagePlease enable GeoIP before downloading the database.'=>'Bitte aktivieren Sie GeoIP, bevor Sie die Datenbank herunterladen.','Backend / GeoIp / Alert MessageThe database was successfully updated.'=>'Die Datenbank wurde erfolgreich aktualisiert.','Backend / GeoIp / Alert MessageYou already have the most up-to-date database.'=>'Sie verfügen bereits über die aktuellste Datenbank.','Backend / GeoIp / Alert MessageUnpacking the database to the temporary folder failed. Please check if the temporary folder is writable and the PHP module ZIP is installed.'=>'Das Entpacken der Datenbank in den temporären Ordner ist fehlgeschlagen. Bitte prüfen Sie, ob der temporäre Ordner beschreibbar ist und das PHP-Modul ZIP installiert ist.','Backend / Model Loca