rd einmal ausgeführt.','Backend / Services / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to display an opt-out option for this <translation-key id="Service">Service</translation-key>.'=>'Verwenden Sie diesen <translation-key id="Shortcode">Shortcode</translation-key>, um eine Opt-out-Option für diesen <translation-key id="Service">Service</translation-key> anzuzeigen.','Backend / Services / HintDetermine the position where this <translation-key id="Service">Service</translation-key> is displayed in its <translation-key id="Service-Group">Service Group</translation-key>. Order follows natural numbers.'=>'Bestimmen Sie die Position, an der dieser <translation-key id="Service">Service</translation-key> in seiner <translation-key id="Service-Group">Service-Gruppe</translation-key> angezeigt wird. Die Reihenfolge folgt natürlichen Zahlen.','Backend / Services / HintA <translation-key id="Service">Service</translation-key> must be linked to a <translation-key id="Provider">Provider</translation-key>. You may choose an existing <translation-key id="Provider">Provider</translation-key> or establish a new one. Please note, the option to create a new <translation-key id="Provider">Provider</translation-key> is available exclusively during the <translation-key id="Service">Service</translation-key> creation process within this view.'=>'Ein <translation-key id="Service">Service</translation-key> muss mit einem <translation-key id="Provider">Provider</translation-key> verknüpft sein. Sie können einen bestehenden <translation-key id="Provider">Provider</translation-key> auswählen oder einen neuen Provider erstellen. Bitte beachten Sie, dass die Option, einen neuen <translation-key id="Provider">Provider</translation-key> zu erstellen, ausschließlich während der Erstellung eines <translation-key id="Service">Services</translation-key> in dieser Ansicht verfügbar ist.','Backend / Services / HintThe <translation-key id="Service-Group">Service Group</translation-key> the <translation-key id="Service">Service</translation-key> is part of.'=>'Die <translation-key id="Service-Group">Service-Gruppe</translation-key>, zu der der <translation-key id="Service">Service</translation-key> gehört.','Backend / Services / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to unblock JavaScript or content when user opted-in for this <translation-key id="Service">Service</translation-key>.'=>'Verwenden Sie diesen <translation-key id="Shortcode">Shortcode</translation-key>, um JavaScript oder Inhalte freizugeben, wenn der Benutzer für diesen <translation-key id="Service">Service</translation-key> Opt-in gewählt hat.','Backend / Services / HintThe status of this <translation-key id="Service">Service</translation-key>. If enabled it is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Der Status dieses <translation-key id="Service">Services</translation-key>. Ist er aktiv, wird er dem Besucher im <translation-key id="Dialog">Dialog</translation-key> angezeigt.','Backend / Services / Input Placeholder...block this...'=>'...dies blockieren...','Backend / Services / Input PlaceholderNever'=>'Niemals','Backend / Services / Table HeadlineLifetime'=>'Lebensdauer','Backend / Services / Table HeadlineName'=>'Name','Backend / Library / HintThe <translation-key id="Services">Services</translation-key> are included in this package and are necessary for the proper functioning of this package. They are installed when you click the <translation-key id="Button-Install">Install</translation-key> / <translation-key id="Button-Reinstall">Reinstall</translation-key> / <translation-key id="Button-Update">Update</translation-key> button. You can locate them later using the displayed name and key in the <translation-key id="Services">Services</translation-key> view (<translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Services">Services</translation-key>).'=>'Die <translation-key id="Services">Services</translation-key> sind in diesem Paket enthalten und für das ordnungsgemäße Funktionieren dieses Pakets erforderlich. Sie werden installiert, wenn Sie auf den Button <translation-key id="Button-Install">Installieren</translation-key> / <translation-key id="Button-Reinstall">Neu installieren</translation-key> / <translation-key id="Button-Update">Aktualisieren</translation-key> klicken. Sie können sie später anhand des angezeigten Namens und Schlüssels in der Ansicht <translation-key id="Services">Services</translation-key> finden (<translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Services">Services</translation-key>).','Backend / Services / Table HeadlinePurpose'=>'Zweck','Backend / Library / HintThe <translation-key id="Style-Blockers">Style Blockers</translation-key> are included in this package and are necessary for the proper functioning of this package. They are installed when you click the <translation-key id="Button-Install">Install</translation-key> / <translation-key id="Button-Reinstall">Reinstall</translation-key> / <translation-key id="Button-Update">Update</translation-key> button. You can locate them later using the displayed name and key in the <translation-key id="Style-Blockers">Style Blockers</translation-key> view (<translation-key id="Navigation-Blockers">Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Style-Blockers">Style Blockers</translation-key>).'=>'Die <translation-key id="Style-Blockers">Style-Blocker</translation-key> sind in diesem Paket enthalten und sind für das ordnungsgemäße Funktionieren dieses Pakets erforderlich. Sie werden installiert, wenn Sie auf den Button <translation-key id="Button-Install">Installieren</translation-key> / <translation-key id="Button-Reinstall">Neu installieren</translation-key> / <translation-key id="Button-Update">Aktualisieren</translation-key> klicken. Sie können sie später anhand des angezeigten Namens und Keys in der Ansicht <translation-key id="Style-Blockers">Style-Blocker</translation-key> finden (<translation-key id="Navigation-Blockers">Blocker</translation-key> &raquo; <translation-key id="Navigation-Blockers-Style-Blockers">Style-Blocker</translation-key>).','Backend / Services / Table HeadlineType'=>'Typ','Backend / Library / NavigationAll'=>'Alle','Backend / Services / Things to know / TextIf you enable this option <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> searches and deletes cookies that match the <translation-key id="Name">Name</translation-key> (<translation-key id="Cookies">Cookies</translation-key> &raquo; <translation-key id="Name">Name</translation-key>). You can also use <strong>*</strong> to search for multiple names, e.g. if you enter the Name <strong><em>example_*</em></strong> <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> will search and delete the cookies <strong><em>example_abc</em></strong> and <strong><em>example_xyz</em></strong>.'=>'Wenn Sie diese Option aktivieren, sucht und löscht <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> die Cookies, die mit dem <translation-key id="Name">Namen</translation-key> übereinstimmen (<translation-key id="Cookies">Cookies</translation-key> &raquo; <translation-key id="Name">Name</translation-key>). Sie können auch <strong>*</strong> verwenden, um nach mehreren Namen zu suchen, z. B. wenn Sie den Namen <strong><em>example_*</em></strong> eingeben, wird <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> die Cookies <strong><em>example_abc</em></strong> und <strong><em>example_xyz</em></strong> suchen und löschen.','Backend / Library / NavigationFilter'=>'Filter','Backend / Services / Things to know / TextThis function is mainly intended to delete session cookies set 