Script Blockers</translation-key>'=>'<translation-key id="Script-Blockers">Script-Blocker</translation-key>','Backend / Services / Things to know / Headline<translation-key id="Prioritize">Prioritize</translation-key>'=>'<translation-key id="Prioritize">Priorisieren</translation-key>','Backend / Library / Navigation<translation-key id="Services">Services</translation-key>'=>'<translation-key id="Services">Services</translation-key>','Backend / Services / Things to know / HeadlineWhat is the purpose of <translation-key id="Provider">Provider</translation-key> information?'=>'Wozu dienen die Informationen des <translation-key id="Provider">Providers</translation-key>?','Backend / Library / Navigation<translation-key id="Style-Blockers">Style Blockers</translation-key>'=>'<translation-key id="Style-Blockers">Style-Blocker</translation-key>','Backend / Services / Things to know / HeadlineOpt-out Shortcode explained'=>'Opt-out-Shortcode erklärt','Backend / Library / Input PlaceholderSearch'=>'Suchen','Backend / Services / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'<translation-key id="Shortcode">Shortcode</translation-key> erklärt','Backend / Library / Table HeadlineType'=>'Typ','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> can be used to display an opt-out option for this <translation-key id="Service">Service</translation-key>.'=>'Der <translation-key id="Shortcode">Shortcode</translation-key> kann verwendet werden, um eine Opt-out-Option für diesen <translation-key id="Service">Service</translation-key> anzuzeigen.','Backend / Library / Table HeadlineName'=>'Name','Backend / Services / Things to know / TextThe <translation-key id="Opt-in-Code">Opt-in Code</translation-key> is loaded in <strong><em>&lt;head&gt;</em></strong> and is executed before the page is fully loaded.'=>'Der <translation-key id="Opt-in-Code">Opt-in-Code</translation-key> wi