t</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Providers">Provider</translation-key>), finden Sie weitere Informationen und haben auch die Möglichkeit, <translation-key id="Provider">Provider</translation-key>-Einträge zu bearbeiten oder neu zu erstellen.','Backend / Library / TextRecommended'=>'Empfohlen','Backend / License / Alert MessagePlease activate your license key first. <a href="?page=borlabs-cookie-license">Click here</a> to enter your license key.'=>'Bitte aktivieren Sie zunächst Ihren Lizenzschlüssel. <a href="?page=borlabs-cookie-license">Klicken Sie hier</a>, um Ihren Lizenzschlüssel einzugeben.','Backend / License / Alert MessagePlease enter your license key to receive updates.'=>'Bitte geben Sie Ihren Lizenzschlüssel ein, um Aktualisierungen zu erhalten.','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> can be used to execute custom code associated with this type of <translation-key id="Service">Service</translation-key> once the visitor has given consent to the <translation-key id="Service">Service</translation-key>. This can be used, for example, to block a conversion pixel code.'=>'Der <translation-key id="Shortcode">Shortcode</translation-key> kann verwendet werden, um benutzerdefinierten Code auszuführen, der mit dieser Art von <translation-key id="Service">Service</translation-key> verbunden ist, sobald der Besucher seine Einwilligung zu diesem <translation-key id="Service">Service</translation-key> gegeben hat. Dies kann z. B. verwendet werden, um einen Conversion-Pixel-Code zu blockieren.','Backend / License / Alert MessageYour license key is not valid.'=>'Ihr Lizenzschlüssel ist ungültig.','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> for example can be used in the <translation-key id="Meta-Box">Meta Box</translation-key> of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. You can find it for example in <translation-key id="Posts">Posts</translation-key> &raquo; <em><translation-key id="Your-Post">Your Post</translation-key></em> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> &raquo; <translation-key id="Custom-Code">Custom Code</translation-key>.'=>'Der <translation-key id="Shortcode">Shortcode</translation-key> kann zum Beispiel in der <translation-key id="Meta-Box">Meta-Box</translation-key> von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> verwendet werden. Sie finden ihn zum Beispiel in <translation-key id="Posts">Beiträge</translation-key> &raquo; <em><translation-key id="Your-Post">Ihr Beitrag</translation-key></em> &raquo; <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> &raquo; <translation-key id="Custom-Code">Benutzerdefinierter Code</translation-key>.','Backend / License / Alert MessageYour license request is not valid.'=>'Ihre Lizenzanfrage ist ungültig.','Backend / Services / Things to know / TextThe <translation-key id="Shortcodes">Shortcodes</translation-key> are not available until the <translation-key id="Service">Service</translation-key> is created.'=>'Die <translation-key id="Shortcodes">Shortcodes</translation-key> sind erst verfügbar, wenn der <translation-key id="Service">Service</translation-key> erstellt wurde.','Backend / Services / LabelAsynchronous Opt-out Code'=>'Asynchroner Opt-out-Code','Backend / Services / LabelBlock Cookies Before Consent'=>'Cookies vor der Einwilligung blockieren','Backend / Services / Label<translation-key id="Prioritize">Prioritize</translation-key>'=>'<translation-key id="Prioritize">Priorisieren</translation-key>','Backend / Services / HintThe <translation-key id="Opt-out-Code">Opt-out Code</translation-key> contains asynchronous JavaScript code that needs to executed to finish the Opt-out.'=>'Der <translation-key id="Opt-out-Code">Opt-out-Code</translation-key> enthält asynchronen JavaScript-Code, der ausgeführt werden muss, um das Opt-out abzuschließen.','Backend / Services / HintIf enabled, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> tries to block cookies with the names from <translation-key id="Cookie-Name">Cookie Name</translation-key> until consent is given.'=>'Wenn diese Option aktiviert ist, versucht <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>, Cookies mit den Namen von <translation-key id="Cookie-Name">Cookie-Name</translation-key> zu blockieren, bis die Einwilligung erteilt wird.','Backend / License / Alert MessageLicense information refreshed successfully.'=>'Die Lizenzinformationen wurden erfolgreich aktualisiert.','Backend / Services / HintThe <translation-key id="Opt-in-Code">Opt-in Code</translation-key> is loaded in <strong><em>&lt;head&gt;</em></strong> and is executed before the page is fully loaded.'=>'Der <translation-key id="Opt-in-Code">Opt-in-Code</translation-key> wird in <strong><em>&lt;head&gt;</em></strong> geladen und wird ausgeführt, bevor die Seite vollständig geladen ist.','Backend / License / Alert MessageLicense registered successfully.'=>'Lizenz erfolgreich registriert.','Backend / Service Location / Alert MessageNo <translation-key id="Location">Location</translation-key> configured.'=>'Keine <translation-key id="Location">Adresse</translation-key> konfiguriert.','Backend / License / Alert MessageLicense removed successfully.'=>'Lizenz erfolgreich entfernt.','Backend / Service Location / ButtonAdd Location'=>'Adresse hinzufügen','Backend / Service Location / LabelHostname'=>'Hostname','Backend / License / BreadcrumbLicense'=>'Lizenz','Backend / Service Location / LabelPath'=>'Pfad','Backend / License / Button TitleRefresh License Information'=>'Lizenzinformationen aktualisieren','Backend / Service Location / Headline<translation-key id="Locations">Locations</translation-key>'=>'<translation-key id="Locations">Adressen</translation-key>','Backend / License / Button TitleRemove License'=>'Lizenz entfernen','Backend / Service Location / Table HeadlineHostname'=>'Hostname','Backend / License / LabelCloud Scans'=>'Cloud-Scans','Backend / Service Location / Table HeadlinePath'=>'Pfad','Backend / License / LabelConfirm Refresh'=>'Aktualisierung bestätigen','Backend / Service Location / Things to know / HeadlineWhat is a <translation-key id="Hostname">Hostname</translation-key>?'=>'Was ist ein <translation-key id="Hostname">Hostname</translation-key>?','Backend / License / LabelLicense Key'=>'Lizenzschlüssel','Backend / Service Location / Things to know / HeadlineWhat is the purpose of the <translation-key id="Locations">Locations</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Locations">Adressen</translation-key>?','Backend / License / LabelLicense Name'=>'Lizenz-Name','Backend / Service Location / Things to know / TextThe <translation-key id="Hostname">Hostname</translation-key> is the domain name of the website. For example, if the URL of the website is <strong><em>https://www.example.com</em></strong>, the <translation-key id="Hostname">Hostname</translation-key> is <strong><em>www.example.com</em></strong>.'=>'Der <translation-key id="Hostname">Hostname</translation-key> ist der Domain-Name der Website. Wenn die URL der Website zum Beispiel <strong><em>https://www.example.com</em></strong> ist, lautet der <translation-key id="Hostname">Hostname</translation-key> <strong><em>www.example.com</em></strong>.','Backend / License / LabelLicense Status'=>'Lizenz-Status','Backend / Service Location / Things to know / TextIt may happen that an embedded <translation-key id="Service">Service</translation-key> on your website does not set a cookie, but a connection to a foreign domain is established. Therefore, it is advisable to record this domain here and thus name the service responsible for it, so that interested visitors can understand why this external connection occurs.'=>'Es kann vorkommen, dass ein eingebetteter <translation-key id="Service">Service</translation-key> auf Ihrer Website kein Cookie setzt, sondern eine Verbindung zu einer fremden Domain hergestellt wird. Daher ist es ratsam, diese Domain hier zu erfassen und damit den dafür verantwortlichen Service zu benennen, damit interessierte Besucher nachvollziehen können, warum diese externe Verbindung zustande kommt.','Backend / License / LabelValid Until'=>'Valide bis','Backend / Service Option / Alert MessageNo <translation-key id="Option">Option</translation-key> configured.'=>'Keine <translation-key id="Option">Option</translation-key> konfiguriert.','Backend / License / LabelMax Websites'=>'Max. Websites','Backend / Service Option / ButtonAdd Option'=>'Option hinzufügen','Backend / License / LabelRefresh'=>'Aktualisieren','Backend / Service Option / LabelDescription'=>'Beschreibung','Backend / License / Headline<translation-key id="Remove-License">Remove License</translation-key>'=>'<translation-key id="Remove-License">Lizenz entfernen</translation-key>','Backend / Service Option / Headline<translation-key id="Options">Options</translation-key>'=>'<translation-key id="Options">Optionen</translation-key>','Backend / License / HeadlineYour License'=>'Ihre Lizenz','Backend / Service Option / Table HeadlineDescription'=>'Beschreibung','Backend / License / HeadlineYour License Information'=>'Informationen zu Ihrer Lizenz','Backend / Service Option / Table Headline<translation-key id="Type">Type</translation-key>'=>'<translation-key id="Type">Typ</translation-key>','Backend / License / HintEnter your License Key.'=>'Geben Sie Ihren Lizenzschlüssel ein.','Backend / Service Option / Things to know / HeadlineWhat is the purpose of the <translation-key id="Options">Options</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Options">Optionen</translation-key>?','Backend / License / HintPlease confirm that you want to remove your license data from this website. After the license data is removed you are able to enter your new license key.'=>'Bitte bestätigen Sie, dass Sie Ihre Lizenzdaten von dieser Website entfernen möchten. Nachdem die Lizenzdaten entfernt wurden, können Sie Ihren neuen Lizenzschlüssel eingeben.','Backend / Service Option / Things to know / TextWith <translation-key id="Options">Options</translation-key> you can provide more information about the <translation-key id="Service">Service</translation-key>. There are six <translation-key id="Types">Types</translation-key> to choose from and you can add as many <translation-key id="Options">Options</translation-key> as you like.'=>'Mit <translation-key id="Options">Optionen</translation-key> können Sie weitere Informationen über den <translation-key id="Service">Service</translation-key> bereitstellen. Es stehen sechs <translation-key id="Types">Typen</translation-key> zur Auswahl und Sie können so viele <translation-key id="Options">Optionen</translation-key> hinzufügen, wie Sie möchten.','Backend / License / TextYour license has expired.'=>'Ihre Lizenz ist abgelaufen.','Backend / Service Option / Things to know / TextFor example, you could select the &quot;<translation-key id="Location-Processing">Location Processing</translation-key>&quot; <translation-key id="Type">Type</translation-key> and add <strong>United States of America</strong> as description if the <translation-key id="Service">Service</translation-key> processes data in the United States.'=>'Sie könnten zum Beispiel den <translation-key id="Type">Typ</translation-key> &quot;<translation-key id="Location-Processing">Standortverarbeitung</translation-key>&quot; auswählen und <strong>Vereinigten Staaten</strong> als Beschreibung hinzufügen, wenn der <translation-key id="Service">Service</translation-key> Daten in den Vereinigten Staaten verarbeitet.','Backend / License / TextYour license is valid.'=>'Ihre Lizenz ist gültig.','Backend / Services / Alert MessageNo <translation-key id="Service">Service</translation-key> configured.'=>'Kein <translation-key id="Service">Service</translation-key> konfiguriert.','Backend / License / Things to know / HeadlineTransferring a license key to a new website'=>'Übertragen eines Lizenzschlüssels auf eine neue Website','Backend / License / Things to know / TextYou can use the <translation-key id="Remove-License">Remove License</translation-key> option to remove the license from this website, or you can visit our <translation-key id="Customer-Portal">Customer Portal</translation-key> and remove the license from there.'=>'Sie können die Option <translation-key id="Remove-License">Lizenz entfernen</translation-key> verwenden, um die Lizenz von dieser Website zu entfernen, oder Sie besuchen unser <translation-key id="Customer-Portal">Kundenportal</translation-key> und entfernen die Lizenz von dort.','Backend / License / Things to know / Text<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span><translation-key id="Customer-Portal">Customer Portal</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>'=>'<a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://service.borlabs.io/" rel="nofollow noreferrer" target="_blank"><span><translation-key id="Customer-Portal">Kundenportal</translation-key></span><span class="brlbs-cmpnt-external-link-icon"></span></a>','Backend / Local Scanner / TextAn error has occurred. Please check your browser\'s console for an error message. If the issue persists even after trying again and switching to <translation-key id="Scan-Mode">Scan Mode</translation-key>: <translation-key id="Manual">Manual</translation-key>, kindly reach out to our support team for assistance.'=>'Es ist ein Fehler aufgetreten. Bitte überprüfen Sie die Konsole Ihres Browsers auf eine Fehlermeldung. Wenn das Problem auch nach einem erneuten Versuch und einem Wechsel in den <translation-key id="Scan-Mode">Scan-Modus</translation-key>: <translation-key id="Manual">Manuell</translation-key> bestehen bleibt, wenden Sie sich bitte an unseren Support, um Hilfe zu erhalten.','Backend / Services / HeadlineReset Default Services'=>'Standard Services zurücksetzen','Backend / Local Scanner / ButtonRun scan'=>'Scan starten','Backend / Services / HintPlease confirm that you want to reset all <translation-key id="Service">Service</translation-key> settings. They will be reset to their default settings. Your custom <translation-key id="Services">Services</translation-key> and the <translation-key id="Services">Services</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key> are not reset.'=>'Bitte bestätigen Sie, dass Sie alle <translation-key id="Service">Service</translation-key>-Einstellungen zurücksetzen möchten. Sie werden dann auf ihre Standardeinstellungen zurückgesetzt. Ihre benutzerdefinierten <translation-key id="Services">Services</translation-key> und die über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installierten <translation-key id="Services">Services</translation-key> werden nicht zurückgesetzt.','Backend / Local Scanner / LabelPage to scan'=>'Zu scannende Seite','Backend / Services / Table HeadlineID'=>'ID','Backend / Local Scanner / Label<translation-key id="Scan-Mode">Scan Mode</translation-key>'=>'<translation-key id="Scan-Mode">Scan-Modus</translation-key>','Backend / Services / Table HeadlinePosition'=>'Position','Backend / Local Scanner / Label<translation-key id="Search-Phrase">Search Phrase</translation-key>'=>'<translation-key id="Search-Phrase">Such-Phrase</translation-key>','Backend / Services / Table HeadlineStatus'=>'Status','Backend / Local Scanner / HeadlineScan Progress'=>'Scan-Fortschritt','Backend / Services / Things to know / HeadlineWhat is the purpose of the <translation-key id="Services">Services</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Services">Services</translation-key>?','Backend / Local Scanner / HeadlineScan Settings'=>'Scan-Einstellungen','Backend / Services / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Local Scanner / HintThe string <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> is looking for. Separate multiple entries with a comma.'=>'Die Zeichenfolge, nach der <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> sucht. Trennen Sie mehrere Einträge mit einem Komma.','Backend / Services / Things to know / TextIn the <translation-key id="Services">Services</translation-key> section you can document the use of services and their cookies for your visitors, as well as integrate JavaScripts, such as Google Analytics.'=>'Im Bereich <translation-key id="Services">Services</translation-key> können Sie die Nutzung von Services und deren Cookies für Ihre Besucher dokumentieren, sowie JavaScripts, wie z. B. Google Analytics, integrieren.','Backend / Services / Things to know / TextBecause <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> uses the opt-in process, JavaScripts are only executed after the visitor has given their consent to the <translation-key id="Service-Group">Service Group</translation-key> or <translation-key id="Service">Service</translation-key>.'=>'Da <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> das Opt-in-Verfahren verwendet, werden JavaScripts erst dann ausgeführt, wenn der Besucher seine Einwilligung zu der <translation-key id="Service-Group">Service-Gruppe</translation-key> oder dem <translation-key id="Service">Service</translation-key> gegeben hat.','Backend / Local Scanner / Headline<translation-key id="Scan-Modes">Scan Modes</translation-key>'=>'<translation-key id="Scan-Modes">Scan-Modi</translation-key>','Backend / Services / Things to know / TextThe <translation-key id="Service">Service</translation-key> is active and displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Der <translation-key id="Service">Service</translation-key> ist aktiv und wird im <translation-key id="Dialog">Dialog</translation-key> angezeigt. Nicht verfügbar für den <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Current-User">Current User</translation-key>:<br>The scan is performed as the currently logged in user. This may affect the results if the user has different rights than a guest user.'=>'<translation-key id="Current-User">Aktueller Benutzer</translation-key>:<br>Der Scan wird als der aktuell angemeldete Benutzer durchgeführt. Dies kann die Ergebnisse beeinflussen, wenn der Benutzer andere Rechte hat als ein Gastbenutzer.','Backend / Services / Things to know / TextDelete the <translation-key id="Service">Service</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Löschen Sie den <translation-key id="Service">Service</translation-key>. Nicht verfügbar für den <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / HeadlineFor example: Some plugins do not embed tracking JavaScript for users with the role of an administrator.'=>'Zum Beispiel: Einige Plugins betten kein Tracking-JavaScript für Benutzer mit der Rolle eines Administrators ein.','Backend / Services / Things to know / TextEdit the <translation-key id="Service">Service</translation-key>.'=>'Bearbeiten Sie den <translation-key id="Service">Service</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Guest">Guest</translation-key>:<br>The scan is performed as a guest user. This is the default setting.'=>'<translation-key id="Guest">Gast</translation-key>:<br>Der Scan wird als Gastbenutzer durchgeführt. Dies ist die Standardeinstellung.','Backend / Services / Things to know / TextThe <translation-key id="Service">Service</translation-key> is inactive and not displayed in the <translation-key id="Dialog">Dialog</translation-key>. Not available for the <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Der <translation-key id="Service">Service</translation-key> ist inaktiv und wird im <translation-key id="Dialog">Dialog</translation-key> nicht angezeigt. Nicht verfügbar für den <translation-key id="Service">Service</translation-key>: <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.','Backend / Local Scanner / Headline<translation-key id="Manual">Manual</translation-key>:<br>When you use this mode, a signed URL is provided that you can use to run the scan by clicking on it. This is useful if the scan cannot be performed due to a server configuration or if your website is not accessible from the outside (<translation-key id="Local-Environment">Local Environment</translation-key> or <translation-key id="Staging-Environment">Staging Environment</translation-key>), for example.'=>'<translation-key id="Manual">Manuell</translation-key>:<br>Wenn Sie diesen Modus verwenden, wird eine signierte URL bereitgestellt, mit der Sie den Scan starten können, indem Sie darauf klicken. Dies ist nützlich, wenn der Scan aufgrund einer Serverkonfiguration nicht durchgeführt werden kann oder wenn Ihre Website z. B. von außen nicht zugänglich ist <translation-key id="Local-Environment">(lokale Umgebung</translation-key> oder <translation-key id="Staging-Environment">Staging-Umgebung</translation-key>).','Backend / Service Group / BreadcrumbEdit: {{ name }}'=>'Bearbeiten: {{ name }}','Backend / Local Scanner / Alert MessageNo scan result available.'=>'Kein Scan-Ergebnis verfügbar.','Backend / Service Group / BreadcrumbService Groups'=>'Service-Gruppen','Backend / Local Scanner / Headline<translation-key id="Matched-Handles">Matched Handles</translation-key>'=>'<translation-key id="Matched-Handles">Übereinstimmende Handles</translation-key>','Backend / Service Group / BreadcrumbNew'=>'Neu','Backend / Local Scanner / Headline<translation-key id="Matched-Tags">Matched Tags</translation-key>'=>'<translation-key id="Matched-Tags">Übereinstimmende Tags</translation-key>','Backend / Service Groups / LabelDescription'=>'Beschreibung','Backend / Local Scanner / Headline<translation-key id="Unmatched-Handles">Unmatched Handles</translation-key>'=>'<translation-key id="Unmatched-Handles">Nicht übereinstimmende Handles</translation-key>','Backend / Service Groups / LabelID'=>'ID','Backend / Local Scanner / Headline<translation-key id="Unmatched-Tags">Unmatched Tags</translation-key>'=>'<translation-key id="Unmatched-Tags">Nicht übereinstimmende Tags</translation-key>','Backend / Service Groups / LabelName'=>'Name','Backend / Local Scanner / HintSpecifies the name of the object that must be present for the script from the <strong>Tag</strong> column to be executed. Allowed characters include $, _, letters (both upper and lower case), and numbers. The first character must be $, _, or a letter, while subsequent characters can also include numbers.'=>'Gibt den Namen des Objekts an, das vorhanden sein muss, damit das Script aus der Spalte <strong>Tag</strong> ausgeführt werden kann. Erlaubte Zeichen sind $, _, Buchstaben (sowohl Groß- als auch Kleinbuchstaben) und Zahlen. Das erste Zeichen muss $, _ oder ein Buchstabe sein, während die nachfolgenden Zeichen auch Zahlen enthalten können.','Backend / Service Groups / LabelPosition'=>'Position','Backend / Local Scanner / HintEnter a unique string found in the <strong>Tag</strong> to block the script. It should be unique enough that it is not found in other JavaScripts as well.'=>'Geben Sie eine eindeutige Zeichenfolge aus dem <strong>Tag</strong> ein, um das Script zu blockieren. Sie sollte so eindeutig sein, dass sie nicht auch in anderen JavaScripts zu finden ist.','Backend / Service Groups / LabelPre-selected'=>'Vorausgewählt','Backend / Local Scanner / Table HeadlineBlock'=>'Blockieren','Backend / Service Groups / Label<translation-key id="Shortcode">Shortcode</translation-key>'=>'<translation-key id="Shortcode">Shortcode</translation-key>','Backend / Local Scanner / Table Headline<translation-key id="Handle">Handle</translation-key>'=>'<translation-key id="Handle">Handle</translation-key>','Backend / Service Groups / LabelStatus'=>'Status','Backend / Local Scanner / Table Headline<translation-key id="onExist">onExist</translation-key>'=>'<translation-key id="onExist">onExist</translation-key>','Backend / Service Groups / HeadlineService Group Information'=>'Service-Gruppe Informationen','Backend / Local Scanner / Table Headline<translation-key id="Phrase">Phrase</translation-key>'=>'<translation-key id="Phrase">Phrase</translation-key>','Backend / Service Groups / HeadlineService Group Settings'=>'Service-Gruppe-Einstellungen','Backend / Local Scanner / Table HeadlineTag'=>'Tag','Backend / Service Groups / HintEnter a description for this <translation-key id="Service-Group">Service Group</translation-key>. It is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Geben Sie eine Beschreibung für diese <translation-key id="Service-Group">Service-Gruppe</translation-key> ein. Sie wird dem Besucher im <translation-key id="Dialog">Dialog</translation-key> angezeigt.','Backend / Local Scanner / Table HeadlineType'=>'Typ','Backend / Service Groups / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'<translation-key id="ID">ID</translation-key> muss festgelegt werden. Die <translation-key id="ID">ID</translation-key> muss mindestens 3 Zeichen lang sein und darf nur enthalten: <strong><em>a-z - _</em></strong>','Backend / Local Scanner / Table HeadlineURL'=>'URL','Backend / Service Groups / HintChoose a name for this <translation-key id="Service-Group">Service Group</translation-key>. It is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Wählen Sie einen Namen für diese <translation-key id="Service-Group">Service-Gruppe</translation-key>. Er wird dem Besucher im <translation-key id="Dialog">Dialog</translation-key> angezeigt.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> are used to identify the JavaScript files that are loaded on your website. For example, your installed <translation-key id="Themes">Themes</translation-key> and <translation-key id="Plugins">Plugins</translation-key> use the WordPress function <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_script/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_script()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> to define the <translation-key id="Handles">Handles</translation-key>.'=>'<translation-key id="Handles">Handles</translation-key> werden verwendet, um die JavaScript-Dateien zu identifizieren, die auf Ihrer Website geladen werden. Zum Beispiel verwenden Ihre installierten <translation-key id="Themes">Themes</translation-key> und <translation-key id="Plugins">Plugins</translation-key> die WordPress-Funktion <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_script/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_script()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>, um die <translation-key id="Handles">Handles</translation-key> zu definieren.','Backend / Service Groups / HintDetermine the position where this <translation-key id="Service-Group">Service Group</translation-key> is displayed. Order follows natural numbers.'=>'Bestimmen Sie die Position, an der diese <translation-key id="Service-Group">Service-Gruppe</translation-key> angezeigt wird. Die Reihenfolge folgt den natürlichen Zahlen.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> are used to identify the <translation-key id="CSS">CSS</translation-key> files that are loaded on your website. For example, your installed <translation-key id="Themes">Themes</translation-key> and <translation-key id="Plugins">Plugins</translation-key> use the WordPress function <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_style/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_style()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a> to define the <translation-key id="Handles">Handles</translation-key>.'=>'<translation-key id="Handles">Handles</translation-key> werden verwendet, um die <translation-key id="CSS">CSS</translation-key>-Dateien zu identifizieren, die auf Ihrer Website geladen werden. Zum Beispiel verwenden Ihre installierten <translation-key id="Themes">Themes</translation-key> und <translation-key id="Plugins">Plugins</translation-key> die WordPress-Funktion <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="https://developer.wordpress.org/reference/functions/wp_enqueue_style/" rel="nofollow noopener noreferrer" target="_blank"><strong><em>wp_enqueue_style()</em></strong><span class="brlbs-cmpnt-external-link-icon"></span></a>, um die <translation-key id="Handles">Handles</translation-key> zu definieren.','Backend / Service Groups / HintIf enabled, this <translation-key id="Service-Group">Service Group</translation-key> is pre-selected in the <translation-key id="Dialog">Dialog</translation-key>. The visitor can de-select it.'=>'Wenn diese Option aktiviert ist, ist diese <translation-key id="Service-Group">Service-Gruppe</translation-key> im <translation-key id="Dialog">Dialog</translation-key> vorausgewählt. Der Besucher kann sie wieder abwählen.','Backend / Local Scanner / Headline<translation-key id="Matched-Handles">Matched Handles</translation-key>:<br>These are <translation-key id="Handles">Handles</translation-key> that matches your <translation-key id="Search-Phrase">Search Phrase</translation-key>.'=>'<translation-key id="Matched-Handles">Übereinstimmende Handles</translation-key>:<br>Dies sind <translation-key id="Handles">Handles</translation-key>, die Ihrer <translation-key id="Search-Phrase">Such-Phrase</translation-key> entsprechen.','Backend / Service Groups / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> to unblock JavaScript or content when user opted-in for this <translation-key id="Service-Group">Service Group</translation-key>.'=>'Verwenden Sie diesen <translation-key id="Shortcode">Shortcode</translation-key>, um JavaScript oder Inhalte zu entsperren, wenn der Benutzer sich für diese <translation-key id="Service-Group">Service-Gruppe</translation-key> entschieden hat.','Backend / Local Scanner / Headline<translation-key id="Unmatched-Handles">Unmatched Handles</translation-key>:<br>These are <translation-key id="Handles">Handles</translation-key> that do not match a <translation-key id="Search-Phrase">Search Phrase</translation-key> but were found during the scan and maybe relevant.'=>'<translation-key id="Unmatched-Handles">Nicht übereinstimmende Handles</translation-key>:<br>Dies sind <translation-key id="Handles">Handles</translation-key>, die nicht mit einer <translation-key id="Search-Phrase">Such-Phrase</translation-key> übereinstimmen, aber während der Suche gefunden wurden und möglicherweise relevant sind.','Backend / Service Groups / HintThe status of this <translation-key id="Service-Group">Service Group</translation-key>. If enabled it is displayed to the visitor in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Der Status dieser <translation-key id="Service-Group">Service-Gruppe</translation-key>. Wenn er aktiviert ist, wird sie dem Besucher im <translation-key id="Dialog">Dialog</translation-key> angezeigt.','Backend / Local Scanner / Headline<translation-key id="Handles">Handles</translation-key> explained'=>'<translation-key id="Handles">Handles</translation-key> erklärt','Backend / Service Groups / Input Placeholder...block this...'=>'...dies blockieren...','Backend / Local Scanner / Things to know / HeadlineInput fields explained'=>'Eingabefelder erklärt','Backend / Service Groups / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'<translation-key id="Shortcode">Shortcode</translation-key> erklärt','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> explained'=>'<translation-key id="Tags">Tags</translation-key> erklärt','Backend / Services / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> can be used to execute custom code once the visitor has given consent to a <translation-key id="Service">Service</translation-key> associated with this type of <translation-key id="Service-Group">Service Group</translation-key>. This can be used, for example, to block a conversion pixel code.'=>'Der <translation-key id="Shortcode">Shortcode</translation-key> kann verwendet werden, um benutzerdefinierten Code auszuführen, sobald der Besucher seine Einwilligung zu einem <translation-key id="Service">Service</translation-key> gegeben hat, der mit dieser Art von <translation-key id="Service-Group">Service-Gruppe</translation-key> verbunden ist. Dies kann z. B. verwendet werden, um einen Conversion-Pixel-Code zu blockieren.','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> refer to <strong><em>&lt;script&gt;</em></strong> tags that lack an associated <translation-key id="Handle">Handle</translation-key>, which can occur when JavaScript is embedded directly into your website\'s HTML code, bypassing the dedicated WordPress function typically used for this purpose'=>'<translation-key id="Tags">Tags</translation-key> beziehen sich auf <strong><em>&lt;script&gt;</em></strong>-Tags, denen ein zugehöriger <translation-key id="Handle">Handle</translation-key> fehlt. Dies kann vorkommen, wenn JavaScript direkt in den HTML-Code Ihrer Website eingebettet wird, wodurch die spezielle WordPress-Funktion umgangen wird, die normalerweise für diesen Zweck verwendet wird.','Backend / Local Scanner / Headline<translation-key id="Tags">Tags</translation-key> refer to <strong><em>&lt;link&gt;</em></strong> tags and <strong><em>&lt;style&gt;</em></strong> tags that lack an associated <translation-key id="Handle">Handle</translation-key>, which can occur when <translation-key id="CSS">CSS</translation-key> is embedded directly into your website\'s HTML code, bypassing the dedicated WordPress function typically used for this purpose'=>'<translation-key id="Tags">Tags</translation-key> beziehen sich auf <strong><em>&lt;link&gt;</em></strong>-Tags und <strong><em>&lt;style&gt; </em></strong>-Tags, denen ein zugehöriger <translation-key id="Handle">Handle</translation-key> fehlt. Dies kann der Fall sein, wenn <translation-key id="CSS">CSS</translation-key> direkt in den HTML-Code Ihrer Website eingebettet wird, wodurch die spezielle WordPress-Funktion umgangen wird, die normalerweise für diesen Zweck verwendet wird','Backend / Local Scanner / Headline<translation-key id="Matched-Tags">Matched Tags</translation-key>:<br>These are <translation-key id="Tags">Tags</translation-key> that matches your <translation-key id="Search-Phrase">Search Phrase</translation-key>.'=>'<translation-key id="Matched-Tags">Übereinstimmende Tags</translation-key>:<br>Dies sind <translation-key id="Tags">Tags</translation-key>, die mit Ihrer <translation-key id="Search-Phrase">Such-Phrase</translation-key> übereinstimmen.','Backend / Local Scanner / Headline<translation-key id="Unmatched-Tags">Unmatched Tags</translation-key>:<br>These are <translation-key id="Tags">Tags</translation-key> that do not match a <translation-key id="Search-Phrase">Search Phrase</translation-key> but were found during the scan and maybe relevant.'=>'<translation-key id="Unmatched-Tags">Nicht übereinstimmende Tags</translation-key>:<br>Dies sind <translation-key id="Tags">Tags</translation-key>, die nicht mit einer <translation-key id="Search-Phrase">Such-Phrase</translation-key> übereinstimmen, aber bei der Suche gefunden wurden und möglicherweise relevant sind.','Backend / Local Scanner / Headline<translation-key id="Phrase">Phrase</translation-key>:<br>Enter a unique string found in the <strong>Tag</strong> to block the script. It should be unique enough that it is not found in other JavaScripts as well.'=>'<translation-key id="Phrase">Phrase</translation-key>:<br>Geben Sie eine eindeutige Zeichenfolge ein, die im <strong>Tag</strong> gefunden wird, um das Script zu blockieren. Sie sollte so eindeutig sein, dass sie nicht auch in anderen JavaScripts zu finden ist.','Backend / Local Scanner / Headline<translation-key id="onExist">onExist</translation-key>:<br>This feature is optional and ensures that once the JavaScript is unblocked, it does not execute until the object specified in the <translation-key id="onExist">onExist</translation-key> column is present on the website. This capability facilitates the resolution of race condition issues.'=>'<translation-key id="onExist">onExist</translation-key>:<br>Diese Funktion ist optional und stellt sicher, dass das JavaScript nach der Entsperrung erst dann ausgeführt wird, wenn das in der Spalte <translation-key id="onExist">onExist</translation-key> angegebene Objekt auf der Website vorhanden ist. Diese Funktion erleichtert die Behebung von Problemen mit Race Condition.','Backend / Local Scanner / HeadlineSpecifies the name of the object that must be present for the script from the <strong>Tag</strong> column to be executed. Allowed characters include $, _, letters (both upper and lower case), and numbers. The first character must be $, _, or a letter, while subsequent characters can also include numbers.'=>'Gibt den Namen des Objekts an, das vorhanden sein muss, damit das Script aus der Spalte <strong>Tag</strong> ausgeführt werden kann. Erlaubte Zeichen sind $, _, Buchstaben (sowohl Groß- als auch Kleinbuchstaben) und Zahlen. Das erste Zeichen muss $, _ oder ein Buchstabe sein, während die nachfolgenden Zeichen auch Zahlen enthalten können.','Backend / Local Scanner / HeadlineExample:'=>'Beispiel:','Backend / Local Scanner / HeadlineThe example initiates loading an external library and concurrently calls the <strong><em>calendarLibrary.init()</em></strong> function. This could induce a race condition issue since, when <strong><em>calendarLibrary.init()</em></strong> is invoked, the <strong><em>calendar-library.js</em></strong> library—responsible for providing this method—might not yet be fully loaded.'=>'Das Beispiel initiiert das Laden einer externen Bibliothek und ruft gleichzeitig die <strong><em>calendarLibrary.init()</em></strong> Funktion auf. Dies könnte ein Race Condition Problem hervorrufen, da, wenn <strong><em>calendarLibrary.init()</em></strong> aufgerufen wird, die Funktion <strong><em>calendar-library.js</em></strong>-Bibliothek, die für die Bereitstellung dieser Methode verantwortlich ist, noch nicht vollständig geladen sein könnte.','Backend / Local Scanner / HeadlineTo mitigate this race condition, block both the script tag that loads the <strong><em>calendar-library.js</em></strong> library and the script tag that calls <strong><em>calendarLibrary.init()</em></strong>. For the script tag where <strong><em>calendarLibrary.init()</em></strong> is called, enter <strong><em>calendarLibrary</em></strong> in the <translation-key id="onExist">onExist</translation-key> field.'=>'Um diese Race Condition zu entschärfen, blockieren Sie sowohl das Script-Tag, das die <strong><em>calendar-library.js</em></strong>-Bibliothek lädt, als auch das Script-Tag, das die <strong><em>calendarLibrary.init()</em></strong> aufruft. Für das Script-Tag, das <strong><em>calendarLibrary.init()</em></strong> aufruft, geben Sie <strong><em>calendarLibrary</em></strong> in das Feld <translation-key id="onExist">onExist</translation-key> ein.','Backend / Local Scanner / HeadlineIf the <translation-key id="Script-Blocker">Script Blocker</translation-key> is now unblocked, the script-tag containing <strong><em>calendarLibrary.init()</em></strong> will not execute until the <strong><em>calendar-library.js</em></strong> has completely loaded.'=>'Wenn der <translation-key id="Script-Blocker">Script-Blocker</translation-key> nun entsperrt ist, wird das Script-Tag, das <strong><em>calendarLibrary.init()</em></strong> enthält, nicht ausgeführt, bis die <strong><em>calendar-library.js</em></strong> vollständig geladen ist.','Backend / Local Scanner / Headline<translation-key id="Phrase">Phrase</translation-key>:<br>Enter a unique string found in the <strong>Tag</strong> to block the <translation-key id="CSS">CSS</translation-key>. It should be unique enough that it is not found in other <strong><em>&lt;link&gt;</em></strong> tags or <strong><em>&lt;style&gt;</em></strong> tags as well.'=>'<translation-key id="Phrase">Phrase</translation-key>:<br>Geben Sie eine eindeutige Zeichenfolge ein, die im <strong>Tag</strong> gefunden wird, um das <translation-key id="CSS">CSS</translation-key> zu blockieren. Sie sollte so eindeutig sein, dass sie nicht in anderen <strong><em>&lt;link&gt;</em></strong>-Tags oder <strong><em>&lt;style&gt;</em></strong>-Tags gefunden wird. ','Backend / Local Scanner / ValidationThe phrase is not found in the JavaScript code on the left side.'=>'Die Phrase ist im JavaScript-Code auf der linken Seite nicht zu finden.','Backend / Local Scanner / ValidationThe phrase is not unique and overlaps with a phrase for another JavaScript.'=>'Die Phrase ist nicht eindeutig und überschneidet sich mit einer Phrase für ein anderes JavaScript.','Backend / Log / Alert MessageThe <translation-key id="Log">Log</translation-key> could not be found.'=>'Das <translation-key id="Log">Log</translation-key> konnte nicht gefunden werden.','Backend / Log / Breadcrumb<translation-key id="Logs">Logs</translation-key>'=>'<translation-key id="Logs">Logs</translation-key>','Backend / Log / BreadcrumbDetails'=>'Details','Backend / Log / HeadlineProcess History'=>'Prozess Historie','Backend / Log / FieldBacktrace'=>'Backtrace','Backend / Log / FieldContext'=>'Kontext','Backend / Log / FieldLevel'=>'Level','Backend / Log / FieldMessage'=>'Nachricht','Backend / Log / FieldProcess ID'=>'Prozess-ID','Backend / Log / Alert MessageNo <translation-key id="Logs">Logs</translation-key> found.'=>'Keine <translation-key id="Logs">Logs</translation-key> gefunden.','Backend / Log / Headline<translation-key id="Logs">Logs</translation-key>'=>'<translation-key id="Logs">Logs</translation-key>','Backend / Log / PlaceholderSearch Process ID, Level or Message'=>'Suche nach Prozess-ID, Level oder Nachricht','Backend / Log / Table HeadlineHas backtrace'=>'Hat Backtrace','Backend / Log / Table HeadlineHas context'=>'Hat Kontext','Backend / Log / Table HeadlineCreated at'=>'Erstellt am','Backend / Log / Table HeadlineLevel'=>'Level','Backend / Log / Table HeadlineMessage'=>'Nachricht','Backend / Log / Table HeadlineProcess ID'=>'Prozess-ID','Backend / MetaBox / Field<translation-key id="Custom-Code">Custom Code</translation-key>'=>'<translation-key id="Custom-Code">Benutzerdefinierter Code</translation-key>','Backend / MetaBox / HeadlineBorlabs Cookie - Meta Box'=>'Borlabs Cookie - Meta-Box','Backend / MetaBox / HintThe code you enter here will only run on this page. Extend your code by wrapping it with our blocking <translation-key id="Shortcodes">Shortcodes</translation-key> to ensure that it only executes after you\'ve received consent. This functionality proves useful in scenarios such as needing to trigger a conversion pixel exclusively on this page.'=>'Der Code, den Sie hier eingeben, wird nur auf dieser Seite ausgeführt. Erweitern Sie Ihren Code, indem Sie ihn mit unseren blockierenden <translation-key id="Shortcodes">Shortcodes</translation-key> ummanteln, um sicherzustellen, dass er nur ausgeführt wird, nachdem Sie eine Einwilligung erhalten haben. Diese Funktionalität erweist sich in Szenarien als nützlich, in denen Sie beispielsweise ein Conversion-Pixel ausschließlich auf dieser Seite auslösen müssen.','Backend / Providers / BreadcrumbEdit: {{ name }}'=>'Bearbeiten: {{ name }}','Backend / Providers / BreadcrumbProviders'=>'Provider','Backend / Providers / BreadcrumbNew'=>'Neu','Backend / Providers / LabelAddress'=>'Adresse','Backend / Providers / LabelCookie URL'=>'Cookie-URL','Backend / Providers / LabelDescription'=>'Beschreibung','Backend / Providers / Label<translation-key id="IAB-Vendor-ID">IAB Vendor ID</translation-key>'=>'<translation-key id="IAB-Vendor-ID">IAB-Vendor-ID</translation-key>','Backend / Providers / LabelID'=>'ID','Backend / Providers / LabelName'=>'Name','Backend / Providers / LabelOpt-out URL'=>'Opt-out-URL','Backend / Providers / LabelPartners'=>'Partner','Backend / Providers / Label<translation-key id="Privacy-Url">Privacy URL</translation-key>'=>'<translation-key id="Privacy-Url">Datenschutz-URL</translation-key>','Backend / Providers / HeadlineProvider Information'=>'Provider Informationen','Backend / Providers / LabelYou can optionally provide the <translation-key id="IAB-Vendor-ID">IAB Vendor ID</translation-key> to add information about an IAB Vendor that is not part of the IAB TCF standard.'=>'Sie können optional die <translation-key id="IAB-Vendor-ID">IAB-Vendor-ID</translation-key> angeben, um Informationen über einen IAB Vendor hinzuzufügen, der nicht Teil des IAB TCF-Standards ist.','Backend / Providers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Providers">Providers</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Providers">Provider</translation-key>?','Backend / Providers / Things to know / TextFor legal compliance, every <translation-key id="Service">Service</translation-key> or <translation-key id="Content-Blocker">Content Blocker</translation-key> must be linked to a specific <translation-key id="Provider">Provider</translation-key>.'=>'Aus rechtlichen Gründen muss jeder <translation-key id="Service">Service</translation-key> oder <translation-key id="Content-Blocker">Content-Blocker</translation-key> mit einem bestimmten <translation-key id="Provider">Provider</translation-key> verknüpft sein.','Backend / Providers / Things to know / TextThe <translation-key id="Provider">Provider</translation-key> is the company that delivers the <translation-key id="Service">Service</translation-key> (e.g., Google Analytics) or the content (e.g., YouTube videos).'=>'Der <translation-key id="Provider">Provider</translation-key> ist das Unternehmen, das den <translation-key id="Service">Service</translation-key> (z. B. Google Analytics) oder den Inhalt (z. B. YouTube-Videos) bereitstellt.','Backend / Providers / Things to know / TextVisitors should receive clear information about the <translation-key id="Provider">Provider</translation-key> responsible for the <translation-key id="Service">Service</translation-key> or blocked content.'=>'Die Besucher sollten klare Informationen über den <translation-key id="Provider">Provider</translation-key> erhalten, der für den <translation-key id="Service">Service</translation-key> oder die gesperrten Inhalte verantwortlich ist.','Backend / Providers / Alert MessageNo <translation-key id="Provider">Provider</translation-key> configured.'=>'Kein <translation-key id="Provider">Provider</translation-key> konfiguriert.','Backend / Providers / HeadlineProviders'=>'Provider','Backend / Providers / HeadlineReset Default Providers'=>'Standard Provider zurücksetzen','Backend / Providers / HintPlease confirm that you want to reset the <translation-key id="Providers">Providers</translation-key>. They will be reset to their default settings. Your custom <translation-key id="Providers">Providers</translation-key> and the <translation-key id="Providers">Providers</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key> are not reset.'=>'Bitte bestätigen Sie, dass Sie die <translation-key id="Providers">Provider</translation-key> zurücksetzen möchten. Sie werden dann auf ihre Standardeinstellungen zurückgesetzt. Ihre benutzerdefinierten <translation-key id="Providers">Provider</translation-key> und die über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installierten <translation-key id="Providers">Provider</translation-key> werden nicht zurückgesetzt.','Backend / Providers / Table HeadlineID'=>'ID','Backend / Providers / Table HeadlineName'=>'Name','Backend / Providers / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Providers / Things to know / TextDelete the <translation-key id="Provider">Provider</translation-key>. Not available for the <translation-key id="Provider">Provider</translation-key>: <translation-key id="Owner-of-this-website">Owner of this website</translation-key>.'=>'Löschen Sie den <translation-key id="Provider">Provider</translation-key>. Nicht verfügbar für den <translation-key id="Provider">Provider</translation-key>: <translation-key id="Owner-of-this-website">Eigentümer dieser Website</translation-key>.','Backend / Providers / Things to know / TextEdit the <translation-key id="Provider">Provider</translation-key>.'=>'Bearbeiten Sie den <translation-key id="Provider">Provider</translation-key>.','Backend / Script Blockers / BreadcrumbEdit: {{ name }}'=>'Bearbeiten: {{ name }}','Backend / Script Blockers / BreadcrumbScript Blockers'=>'Script-Blocker','Backend / Script Blockers / BreadcrumbNew'=>'Neu','Backend / Script Blockers / Field LabelContent Blocker Global JavaScript'=>'Content-Blocker Global-JavaScript','Backend / Script Blockers / LabelHandles'=>'Handles','Backend / Script Blockers / LabelID'=>'ID','Backend / Script Blockers / LabelName'=>'Name','Backend / Script Blockers / Label<translation-key id="onExist">onExist</translation-key>'=>'<translation-key id="onExist">onExist</translation-key>','Backend / Script Blockers / LabelPhrases'=>'Phrasen','Backend / Script Blockers / LabelService Opt-in Script Tag'=>'Service Opt-in Script-Tag','Backend / Script Blockers / LabelStatus'=>'Status','Backend / Script Blockers / HeadlineScript Blocker Configuration'=>'Script-Blocker Konfiguration','Backend / Script Blockers / HeadlineScript Blocker Information'=>'Script-Blocker Informationen','Backend / Script Blockers / HeadlineScript Blocker Settings'=>'Script-Blocker-Einstellungen','Backend / Script Blockers / HintIf your intention is to unblock previously blocked JavaScripts upon unblocking a <translation-key id="Content-Blocker">Content Blocker</translation-key>, please insert the provided JavaScript into the <translation-key id="Global">Global</translation-key> field within your <translation-key id="Content-Blocker">Content Blocker</translation-key> settings.'=>'Wenn Sie beabsichtigen, zuvor blockierte JavaScripts bei der Entsperrung eines <translation-key id="Content-Blocker">Content-Blockers</translation-key> zu entsperren, fügen Sie bitte das bereitgestellte JavaScript in das Feld <translation-key id="Global">Global</translation-key> in Ihren <translation-key id="Content-Blocker">Content-Blocker</translation-key>-Einstellungen ein.','Backend / Script Blockers / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'<translation-key id="ID">ID</translation-key> muss festgelegt werden. Die <translation-key id="ID">ID</translation-key> muss mindestens 3 Zeichen lang sein und darf nur enthalten: <strong><em>a-z - _</em></strong>','Backend / Script Blockers / HintThe name of the <translation-key id="Script-Blocker">Script Blocker</translation-key>.'=>'Der Name des <translation-key id="Script-Blocker">Script-Blockers</translation-key>.','Backend / Script Blockers / HintTo allow the unblocking of previously blocked JavaScripts through user consent for a <translation-key id="Service">Service</translation-key>, please insert the ensuing script tag into the field labeled <translation-key id="Opt-in-Code">Opt-in Code</translation-key> within your <translation-key id="Service">Service</translation-key>.'=>'Um die Entsperrung von zuvor gesperrten JavaScripts durch die Einwilligung des Benutzers für einen <translation-key id="Service">Service</translation-key> zu ermöglichen, fügen Sie bitte das folgende Script-Tag in das Feld <translation-key id="Opt-in-Code">Opt-in-Code</translation-key> in Ihrem <translation-key id="Service">Service</translation-key> ein.','Backend / Script Blockers / HintThe status of this <translation-key id="Script-Blocker">Script Blocker</translation-key>. If the <translation-key id="Script-Blocker">Script Blocker</translation-key> is disabled, it will not block JavaScript.'=>'Der Status dieses <translation-key id="Script-Blocker">Script-Blockers</translation-key>. Wenn der <translation-key id="Script-Blocker">Script-Blocker</translation-key> deaktiviert ist, wird JavaScript nicht blockiert.','Backend / Script Blockers / Alert MessageNo <translation-key id="Script-Blocker">Script Blocker</translation-key> configured.'=>'Kein <translation-key id="Script-Blocker">Script-Blocker</translation-key> konfiguriert.','Backend / Script Blockers / HeadlineScript Blockers'=>'Script-Blocker','Backend / Script Blockers / Table Headline<translation-key id="Handles">Handles</translation-key>'=>'<translation-key id="Handles">Handles</translation-key>','Backend / Script Blockers / Table HeadlineID'=>'ID','Backend / Script Blockers / Table HeadlineName'=>'Name','Backend / Script Blockers / Table Headline<translation-key id="On-Exist">OnExist</translation-key>'=>'<translation-key id="On-Exist">OnExist</translation-key>','Backend / Script Blockers / Table Headline<translation-key id="Phrases">Phrases</translation-key>'=>'<translation-key id="Phrases">Phrasen</translation-key>','Backend / Script Blockers / Table HeadlineStatus'=>'Status','Backend / Script Blockers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Script-Blockers">Script Blockers</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Script-Blockers">Script-Blocker</translation-key>?','Backend / Script Blockers / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Script Blockers / Tip / HeadlineLanguage independent'=>'Sprachunabhängig','Backend / Script Blockers / Tip / Text<translation-key id="Script-Blockers">Script Blockers</translation-key> are configured independently for all languages.'=>'<translation-key id="Script-Blockers">Script-Blocker</translation-key> werden für alle Sprachen unabhängig voneinander konfiguriert.','Backend / Script Blockers / Things to know / TextThe <translation-key id="Script-Blockers">Script Blockers</translation-key> section allows you to block JavaScripts from <translation-key id="Plugins">Plugins</translation-key> whose JavaScript you can\'t enter into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>.'=>'Im Bereich <translation-key id="Script-Blockers">Script-Blocker</translation-key> können Sie JavaScripts von <translation-key id="Plugins">Plugins</translation-key> blockieren, deren JavaScript Sie nicht in das Feld <translation-key id="Opt-in-Code">Opt-in-Code</translation-key> eines <translation-key id="Service">Services</translation-key> eingeben können.','Backend / Script Blockers / Things to know / TextOnce a <translation-key id="Script-Blocker">Script Blocker</translation-key> is created, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> provides an unblock JavaScript that can be entered into the <translation-key id="Opt-in-Code">Opt-in Code</translation-key> field of a <translation-key id="Service">Service</translation-key>. The JavaScript becomes unblocked once a visitor consents to the <translation-key id="Service">Service</translation-key>.'=>'Sobald ein <translation-key id="Script-Blocker">Script-Blocker</translation-key> erstellt ist, stellt <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> ein JavaScript zur Verfügung, das in das <translation-key id="Opt-in-Code">Opt-in-Code</translation-key>-Feld eines <translation-key id="Service">Services</translation-key> eingegeben werden kann. Das JavaScript wird freigeschaltet, sobald ein Besucher dem <translation-key id="Service">Service</translation-key> zustimmt.','Backend / Script Blockers / Things to know / TextThis usually allows you to continue using your favorite plugins, but their JavaScript will only run when a visitor gave consent.'=>'Dadurch können Sie in der Regel Ihre bevorzugten Plugins weiter verwenden, aber ihr JavaScript wird nur ausgeführt, wenn ein Besucher seine Einwilligung gegeben hat.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Script-Blocker">Script Blocker</translation-key> is enabled and actively prevents JavaScript execution if the <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key> matches a term configured in the system.'=>'Der <translation-key id="Script-Blocker">Script-Blocker</translation-key> ist aktiviert und verhindert aktiv die Ausführung von JavaScript, wenn die <translation-key id="Handles">Handles</translation-key> oder <translation-key id="Phrases">Phrasen</translation-key> mit einem im System konfigurierten Begriff übereinstimmen.','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Script-Blocker">Script Blocker</translation-key>. Not available for a <translation-key id="Script-Blocker">Script Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Löschen Sie den <translation-key id="Script-Blocker">Script-Blocker</translation-key>. Nicht verfügbar für einen <translation-key id="Script-Blocker">Script-Blocker</translation-key>, der über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installiert wurde.','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Script-Blocker">Script Blocker</translation-key>.'=>'Bearbeiten Sie den <translation-key id="Script-Blocker">Script-Blocker</translation-key>.','Backend / Content Blockers / Things to know / TextThe <translation-key id="Script-Blocker">Script Blocker</translation-key> is inactive, allowing all JavaScript to execute without filtering or restricting based on <translation-key id="Handles">Handles</translation-key> or <translation-key id="Phrases">Phrases</translation-key>.'=>'Der <translation-key id="Script-Blocker">Script-Blocker</translation-key> ist inaktiv und erlaubt die Ausführung von JavaScript ohne Filterung oder Einschränkung auf der Basis von <translation-key id="Handles">Handles</translation-key> oder <translation-key id="Phrases">Phrasen</translation-key>.','Backend / Service Cookie / Alert MessageNo <translation-key id="Cookie">Cookie</translation-key> configured.'=>'Kein <translation-key id="Cookie">Cookie</translation-key> konfiguriert.','Backend / Service Cookie / ButtonAdd Cookie'=>'Cookie hinzufügen','Backend / Service Cookie / FieldLifetime'=>'Lebensdauer','Backend / Service Cookie / FieldName'=>'Name','Backend / Service Cookie / HeadlineCookies'=>'Cookies','Backend / Service Cookie / Table HeadlineDescription'=>'Beschreibung','Backend / Service Cookie / Table HeadlineHostname'=>'Hostname','Backend / Service Cookie / Table HeadlineLifetime'=>'Lebensdauer','Backend / Service Cookie / Table Headline<translation-key id="Name">Name</translation-key>'=>'<translation-key id="Name">Name</translation-key>','Backend / Service Cookie / Table HeadlinePath'=>'Pfad','Backend / Service Cookie / Table HeadlinePurpose'=>'Zweck','Backend / Service Cookie / Table HeadlineType'=>'Typ','Backend / Services / Things to know / HeadlineYou may input all cookies utilized by the <translation-key id="Service">Service</translation-key> here. Typically, information regarding which cookies are used and their respective purposes can be found on the website of the service you intend to add. For instance, details about the cookies used by Google Analytics can be located in its knowledge base.'=>'Hier können Sie alle Cookies eingeben, die der <translation-key id="Service">Service</translation-key> verwendet. Informationen darüber, welche Cookies verwendet werden und welchen Zweck sie erfüllen, finden Sie in der Regel auf der Website des Dienstes, den Sie hinzufügen möchten. Details zu den von Google Analytics verwendeten Cookies finden Sie zum Beispiel in der Wissensdatenbank von Google.','Backend / Services / Things to know / HeadlineWhat is the purpose of the <translation-key id="Cookies">Cookies</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Cookies">Cookies</translation-key>?','Backend / Services / Things to know / HeadlineInput fields explained'=>'Eingabefelder erklärt','Backend / Services / Things to know / Headline<translation-key id="Description">Description</translation-key>: Enter a description of the cookie and explain its purpose. This is optional, but recommended.'=>'<translation-key id="Description">Beschreibung</translation-key>: Geben Sie eine Beschreibung des Cookies ein und erklären Sie seinen Zweck. Dies ist optional, wird aber empfohlen.','Backend / Services / Things to know / HeadlineThe <translation-key id="Cookies">Cookies</translation-key> section of your browser\'s developer tools can be used to find the values for the <translation-key id="Name">Name</translation-key>, <translation-key id="Hostname">Hostname</translation-key>, <translation-key id="Path">Path</translation-key>, and <translation-key id="Lifetime">Lifetime</translation-key> fields.'=>'Im Bereich <translation-key id="Cookies">Cookies</translation-key> der Entwickler-Tools Ihres Browsers können Sie die Werte für die Felder <translation-key id="Name">Name</translation-key>, <translation-key id="Hostname">Hostname</translation-key>, <translation-key id="Path">Pfad</translation-key> und <translation-key id="Lifetime">Lebensdauer</translation-key> ermitteln.','Backend / Services / Things to know / Headline<translation-key id="Lifetime">Lifetime</translation-key>: The field generally matches the <translation-key id="Expires">Expires</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. Inform your visitor how many days the cookie will be stored or enter <translation-key id="Session">Session</translation-key> if the cookie is a session cookie and will be deleted when the browser is closed.'=>'<translation-key id="Lifetime">Lebensdauer</translation-key>: Das Feld stimmt in der Regel mit der Spalte <translation-key id="Expires">Läuft ab</translation-key> im Bereich <translation-key id="Cookies">Cookies</translation-key> Ihres Browsers überein. Informieren Sie Ihren Besucher darüber, wie viele Tage das Cookie gespeichert wird, oder geben Sie <translation-key id="Session">Session / Sitzungsende</translation-key> ein, wenn das Cookie ein Session-Cookie ist und beim Schließen des Browsers gelöscht wird.','Backend / Services / Things to know / HeadlineIf you find a date in the <translation-key id="Expires">Expires</translation-key> column, this means that the cookie is a persistent cookie and will be deleted on the specified date.'=>'Wenn Sie in der Spalte <translation-key id="Expires">Läuft ab</translation-key> ein Datum finden, bedeutet dies, dass es sich um ein dauerhaftes Cookie handelt, das an dem angegebenen Datum gelöscht wird.','Backend / Services / Things to know / HeadlineIf you find the value <translation-key id="Session">Session</translation-key> in the <translation-key id="Expires">Expires</translation-key> column of your browser, this means that the cookie is a session cookie and will be deleted when you close your browser.'=>'Wenn Sie in der <translation-key id="Expires">Läuft ab</translation-key>-Spalte Ihres Browsers den Wert <translation-key id="Session">Session / Sitzungsende</translation-key> finden, bedeutet dies, dass das Cookie ein Session-Cookie ist und gelöscht wird, wenn Sie Ihren Browser schließen.','Backend / Services / Things to know / Headline<translation-key id="Hostname">Hostname</translation-key>: The field generally matches the <translation-key id="Domain">Domain</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. You can enter <strong>#</strong> into this field and <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> will display the domain of your website in the <translation-key id="Dialog">Dialog</translation-key>.'=>'<translation-key id="Hostname">Hostname</translation-key>: Das Feld stimmt in der Regel mit der <translation-key id="Domain">Domain-Spalte</translation-key> im Bereich <translation-key id="Cookies">Cookies</translation-key> Ihres Browsers überein. Sie können <strong>#</strong> in dieses Feld eingeben und <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> wird die Domain Ihrer Website im <translation-key id="Dialog">Dialog</translation-key> anzeigen.','Backend / Services / Things to know / Headline<translation-key id="Name">Name</translation-key>: The field generally matches the <translation-key id="Name">Name</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser.'=>'<translation-key id="Name">Name</translation-key>: Das Feld stimmt im Allgemeinen mit der Spalte <translation-key id="Name">Name</translation-key> im Bereich <translation-key id="Cookies">Cookies</translation-key> Ihres Browsers überein.','Backend / Services / Things to know / Headline<translation-key id="Path">Path</translation-key>: The field generally matches the <translation-key id="Path">Path</translation-key> column in the <translation-key id="Cookies">Cookies</translation-key> section of your browser. Usually, the path is <strong>/</strong>.'=>'<translation-key id="Path">Pfad</translation-key>: Das Feld stimmt im Allgemeinen mit der Spalte <translation-key id="Path">Pfad</translation-key> im Bereich <translation-key id="Cookies">Cookies</translation-key> Ihres Browsers überein. Normalerweise lautet der Pfad <strong>/</strong>.','Backend / Services / Things to know / Headline<translation-key id="Purpose">Purpose</translation-key>: We distinguish in two types of <translation-key id="Purposes">Purposes</translation-key>: <translation-key id="Functional">Functional</translation-key> and <translation-key id="Tracking">Tracking</translation-key>.'=>'<translation-key id="Purpose">Zweck</translation-key>: Wir unterscheiden zwischen zwei Arten von <translation-key id="Purposes">Zwecken</translation-key>: <translation-key id="Functional">Funktional</translation-key> und <translation-key id="Tracking">Tracking</translation-key>.','Backend / Services / 