el / HeadlineImportant'=>'Wichtig','Backend / Global / Info Panel / HeadlineThings to know'=>'Wissenswertes','Backend / Global / HintClick to copy to clipboard.'=>'Klicken Sie an, um in die Zwischenablage zu kopieren.','Backend / Global / HintYou are seeing the settings for the language <strong>{{ currentLanguage }}</strong>.'=>'Sie sehen die Einstellungen für die Sprache <strong>{{ currentLanguage }}</strong>.','Backend / Global / HintYour entry is stored for this language.'=>'Ihr Eintrag wird für diese Sprache gespeichert.','Backend / Global / Default Select Option-- Please select --'=>'-- Bitte wählen Sie --','Backend / Global / PaginationFirst Page'=>'Erste Seite','Backend / Global / PaginationLast Page'=>'Letzte Seite','Backend / Global / PaginationNext'=>'Weiter','Backend / Global / Paginationof'=>'von','Backend / Global / PaginationPrevious'=>'Vorherige','Backend / Global / Paginationresults'=>'Ergebnisse','Backend / Global / PaginationShowing'=>'Zeige','Backend / Global / Paginationto'=>'bis','Backend / Global / TableLanguage'=>'Sprache','Backend / Global / Footer / URLhttps://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis'=>'https://borlabs.io/?utm_source=Borlabs+Cookie&amp;utm_medium=Footer+Logo&amp;utm_campaign=Analysis','Backend / IAB TCF Configure Vendors / Alert MessageThe <translation-key id="Global-Vendor-List">Global Vendor List</translation-key> is not be downloaded. Please go to the IAB TCF settings and download the list.'=>'Die <translation-key id="Global-Vendor-List">Global Vendor List</translation-key> kann nicht heruntergeladen werden. Bitte gehen Sie zu den IAB TCF-Einstellungen und laden Sie die Liste herunter.','Backend / IAB TCF Configure Vendors / Alert MessageCurrently, the <translation-key id="Vendors-Preview">Vendors Preview</translation-key> list is empty. This may be because the <translation-key id="Update-Preview">Update Preview</translation-key> button has not been clicked to refresh the list, or because no consent parameters such as <translation-key id="IAB-TCF-Purpose">Purpose</translation-key>, <translation-key id="IAB-TCF-Feature">Feature</translation-key>, <translation-key id="IAB-TCF-Special-Feature">Special Feature</translation-key>, or <translation-key id="IAB-TCF-Special-Purpose">Special Purpose</translation-key> have been selected in the have been selected in the <translation-key id="Configure-Vendors">Configure Vendors</translation-key> panel. Please ensure that you\'ve made your selections and clicked <translation-key id="Update-Preview">Update Preview</translation-key> to see them in the <translation-key id="Vendors-Preview">Vendors Preview</translation-key> list.'=>'Derzeit ist die Liste <translation-key id="Vendors-Preview">Vendoren-Vorschau</translation-key> leer. Dies kann daran liegen, dass der Button <translation-key id="Update-Preview">Vorschau aktualisieren</translation-key> nicht angeklickt wurde, um die Liste zu aktualisieren, oder dass im Fenster <translation-key id="Configure-Vendors">Vendoren konfigurieren</translation-key> keine Einwilligungsparameter wie <translation-key id="IAB-TCF-Purpose">Zweck</translation-key>, <translation-key id="IAB-TCF-Feature">Feature</translation-key>, <translation-key id="IAB-TCF-Special-Feature">Spezielles Feature</translation-key> oder <translation-key id="IAB-TCF-Special-Purpose">Spezieller Zweck</translation-key> ausgewählt wurden. Bitte vergewissern Sie sich, dass Sie Ihre Auswahl getroffen und auf <translation-key id="Update-Preview">Vorschau aktualisieren</translation-key> geklickt haben, damit sie in der Liste <translation-key id="Vendors-Preview">Vendoren-Vorschau</translation-key> angezeigt werden.','Backend / IAB TCF Configure Vendors / BreadcrumbConfigure Vendors'=>'Vendoren konfigurieren','Backend / IAB TCF Configure Vendors / BreadcrumbIAB TCF'=>'IAB TCF','Backend / IAB TCF Configure Vendors / ButtonConfigure Vendors'=>'Vendoren konfigurieren','Backend / IAB TCF Configure Vendors / ButtonUpdate Preview'=>'Vorschau aktualisieren','Backend / IAB TCF Configure Vendors / FieldVendor IDs'=>'Vendor-IDs','Backend / IAB TCF Configure Vendors / FieldReplace Vendor Configuration'=>'Vendor-Konfiguration austauschen','Backend / IAB TCF Configure Vendors / HeadlineConfigure Vendors'=>'Vendoren konfigurieren','Backend / IAB TCF Configure Vendors / HeadlineVendors Preview'=>'Vendoren-Vorschau','Backend / IAB TCF Configure Vendors / HintAlternatively, or in addition, you have the option to input the <translation-key id="IDs">IDs</translation-key> of the <translation-key id="Vendors">Vendors</translation-key> you wish to activate. Enter the <translation-key id="Vendor-IDs">Vendor IDs</translation-key> separated by comma.'=>'Alternativ oder zusätzlich haben Sie die Möglichkeit, die <translation-key id="IDs">IDs</translation-key> der <translation-key id="Vendors">Vendoren</translation-key> einzugeben, die Sie aktivieren möchten. Geben Sie die <translation-key id="Vendor-IDs">Vendoren-IDs</translation-key> durch ein Komma getrennt ein.','Backend / IAB TCF Configure Vendors / HintIf you enable this option, all existing <translation-key id="Vendors">Vendors</translation-key> will be disabled and only <translation-key id="Vendors">Vendors</translation-key> of this configuration will be enabled. If you leave the option disabled, the <translation-key id="Vendors">Vendors</translation-key> of this configuration will be enabled additionally.'=>'Wenn Sie diese Option aktivieren, werden alle vorhandenen <translation-key id="Vendors">Vendoren</translation-key> deaktiviert und nur die <translation-key id="Vendors">Vendoren</translation-key> dieser Konfiguration werden aktiviert. Wenn Sie die Option deaktiviert lassen, werden die <translation-key id="Vendors">Vendoren</translation-key> dieser Konfiguration zusätzlich aktiviert.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Feature">Feature</translation-key> means one of the features of processing personal data used by participants in the Framework that are defined in the Policies or the Specifications used in pursuit of one or several <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> for which the user is not given choice separately to the choice afforded regarding the <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> for which they are used.'=>'<translation-key id="IAB-TCF-Feature">Feature</translation-key>: eines der Features der Verarbeitung personenbezogener Daten, die von den Teilnehmern des Frameworks verwendet werden und die in den Richtlinien oder Spezifikationen festgelegt sind und die für einen oder mehrere <translation-key id="IAB-TCF-Purposes">Zwecke</translation-key> verwendet werden, für die der Nutzer keine andere Wahlmöglichkeit hat als für die <translation-key id="IAB-TCF-Purposes">Zwecke</translation-key>, für die sie verwendet werden.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Purpose">Purpose</translation-key> means one of the defined purposes for processing of data, including users’ personal data, by participants in the Framework that are defined in the Policies or the Specifications for which <translation-key id="Vendors">Vendors</translation-key> declare a Legal Basis in the GVL and for which the user is given choice, i.e. to consent or to object depending on the Legal Basis for the processing, by a CMP.'=>'<translation-key id="IAB-TCF-Purpose">Zweck</translation-key> ist einer der definierten Zwecke für die Verarbeitung von Daten, einschließlich der personenbezogenen Daten der Nutzer, von Teilnehmern am Framework, die in den Grundsätzen oder Spezifikationen festgelegt sind, für die die <translation-key id="Vendors">Vendoren</translation-key> in der GVL eine Rechtsgrundlage angeben, und für die der Nutzer die Wahl hat, d. h. je nach Rechtsgrundlage für die Verarbeitung zuzustimmen oder Widerspruch einzulegen, durch eine CMP.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Special-Feature">Special Feature</translation-key> means one of the features of processing personal data used by participants in the Framework that are defined in the Policies or the Specifications used in pursuit of one or several <translation-key id="Purposes">Purposes</translation-key> for which the user is given the choice to opt-in separately from the choice afforded regarding the <translation-key id="IAB-TCF-Purposes">Purposes</translation-key> which they support.'=>'<translation-key id="IAB-TCF-Special-Feature">Spezielles Feature</translation-key>: eines der Features der Verarbeitung personenbezogener Daten, die von Teilnehmern am Framework verwendet werden und die in den Richtlinien oder Spezifikationen für einen oder mehrere <translation-key id="IAB-TCF-Purposes">Zwecke</translation-key> definiert sind, für die der Nutzer die Möglichkeit hat, sein Opt-in getrennt von den <translation-key id="IAB-TCF-Purposes">Zwecken</translation-key> zu wählen, die sie unterstützen.','Backend / IAB TCF Configure Vendors / Things to know<translation-key id="IAB-TCF-Special-Purpose">Special Purpose</translation-key> means one of the defined purposes for processing of data, including users’ personal data, by participants in the Framework that are defined in the Policies or the Specifications for which <translation-key id="Vendors">Vendors</translation-key> declare a Legal Basis in the GVL and for which the user is not given choice by a CMP.'=>'<translation-key id="IAB-TCF-Special-Purpose">Spezieller Zweck</translation-key> ist einer der definierten Zwecke für die Verarbeitung von Daten, einschließlich der personenbezogenen Daten der Nutzer, durch die Teilnehmer am Framework, die in den Richtlinien oder Spezifikationen festgelegt sind, für die <translation-key id="Vendors">Vendoren</translation-key> in der GVL eine Rechtsgrundlage angeben und für die der Nutzer keine Wahlmöglichkeit durch eine CMP hat.','Backend / IAB TCF Settings / Alert MessageGlobal Vendor List successfully downloaded.'=>'Globale Vendor List erfolgreich heruntergeladen.','Backend / IAB TCF Settings / BreadcrumbIAB TCF - Settings'=>'IAB TCF - Einstellungen','Backend / IAB TCF Settings / ButtonDownload GVL'=>'GVL herunterladen','Backend / IAB TCF Settings / ButtonUpdate GVL'=>'GVL aktualisieren','Backend / IAB TCF Settings / FieldGlobal Vendor List (GVL) Status'=>'Global Vendor List (GVL) Status','Backend / IAB TCF Settings / Field<translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key>'=>'<translation-key id="IAB-TCF-Status">IAB TCF-Status</translation-key>','Backend / IAB TCF Settings / HeadlineGeneral Settings'=>'Allgemeine Einstellungen','Backend / Service Groups / HintWhen <translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key> is enabled, certain settings will be overridden or bypassed. For instance, your chosen layout (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key> &raquo; <translation-key id="Layout">Layout</translation-key>) will be substituted with a designated IAB TCF layout. Additionally, the widget (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Widget">Widget</translation-key> &raquo; <translation-key id="Show-Widget">Show Widget</translation-key>) will be turned on and cannot be turned off thereafter.'=>'Wenn der <translation-key id="IAB-TCF-Status">IAB TCF-Status</translation-key> aktiviert ist, werden bestimmte Einstellungen außer Kraft gesetzt oder umgangen. Zum Beispiel wird das von Ihnen gewählte Layout (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Einstellungen</translation-key> &raquo; <translation-key id="Layout">Layout</translation-key>) durch ein bestimmtes IAB TCF-Layout ersetzt. Außerdem wird das Widget (<translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Widget">Widget</translation-key> &raquo; <translation-key id="Show-Widget">Widget anzeigen</translation-key>) aktiviert und kann danach nicht mehr ausgeschaltet werden.','Backend / IAB TCF Settings / TextGlobal Vendor List is downloaded'=>'Global Vendor List ist heruntergeladen','Backend / IAB TCF Settings / TextLast check with API'=>'Letzte Überprüfung mit API','Backend / IAB TCF Settings / TextGlobal Vendor List is not downloaded'=>'Globale Vendor List wird nicht heruntergeladen','Backend / IAB TCF Settings / HintIAB TCF'=>'IAB TCF','Backend / IAB TCF Settings / HintThe IAB Transparency and Consent Framework (TCF) is a technical standard for the digital advertising industry. It is designed to help all parties in the digital advertising chain ensure that they comply with the EU’s General Data Protection Regulation (GDPR) and ePrivacy Directive when processing personal data or accessing and/or storing information on a user’s device, such as cookies, advertising identifiers, device identifiers and other tracking technologies.'=>'Das IAB Transparency and Consent Framework (TCF) ist ein technischer Standard für die digitale Werbeindustrie. Er soll allen Beteiligten in der digitalen Werbekette helfen sicherzustellen, dass sie die EU-Datenschutzgrundverordnung (GDPR) und die Datenschutzrichtlinie für elektronische Kommunikation einhalten, wenn sie personenbezogene Daten verarbeiten oder auf Informationen auf dem Gerät eines Nutzers zugreifen und/oder diese speichern, z. B. Cookies, Werbekennungen, Gerätekennungen und andere Tracking-Technologien