ation-key id="Imprint-Page">Imprint Page</translation-key> or add a custom URL.'=>'Wählen Sie Ihre <translation-key id="Imprint-Page">Impressum-Seite</translation-key> oder fügen Sie eine eigene URL hinzu.','Backend / Dialog Settings / HintChoose the <translation-key id="Layout">Layout</translation-key> of the <translation-key id="Dialog">Dialog</translation-key>.'=>'Wählen Sie das <translation-key id="Layout">Layout</translation-key> des <translation-key id="Dialog">Dialogs</translation-key>.','Backend / Dialog Settings / HintChoose a <translation-key id="Logo">Logo</translation-key> you want to appear in the <translation-key id="Dialog">Dialog</translation-key>.'=>'Wählen Sie ein <translation-key id="Logo">Logo</translation-key>, das im <translation-key id="Dialog">Dialog</translation-key> erscheinen soll.','Backend / Dialog Settings / HintChoose the HD version of the <translation-key id="Logo">Logo</translation-key> you want to appear in the <translation-key id="Dialog">Dialog</translation-key>. It will be used for high resolution displays.'=>'Wählen Sie die HD-Version des <translation-key id="Logo">Logos</translation-key>, die im <translation-key id="Dialog">Dialog</translation-key> erscheinen soll. Sie wird für hochauflösende Displays verwendet.','Backend / Dialog Settings / HintChoose the <translation-key id="Position">Position</translation-key> in which the <translation-key id="Dialog">Dialog</translation-key> appears.'=>'Wählen Sie die <translation-key id="Position">Position</translation-key>, an der der <translation-key id="Dialog">Dialog</translation-key> erscheint.','Backend / Dialog Settings / HintChoose your <translation-key id="Privacy-Page">Privacy Page</translation-key> or add a custom URL.'=>'Wählen Sie Ihre <translation-key id="Privacy-Page">Datenschutz-Seite</translation-key> oder fügen Sie eine eigene URL hinzu.','Backend / Dialog Settings / HintRepeat animation.'=>'Wiederholung der Animation.','Backend / Dialog Appearance / HintPlease con