n einem <translation-key id="Content-Blocker">Content-Blocker</translation-key> blockiert werden, steht immer ein Button zur Verfügung, um den Dialog mit Provider-Informationen zu öffnen. Dies ist der Text des Buttons, der zum Schließen dieses Dialogs verwendet wird.','Backend / Country / CountryGuinea-Bissau'=>'Guinea-Bissau','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Dialog-Localization">Dialog Localization</translation-key> texts. They will be reset to their default texts.'=>'Bitte bestätigen Sie, dass Sie alle Texte der <translation-key id="Dialog-Localization">Dialog-Lokalisierung</translation-key> zurücksetzen möchten. Sie werden dann auf ihre Standardtexte zurückgesetzt.','Backend / Country / CountryGuyana'=>'Guyana','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-IAB-TCF">Dialog - IAB TCF</translation-key>?'=>'Was ist der <translation-key id="Dialog-IAB-TCF">Dialog - IAB TCF</translation-key>?','Backend / Country / CountryHong Kong'=>'Hongkong','Backend / Dialog Localization / HeadlineLegal Information'=>'Rechtliche Informationen','Backend / Country / CountryHeard Island and McDonald Islands'=>'Heard und McDonald-Inseln','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-Details">Dialog Details</translation-key>?'=>'Was ist der <translation-key id="Dialog-Details">Dialog-Details</translation-key>?','Backend / Country / CountryHonduras'=>'Honduras','Backend / Dialog Localization / HeadlineWhat is the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>?'=>'Was ist der <translation-key id="Dialog-Entrance">Dialog-Einstieg</translation-key>?','Backend / Country / CountryCroatia'=>'Kroatien','Backend / Dialog Localization / TextWhen the <translation-key id="Iab-Tcf-Status">IAB TCF Status</translation-key> setting is enabled (found under <em><translation-key id="Navigation-Consent-Management">Consent Management</tran