 be irrevocably terminated without compensation.'=>'<span class="brlbs-cmpnt-important-text">Warnung</span>: Sollten Ihre Änderungen gegen die TCF-Standards des IAB verstoßen und wir eine Beschwerde des IAB erhalten, wird Ihre Lizenz unwiderruflich und ohne Entschädigung beendet.','Backend / Country / CountryIreland'=>'Irland','Backend / Dialog Localization / TextShould you harbor any uncertainties regarding the compliance of your proposed alterations with the TCF standard, we strongly encourage you to reach out to us prior to implementing any changes.'=>'Sollten Sie sich unsicher sein, ob die von Ihnen vorgeschlagenen Änderungen mit dem TCF-Standard übereinstimmen, empfehlen wir Ihnen dringend, sich vor der Durchführung von Änderungen mit uns in Verbindung zu setzen.','Backend / Country / CountryIsrael'=>'Israel','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Technology">Technology</translation-key>: The technologies used, for example: cookies and their purpose. The number of <translation-key id="Vendors">Vendors</translation-key> <span class="brlbs-cmpnt-important-text">must</span> also be mentioned with the help of <strong><em>{{ totalVendors }}</em></strong>.'=>'<translation-key id="Tcf-Topic-Technology">Technologie</translation-key>: Die verwendeten Technologien, z. B. Cookies und ihr Zweck. Die Anzahl der <translation-key id="Vendors">Vendoren</translation-key> <span class="brlbs-cmpnt-important-text">muss</span> ebenfalls angegeben werden, mit Hilfe von <strong><em>{{ totalVendors }}</em></strong>.','Backend / Country / CountryIsle of Man'=>'Isle of Man','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Personal-Data">Personal Data</translation-key>: What types of personal data are processed?'=>'<translation-key id="Tcf-Topic-Personal-Data">Personenbezogene Daten</translation-key>: Welche Arten von personenbezogenen Daten werden verarbeitet?','Backend / Country / CountryIndia'=>'Indien','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Legitimate-Interest">Legitimate Interest</translation-key>: You <span class="brlbs-cmpnt-important-text">must</span> inform about the legitimate interest that some <translation-key id="Vendors">Vendors</translation-key> claim for data processing.'=>'<translation-key id="Tcf-Topic-Legitimate-Interest">Berechtigtes Interesse</translation-key>: Sie <span class="brlbs-cmpnt-important-text">müssen</span> über das berechtigte Interesse informieren, das einige <translation-key id="Vendors">Vendoren</translation-key> für die Datenverarbeitung geltend machen.','Backend / Country / CountryBritish Indian Ocean Territory'=>'Britisches Territorium im Indischen Ozean','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-More-Information">More Information</translation-key>: Where the visitor can find more information about the <translation-key id="Vendors">Vendors</translation-key> and the data processed.'=>'<translation-key id="Tcf-Topic-More-Information">Weitere Informationen</translation-key>: Hier kann der Besucher weitere Informationen über die <translation-key id="Vendors">Vendoren</translation-key> und die verarbeiteten Daten finden.','Backend / Country / CountryIraq'=>'Irak','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-No-Commitment">No Commitment</translation-key>: That the visitor can visit the website without giving consent.'=>'<translation-key id="Tcf-Topic-No-Commitment">Keine Verpflichtung</translation-key>: Dass der Besucher die Website besuchen kann, ohne seine Einwilligung zu geben.','Backend / Country / CountryIran'=>'Iran','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Revoke">Revoke</translation-key>: That the visitor can revoke the consent any time.'=>'<translation-key id="Tcf-Topic-Revoke">Widerrufen</translation-key>: Dass der Besucher die Einwilligung jederzeit widerrufen kann.','Backend / Country / CountryIceland'=>'Island','Backend / Dialog Localization / Text<translation-key id="Tcf-Topic-Individual-Settings">Individual Settings</translation-key>: That due to individual settings certain functionalities of the website may be unavailable or operate suboptimally.'=>'<translation-key id="Tcf-Topic-Individual-Settings">Individuelle Einstellungen</translation-key>: Aufgrund individueller Einstellungen können bestimmte Funktionen der Website nicht verfügbar sein oder suboptimal funktionieren.','Backend / Country / CountryItaly'=>'Italien','Backend / Dialog Localization / TextYou can select which legal information topics you want to show to a visitor.'=>'Sie können auswählen, welche rechtlichen Informationen Sie einem Besucher zeigen möchten.','Backend / Country / CountryJersey'=>'Jersey','Backend / Dialog Localization / TextIf you disable a text, make sure that its message appears or is part of another text displayed to a visitor.'=>'Wenn Sie einen Text deaktivieren, stellen Sie sicher, dass seine Nachricht erscheint oder Teil eines anderen Textes ist, der einem Besucher angezeigt wird.','Backend / Country / CountryJamaica'=>'Jamaika','Backend / Dialog Localization / TextYou <span class="brlbs-cmpnt-important-text">must</span> inform a visitor about the following topics:'=>'Sie <span class="brlbs-cmpnt-important-text">müssen</span> einen Besucher über die folgenden Themen informieren:','Backend / Country / CountryJordan'=>'Jordanien','Backend / Dialog Localization / TextA minimum age of 16 is required to consent to non-optional services.'=>'Für die Einwilligung zu nicht-optionalen Services ist ein Mindestalter von 16 Jahren erforderlich.','Backend / Country / CountryJapan'=>'Japan','Backend / Dialog Localization / TextThe used technologies, for example: Cookies.'=>'Die verwendeten Technologien, zum Beispiel: Cookies.','Backend / Country / CountryKenya'=>'Kenia','Backend / Dialog Localization / TextWhat type of personal data is used and for what purpose.'=>'Welche Art von personenbezogenen Daten wird verwendet und zu welchem Zweck.','Backend / Country / CountryKyrgyzstan'=>'Kirgisistan','Backend / Dialog Localization / TextWhere more information about each service can be found.'=>'Hier finden Sie weitere Informationen zu den einzelnen Services.','Backend / Country / CountryCambodia'=>'Kambodscha','Backend / Dialog Localization / Text<sup>1</sup> That no consent is required to visit your website.'=>'<sup>1</sup> Dass für den Besuch Ihrer Website keine Einwilligung erforderlich ist.','Backend / Country / CountryKiribati'=>'Kiribati','Backend / Dialog Localization / TextThe visitor can revoke the consent any time.'=>'Der Besucher kann die Einwilligung jederzeit widerrufen.','Backend / Country / CountryComoros'=>'Komoren','Backend / Dialog Localization / Text<sup>1</sup> What happens when individual settings are applied.'=>'<sup>1</sup> Was passiert, wenn individuelle Einstellungen angewendet werden?','Backend / Country / CountrySt Kitts and Nevis'=>'St. Kitts und Nevis','Backend / Dialog Localization / Text<sup>2</sup> That personal data can be transferred to non-eu countries with insufficient data protection.'=>'<sup>2</sup> Dass personenbezogene Daten in Nicht-EU-Länder mit unzureichendem Datenschutz übermittelt werden können.','Backend / Country / CountryNorth Korea'=>'Nordkorea','Backend / Dialog Localization / Text<sup>1</sup> It is recommended to display this information.'=>'<sup>1</sup> Es wird empfohlen, diese Informationen anzuzeigen.','Backend / Country / CountrySouth Korea'=>'Südkorea','Backend / Dialog Localization / Text<sup>2</sup> You <span class="brlbs-cmpnt-important-text">must</span> display the <translation-key id="Non-EU-Data-Transfer">Non-EU Data Transfer</translation-key> information if you use a service whose company is based in the USA.'=>'<sup>2</sup> Sie <span class="brlbs-cmpnt-important-text">müssen</span> die Informationen zum <translation-key id="Non-EU-Data-Transfer">Nicht-EU-Datentransfer</translation-key> anzeigen, wenn Sie einen Service nutzen, dessen Unternehmen seinen Sitz in den USA hat.','Backend / Country / CountryKuwait'=>'Kuwait','Backend / Dialog Localization / TextThe <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key> is the first thing your visitors see when they visit your website. It is a small dialog that informs your visitors what cookies and services your website uses and that they can change their consent settings in this dialog.'=>'Der <translation-key id="Dialog-Entrance">Dialog-Einstieg</translation-key> ist das erste, was Ihre Besucher sehen, wenn sie Ihre Website besuchen. Es ist ein kleiner Dialog, der Ihre Besucher darüber informiert, welche Cookies und Services Ihre Website verwendet und dass sie ihre Einwilligungen in diesem Dialog ändern können.','Backend / Country / CountryCayman Islands'=>'Kaimaninseln','Backend / Dialog Localization / TextThe <translation-key id="Dialog-Details">Dialog Details</translation-key> is the dialog that opens when your visitors click on the <translation-key id="Individual-Privacy-Preferences">Individual Privacy Preferences</translation-key> button in the <translation-key id="Dialog-Entrance">Dialog Entrance</translation-key>. It contains detailed information about the cookies and services your website uses and allows for more granular consent.'=>'Der <translation-key id="Dialog-Details">Dialog-Details</translation-key> ist der Dialog, der sich öffnet, wenn Ihre Besucher auf den Button <translation-key id="Individual-Privacy-Preferences">Individuelle Datenschutz-Präferenzen</translation-key> im <translation-key id="Dialog-Entrance">Dialog-Einstieg</translation-key> klicken. Er enthält detaillierte Informationen über die Cookies und Services, die Ihre Website verwendet, und ermöglicht eine detailliertere Einwilligung.','Backend / Country / CountryKazakhstan'=>'Kasachstan','Backend / Dialog Settings / Alert MessageThe <translation-key id="GeoIP">GeoIP</translation-key> database has been downloaded successfully.'=>'Die <translation-key id="GeoIP">GeoIP</translation-key>-Datenbank wurde erfolgreich heruntergeladen.','Backend / Dialog Settings / Alert MessageDepending on applicable law, this layout may not be allowed to be used.'=>'Je nach geltendem Recht darf dieses Layout möglicherweise nicht verwendet werden.','Backend / Dialog Settings / Alert MessageDepending on applicable law, this option may not be allowed to be turned on.'=>'Je nach geltendem Recht darf diese Option möglicherweise nicht aktiviert werden.','Backend / Dialog Settings / Alert MessageThe <translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key> option is currently enabled, located under <em><translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">IAB TCF</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Settings</translation-key></em>. Therefore, modifications to this setting have no effect.'=>'Die Option <translation-key id="IAB-TCF-Status">IAB TCF-Status</translation-key> ist derzeit aktiviert und befindet sich unter <em><translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">IAB TCF</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Einstellungen</translation-key></em>. Daher haben Änderungen an dieser Einstellung keine Auswirkungen.','Backend / Dialog Settings / BreadcrumbDialog - Settings'=>'Dialog - Einstellungen','Backend / Dialog Settings / Button TitleDownload database'=>'Datenbank herunterladen','Backend / Dialog Settings / Button TitleSelect or Upload Logo'=>'Logo auswählen oder hochladen','Backend / Dialog Settings / Button TitleUpdate database'=>'Datenbank aktualisieren','Backend / Dialog Settings / Button TitleUse this media'=>'Dieses Medium verwenden','Backend / Dialog Settings / LabelAnimation'=>'Animation','Backend / Dialog Settings / LabelAnimatio