ackend / Dialog Appearance / HeadlineTab Bar Settings'=>'Tab-Leiste-Einstellungen','Backend / Dialog Appearance / HeadlineTable Settings'=>'Tabelle-Einstellungen','Backend / Dialog Appearance / HintAdd your custom CSS to customize the <translation-key id="Dialog">Dialog</translation-key>.'=>'Fügen Sie Ihr eigenes CSS hinzu, um den <translation-key id="Dialog">Dialog</translation-key> anzupassen.','Backend / Dialog Appearance / HintFor content blocked by a <translation-key id="Content-Blocker">Content Blocker</translation-key>, there is always a button available to open the dialog with provider information. This setting influences the visual presentation of the button used to close this dialog.'=>'Für Inhalte, die von einem <translation-key id="Content-Blocker">Content-Blocker</translation-key> blockiert werden, steht immer ein Button zum Öffnen des Dialogs mit Provider-Informationen zur Verfügung. Diese Einstellung beeinflusst die visuelle Darstellung des Buttons zum Schließen dieses Dialogs.','Backend / Dialog Appearance / HintWhen the <translation-key id="Iab-Tcf-Status">IAB TCF Status</translation-key> setting is enabled (found under <em><translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">IAB TCF</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Settings</translation-key></em>) this setting influences the visual presentation of the button responsible for showing all vendors.'=>'Wenn die Einstellung <translation-key id="Iab-Tcf-Status">IAB TCF-Status</translation-key> aktiviert ist (zu finden unter <em><translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf">IAB TCF</translation-key> &raquo; <translation-key id="Navigation-Iab-Tcf-Settings">Einstellungen</translation-key></em>), beeinflusst diese Einstellung die visuelle Darstellung des Buttons, die alle Vendoren anzeigt.','Backend / Dialog Appearance / HintUsually the theme font is used. To use a custom font family select the checkbox and enter custom font.'=>'Normalerweise wird die Theme-Schriftart verwendet. Um eine benutzerdefinierte Schriftart (font-family) zu verwenden, aktivieren Sie die Checkbox und geben Sie die benutzerdefinierte Schriftart (font-family) ein.','Backend / Dialog Appearance / HintThe default padding is defined for <translation-key id="Small-Screen">Small Screen</translation-key>. However, once the viewport width surpasses 640px, the padding specified for <translation-key id="Medium-Screen">Medium Screen</translation-key> will be applied.'=>'Das Standard-Padding ist für den <translation-key id="Small-Screen">Kleinen Bildschirm</translation-key> definiert. Sobald die Breite des Ansichtsfensters jedoch 640 Pixel übersteigt, wird das für den <translation-key id="Medium-Screen">Mittleren Bildschirm</translation-key> festgelegte Padding angewendet.','Backend / Dialog Appearance / HintThe separator is exclusively visible on smaller displays, such as smartphones.'=>'Der Trenner (Separator) ist ausschließlich auf kleineren Displays, wie z. B. Smartphones, sichtbar.','Backend / Dialog Appearance / HintBased on the base font size, the font sizes of all elements are automatically adjusted proportionally.'=>'Ausgehend von der Schriftgröße (Basis) werden die Schriftgrößen aller Elemente automatisch proportional angepasst.','Backend / Dialog Appearance / HintPlease confirm that you want to reset all <translation-key id="Dialog-Appearance">Dialog Appearance</translation-key> settings. They will be reset to their default settings.'=>'Bitte bestätigen Sie, dass Sie alle Einstellungen für das <translation-key id="Dialog-Appearance">Dialog-Erscheinungsbild</translation-key> zurücksetzen möchten. Sie werden dann auf ihre Standardeinstellungen zurückgesetzt.','Backend / Dialog Appearance / Input PlaceholderEnter custom font family'=>'Benutzerdefinierte Schriftart (font-family) eingeben','Backend / Dialog Appearance / Things to know / TextA <translation-key id="Card">Card</translation-key> displays the name and description of a <translation-key id="Service-Group">Service Group</translation-key>.'=>'Eine <translation-key id="Card">Karte</translation-key> zeigt den Namen und die Beschreibung einer <translation-key id="Service-Group">Service-Gruppe</translation-key> an.','Backend / Dialog Appearance / Things to know / HeadlineOn which elements do these settings have a visual impact?'=>'Auf welche Elemente haben diese Einstellungen einen visuellen Einfluss?','Backend / Dialog Appearance / Things to know / TextA <translation-key id="Card">Card</translation-key> provides a <translation-key id="List">List</translation-key> of <translation-key id="Services">Services</translation-key> associated with the respective <translation-key id="Service-Group">Service Group</translation-key>.'=>'Eine <translation-key id="Card">Karte</translation-key> enthält eine <translation-key id="List">Liste</translation-key> der <translation-key id="Services">Services</translation-key>, die mit der jeweiligen <translation-key id="Service-Group">Service-Gruppe</translation-key> verbunden sind.','Backend / Dialog Appearance / Things to know / TextClick on the image to see what is affected by these settings.'=>'Klicken Sie auf das Bild, um zu sehen, was von diesen Einstellungen betroffen ist.','Backend / Dialog Appearance / Things to know / TextTables are typically located in the details section of a <translation-key id="Service">Service</translation-key>, <translation-key id="Provder">Provider</translation-key>, or <translation-key id="Consent-History">Consent History</translation-key>.'=>'Tabellen befinden sich in der Regel im Bereich Details eines <translation-key id="Service">Services</translation-key>, <translation-key id="Provder">Providers</translation-key> oder der <translation-key id="Consent-History">Einwilligung-Historie</translation-key>.','Backend /