itment</translation-key> - Description'=>'<translation-key id="Tcf-Topic-No-Commitment">Keine Verpflichtung</translation-key> - Beschreibung','Frontend / Dialog / Link TextSave Consent'=>'Einwilligung speichern','Frontend / IAB TCF Dialog / A11YThe following is a list of purposes of the IAB Transparency and Consent Framework (TCF) for which consent can be given. The TCF was created to help publishers, technology providers and advertisers comply with the EU GDPR and ePrivacy Directive.'=>'Im Folgenden finden Sie eine Liste der Zwecke des IAB Transparency and Consent Framework (TCF), für die eine Einwilligung erteilt werden kann. Das TCF wurde geschaffen, um Verlagen, Technologieanbietern und Werbetreibenden dabei zu helfen, die EU-DSGVO und die ePrivacy-Richtlinie einzuhalten.','Backend / IAB TCF Cookie Box / Text<translation-key id="Tcf-Topic-Revoke">Revoke</translation-key> - Description'=>'<translation-key id="Tcf-Topic-Revoke">Widerrufen</translation-key> - Beschreibung','Frontend / IAB TCF Dialog / A11YThe following is a list of service groups for which consent can be given. The first service group is essential and cannot be unchecked. These service groups are not part of the TCF standard.'=>'Es folgt eine Liste der Service-Gruppen, für die eine Einwilligung erteilt werden kann. Die erste Service-Gruppe ist essenziell und kann nicht abgewählt werden. Diese Service-Gruppen sind nicht Teil des TCF-Standards.','Backend / IAB TCF Cookie Box / Text<translation-key id="Tcf-Topic-Technology">Technology</translation-key> - Description'=>'<translation-key id="Tcf-Topic-Technology">Technologie</translation-key> - Beschreibung','Frontend / IAB TCF Dialog / TextData Retention:'=>'Datenaufbewahrung:','Backend / Dialog Localization / LabelTCF Consent History - Headline'=>'TCF-Einwilligung-Historie - Überschrift','Frontend / IAB TCF Dialog / TextDays'=>'Tage','Backend / IAB TCF Cookie Box / HeadlineNon-TCF Standard Consent History - Headline'=>'Nicht-TCF-Standard-Einwilligung-Historie - Überschrift','Frontend / IAB TCF Dialog / TextPlease note that based on individual settings not all functions of the site may be available.'=>'Bitte beachten Sie, dass aufgrund individueller Einstellungen möglicherweise nicht alle Funktionen der Website verfügbar sind.','Backend / IAB TCF Cookie Box / HeadlineData Categories - Headline'=>'Datenkategorien - Überschrift','Frontend / IAB TCF Dialog / TextSome of our <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="vendors">{{ totalVendors }} partners</a> process your data (revocable at any time) based on <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="leg-int">legitimate interest</a>.'=>'Einige unserer <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="vendors">{{ totalVendors }} Partner</a> verarbeiten Ihre Daten (jederzeit widerrufbar) auf der Grundlage eines <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="leg-int">berechtigten Interesses</a>.','Frontend / IAB TCF Dialog / TextYou can find more information about the use of your data and about our partners under <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Settings</a> or in our privacy policy.'=>'Weitere Informationen über die Verwendung Ihrer Daten und über unsere Partner finden Sie unter <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Einstellungen</a> oder in unserer Datenschutzerklärung.','Backend / IAB TCF Cookie Box / HeadlineIllustrations - Headline'=>'Illustrationen - Überschrift','Frontend / IAB TCF Dialog / TextThere is no obligation to agree to the processing of your data in order to use this offer.'=>'Es besteht keine Verpflichtung, der Verarbeitung Ihrer Daten zuzustimmen, um dieses Angebot zu nutzen.','Backend / IAB TCF Cookie Box / HeadlineLegitimate Interests - Headline'=>'Berechtigte Interessen - Überschrift','Frontend / IAB TCF Dialog / TextPersonal data can be processed (e.g. recognition features, IP addresses), for example for personalized ads and content or ad and content measurement.'=>'Personenbezogene Daten können verarbeitet werden (z. B. Erkennungsmerkmale, IP-Adressen), z. B. für personalisierte Anzeigen und Inhalte oder zur Messung von Anzeigen und Inhalten.','Backend / IAB TCF Cookie Box / HeadlineNon-TCF Standard Categories- Headline'=>'Nicht-TCF-Standard-Kategorien - Überschrift','Frontend / IAB TCF Dialog / TextWe cannot display certain contents without your consent. You can revoke or adjust your selection at any time under <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Settings</a>. Your selection will only be applied to this offer.'=>'Wir können bestimmte Inhalte nicht ohne Ihre Einwilligung anzeigen. Sie können Ihre Auswahl jederzeit unter <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Einstellungen</a> widerrufen oder anpassen. Ihre Auswahl wird nur auf dieses Angebot angewendet.','Frontend / IAB TCF Dialog / TextWe need your consent for us and our {{ totalVendors }} partners to use cookies and other technologies to deliver relevant content and advertising to you. This is how we finance and optimize our website.'=>'Wir benötigen Ihre Einwilligung, damit wir und unsere {{ totalVendors }} Partner Cookies und andere Technologien verwenden können, um Ihnen relevante Inhalte und Werbung zu liefern. Auf diese Weise finanzieren und optimieren wir unsere Website.','Frontend / IAB TCF Dialog / Consent HistoryTCF Vendors Consents'=>'TCF-Vendoren-Einwilligungen','Frontend / IAB TCF Dialog / Consent HistoryNon-TCF Standard Consents'=>'Nicht-TCF-Standardeinwilligungen','Backend / IAB TCF Cookie Box / HeadlineStandard Data Retention - Headline'=>'Standard Datenaufbewahrung - Überschrift','Frontend / IAB TCF Dialog / Consent HistoryData Categories'=>'Datenkategorien','Backend / IAB TCF Cookie 