ogy - Description'=>'Technologie - Beschreibung','Frontend / IAB TCF Dialog / ProviderVendor'=>'Vendor','Backend / Dialog Localization / HeadlinePrivacy - Link Text'=>'Datenschutz - Link-Text','Frontend / Dialog / Link TextImprint'=>'Impressum','Backend / Dialog Localization / HeadlineAdress'=>'Adresse','Frontend / Dialog / TextIf you are under 16 and wish to give consent to optional services, you must ask your legal guardians for permission.'=>'Wenn Sie unter 16 Jahre alt sind und Ihre Einwilligung zu optionalen Services geben möchten, müssen Sie Ihre Erziehungsberechtigten um Erlaubnis bitten.','Backend / Dialog Localization / HeadlineClose - Button Text'=>'Schließen - Button-Text','Frontend / Dialog / TextPlease note that based on individual settings not all functions of the site may be available.'=>'Bitte beachten Sie, dass aufgrund individueller Einstellungen möglicherweise nicht alle Funktionen der Website verfügbar sind.','Backend / Dialog Localization / HeadlineCookie URL'=>'Cookie-URL','Frontend / Dialog / TextYou can find more information about the use of your data in our <a href="{{ privacyPageUrl }}">privacy policy</a>.'=>'Weitere Informationen über die Verwendung Ihrer Daten finden Sie in unserer <a href="{{ privacyPageUrl }}">Datenschutzerklärung</a>.','Backend / Dialog Localization / HeadlineDescription'=>'Beschreibung','Frontend / Dialog / TextThere is no obligation to consent to the processing of your data in order to use this offer.'=>'Es besteht keine Verpflichtung, in die Verarbeitung Ihrer Daten einzuwilligen, um dieses Angebot zu nutzen.','Frontend / Dialog / TextSome services process personal data in the USA. With your consent to use these services, you also consent to the processing of your data in the USA pursuant to Art. 49 (1) lit. a GDPR. The ECJ classifies the USA as a country with insufficient data protection according to EU standards. For example, there is a risk that U.S. authorities will process personal data in surveillance programs without any existing possibility of legal action for Europeans.'=>'Einige Services verarbeiten personenbezogene Daten in den USA. Mit Ihrer Einwilligung zur Nutzung dieser Services willigen Sie auch in die Verarbeitung Ihrer Daten in den USA gemäß Art. 49 (1) lit. a GDPR ein. Der EuGH stuft die USA als ein Land mit unzureichendem Datenschutz nach EU-Standards ein. Es besteht beispielsweise die Gefahr, dass US-Behörden personenbezogene Daten in Überwachungsprogrammen verarbeiten, ohne dass für Europäerinnen und Europäer eine Klagemöglichkeit besteht.','Frontend / Dialog / TextPersonal data may be processed (e.g. IP addresses), for example for personalized ads and content or ad and content measurement.'=>'Personenbezogene Daten können verarbeitet werden (z. B. IP-Adressen), z. B. für personalisierte Anzeigen und Inhalte oder die Messung von Anzeigen und Inhalten.','Frontend / Dialog / TextYou can revoke or adjust your selection at any time under <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Settings</a>.'=>'Sie können Ihre Auswahl jederzeit unter <a href="#" role="button" aria-expanded="false" data-borlabs-cookie-actions="preferences">Einstellungen</a> widerrufen oder anpassen.','Frontend / Dialog / TextWe use cookies and other technologies on our website. Some of them are essential, while others help us to improve this website and your experience.'=>'Wir verwenden Cookies und andere Technologien auf unserer Website. Einige von ihnen sind essenziell, während andere uns helfen, diese Website und Ihre Erfahrung zu verbessern.','Frontend / Dialog / Link TextPrivacy Policy'=>'Datenschutzerklärung','Frontend / Dialog / ProviderAddress'=>'Adresse','Frontend / Dialog / ProviderClose'=>'Schließen','Frontend / Dialog / ProviderCookie URL'=>'Cookie-URL','Frontend / Dialog / ProviderDescription'=>'Beschreibung','Frontend / Dialog / ProviderProvider Information'=>'Provider-Informationen','Frontend / Dialog / Provid