ien','Seeder / Default Service Group / DescriptionMarketing services are used by third-party advertisers or publishers to display personalized ads. They do this by tracking visitors across websites.'=>'Marketing Services werden von Drittanbietern oder Herausgebern genutzt, um personalisierte Werbung anzuzeigen. Sie tun dies, indem sie Besucher über Websites hinweg verfolgen.','Seeder / Default Service Group / NameMarketing'=>'Marketing','Seeder / Default Service Group / DescriptionStatistics cookies collect usage information, enabling us to gain insights into how our visitors interact with our website.'=>'Statistik-Cookies sammeln Nutzungsdaten, die uns Aufschluss darüber geben, wie unsere Besucher mit unserer Website umgehen.','Seeder / Default Service Group / NameStatistics'=>'Statistik','Frontend / Shortcode / Button TitleOpen Consent Preferences'=>'Einwilligung-Präferenzen öffnen','Backend / Dialog Appearance / BreadcrumbDialog - Appearance'=>'Dialog - Erscheinungsbild','Backend / Dialog Appearance / LabelActive'=>'Aktiv','Backend / Dialog Appearance / Label<translation-key id="Backdrop">Backdrop</translation-key>'=>'<translation-key id="Backdrop">Backdrop</translation-key>','Backend / Dialog Appearance / LabelBackground Color'=>'Hintergrundfarbe','Backend / Dialog Appearance / LabelBorder Color'=>'Rahmenfarbe (border-color)','Backend / Dialog Appearance / LabelBorder Radius'=>'Rahmenradius (border-radius)','Backend / Dialog Appearance / LabelBottom'=>'Unten','Backend / Dialog Appearance / LabelBottom Left'=>'Unten links','Backend / Dialog Appearance / LabelBottom Right'=>'Unten rechts','Backend / Dialog Appearance / LabelButton'=>'Button','Backend / Dialog Appearance / LabelButton Color'=>'Button Farbe','Backend / Dialog Appearance / LabelButton Text Color'=>'Button-Textfarbe','Backend / Dialog Appearance / LabelCard'=>'Karte','Backend / Global / TextCheckbox'=>'Checkbox','Backend / Dialog Appearance / LabelCSS'=>'CSS','Backend / Dialog Appe