ckers</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key> are not reset.'=>'Bitte bestätigen Sie, dass Sie alle <translation-key id="Content-Blocker">Content-Blocker</translation-key>-Einstellungen zurücksetzen möchten. Sie werden auf ihre Standardeinstellungen zurückgesetzt. Ihre benutzerdefinierten <translation-key id="Content-Blockers">Content-Blocker</translation-key> und die <translation-key id="Content-Blockers">Content-Blocker</translation-key>, die über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installiert wurden, werden nicht zurückgesetzt.','Backend / Cloud Scan / AlertThe Borlabs Cloud API returned an error. Please check if Borlabs Cookie is up-to-date.'=>'Die Borlabs Cloud API hat einen Fehler zurückgegeben. Bitte prüfen Sie, ob Borlabs Cookie aktuell ist.','Backend / Content Blockers / Table HeadlineHost(s)'=>'Host(s)','Backend / Cloud Scan / BreadcrumbCreate Scan'=>'Scan erstellen','Backend / Content Blockers / Table HeadlineID'=>'ID','Backend / Cloud Scan / BreadcrumbScanner'=>'Scanner','Backend / Content Blockers / Table HeadlineName'=>'Name','Backend / Cloud Scan / ButtonGo back'=>'Zurückgehen','Backend / Content Blockers / Table HeadlineStatus'=>'Status','Backend / Cloud Scan / Button<translation-key id="Button-Create-Scan">Create scan</translation-key>'=>'<translation-key id="Button-Create-Scan">Scan erstellen</translation-key>','Backend / Content Blockers / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Cloud Scan / FieldCustom scan URLs'=>'Benutzerdefinierte Scan-URLs','Backend / Content Blockers / Things to know / HeadlineWhat is the purpose of the <translation-key id="Content-Blockers">Content Blockers</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Content-Blockers">Content-Blocker</translation-key>?','Backend / Cloud Scan / FieldEnable custom URL to scan'=>'Benutzerdefinierte URL zum Scannen aktivieren','Backend / Content Blockers / Things to know / TextUsing <translation-key id="Content-Blockers">Content Blockers</translation-key>, you can automatically block iframes such as videos from <strong>YouTube</strong> or <translation-key id="oEmbeds">oEmbeds</translation-key> such as posts from <strong>Pinterest</strong>. Your visitor sees a message that a content has been blocked and has the possibility to reload this content by clicking on it. You can customize the text and design of the block message to suit your needs and theme.'=>'Mit <translation-key id="Content-Blockers">Content-Blockern</translation-key> können Sie automatisch iframes wie Videos von <strong>YouTube</strong> oder <translation-key id="oEmbeds">oEmbeds</translation-key> wie Beiträge von <strong>Pinterest</strong> blockieren. Ihr Besucher sieht eine Nachricht, dass ein Inhalt gesperrt wurde, und hat die Möglichkeit, diesen Inhalt durch Anklicken neu zu laden. Sie können den Text und das Design der Blockierungsnachricht an Ihre Bedürfnisse und Ihr Theme anpassen.','Backend / Cloud Scan / FieldCustom page'=>'Benutzerdefinierte Seite','Backend / Content Blockers / Things to know / TextGeneral settings can be found under <translation-key id="Navigation-Blockers">Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers">Content Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers-Settings">Settings</translation-key>.'=>'Allgemeinen Einstellungen finden Sie unter <translation-key id="Navigation-Blockers">Blocker</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers">Content-Blocker</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers-Settings">Einstellungen</translation-key>.','Backend / Cloud Scan / FieldPages to scan'=>'Zu scannende Seiten','Backend / Content Blockers / Things to know / TextThe visual appearance (colors, borders, etc.) can be customized under <translation-key id="Navigation-Blockers">Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers">Content Blockers</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers-Appearance">Appearance</translation-key>.'=>'Das Erscheinungsbild (Farben, Rahmen usw.) kann unter <translation-key id="Navigation-Blockers">Blocker</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers">Content-Blocker</translation-key> &raquo; <translation-key id="Navigation-Blockers-Content-Blockers-Appearance">Erscheinungsbild</translation-key> angepasst werden.','Backend / Cloud Scan / Field<translation-key id="Scan-type">Scan type</translation-key>'=>'<translation-key id="Scan-type">Scan-Typ</translation-key>','Backend / Content Blockers / Things to know / TextThe <translation-key id="Content-Blocker">Content Blocker</translation-key> is active and does block content (iframes) of the configured hosts.'=>'Der <translation-key id="Content-Blocker">Content-Blocker</translation-key> ist aktiv und blockiert die Inhalte (iframes) der konfigurierten Hosts.','Backend / Cloud Scan / HeadlineSelect pages to scan'=>'Zu scannende Seiten auswählen','Backend / Content Blockers / Things to know / TextDelete the <translation-key id="Content-Blocker">Content Blocker</translation-key>. Not available for <translation-key id="Content-Blocker">Content Blocker</translation-key>: <translation-key id="Content-Blocker-Default">Default</translation-key> or a <translation-key id="Content-Blocker">Content Blocker</translation-key> installed via the <translation-key id="Navigation-Library">Library</translation-key>.'=>'Löschen Sie den <translation-key id="Content-Blocker">Content-Blocker</translation-key>. Nicht verfügbar für <translation-key id="Content-Blocker">Content-Blocker</translation-key>: <translation-key id="Content-Blocker-Default">Standard</translation-key> oder einen über die <translation-key id="Navigation-Library">Bibliothek</translation-key> installierten <translation-key id="Content-Blocker">Content-Blocker</translation-key>.','Backend / Cloud Scan / TipPages to scan'=>'Zu scannende Seiten','Backend / Content Blockers / Things to know / TextEdit the <translation-key id="Content-Blocker">Content Blocker</translation-key>.'=>'Bearbeiten Sie den <translation-key id="Content-Blocker">Content-Blocker</translation-key>.','Backend / Cloud Scan / TipScan type'=>'Scan-Typ','Backend / Content Blockers / Things to know / TextThe <translation-key id="Content-Blocker">Content Blocker</translation-key> is inactive is and does not block content (iframes) of the configured hosts.'=>'Der <translation-key id="Content-Blocker">Content-Blocker</translation-key> ist inaktiv und sperrt keine Inhalte (iframes) der konfigurierten Hosts.','Backend / Cloud Scan / TipIf you select this option, the expected scan will be about <strong>{{ numberOfSelectionOfSitesPerPostType }}</strong> pages.'=>'Wenn Sie diese Option wählen, wird der erwartete Scan ungefähr <strong>{{ numberOfSelectionOfSitesPerPostType }}</strong> Seiten betragen.','Backend / Content Blockers Settings / BreadcrumbContent Blocker - Settings'=>'Content-Blocker - Einstellungen','Backend / Cloud Scan / Tip<translation-key id="Custom">Custom</translation-key>: Use this option to scan a specific page of your website.'=>'<translation-key id="Custom">Benutzerdefiniert</translation-key>: Verwenden Sie diese Option, um eine bestimmte Seite Ihrer Website zu scannen.','Backend / Content Blockers Settings / LabelHostname(s) Exclusion List'=>'Hostname(n) Ausschlussliste','Backend / Cloud Scan / Tip<translation-key id="Homepage">Homepage</translation-key>: Use this option to scan the homepage of your website.'=>'<translation-key id="Homepage">Homepage</translation-key>: Verwenden Sie diese Option, um die Homepage Ihrer Website zu scannen.','Backend / Content Blockers Settings / LabelRemove Iframes and more in Feeds'=>'Iframes und mehr in Feeds entfernen','Backend / Cloud Scan / Tip<translation-key id="Selection-Of-Sites-Per-Post-Type">Selection of sites per post type</translation-key>: Use this option to scan a selection of pages of your website. The scanner selects the homepage, the newest and the oldest page of each post type and its archive.'=>'<translation-key id="Selection-Of-Sites-Per-Post-Type">Auswahl von Seiten pro Beitragstyp</translation-key>: Verwenden Sie diese Option, um eine Auswahl von Seiten Ihrer Website zu scannen. Der Scanner wählt die Homepage, die neueste und die älteste Seite jedes Beitragstyps und dessen Archiv aus.','Backend / Content Blockers Settings / Label<translation-key id="Virtual-Hostnames-Exclusion-List">Virtual Hostnames Exclusion List</translation-key>'=>'<translation-key id="Virtual-Hostnames-Exclusion-List">Virtuelle Hostnamen-Ausschlussliste</translation-key>','Backend / Cloud Scan / Tip<translation-key id="Audit">Audit</translation-key>: Use this scan type to verify that your website does not load cookies or external resources without obtaining the appropriate consent.'=>'<translation-key id="Audit">Audit</translation-key>: Verwenden Sie diesen Scan-Typ, um zu überprüfen, dass Ihre Website keine Cookies oder externen Ressourcen lädt, ohne die entsprechende Einwilligung eingeholt zu haben.','Backend / Content Blockers Settings / HeadlineGeneral Settings'=>'Allgemeine Einstellungen','Backend / Cloud Scan / Tip<translation-key id="Setup">Setup</translation-key>: Use this scan type to determine which cookies or external resources are used by your website. After the scan, you will receive recommendations for packages that you can install to block these cookies or external resources.'=>'<translation-key id="Setup">Setup</translation-key>: Verwenden Sie diesen Scan-Typ, um festzustellen, welche Cookies oder externen Ressourcen von Ihrer Website verwendet werden. Nach dem Scan erhalten Sie Empfehlungen für Pakete, die Sie installieren können, um diese Cookies oder externen Ressourcen zu blockieren.','Backend / Content Blockers Settings / HeadlineReset Content Blocker Settings'=>'Content-Blocker-Einstellungen zurücksetzen','Backend / Cloud Scan / AlertWe have no additional suggestions.'=>'Wir haben keine weiteren Vorschläge.','Backend / Content Blockers Settings / HintOne <translation-key id="Hostname">Hostname</translation-key> per line. When a <translation-key id="Hostname">Hostname</translation-key> is recognized (for example within the src-attribute of an iframe) the content will not be blocked.'=>'Ein <translation-key id="Hostname">Hostname</translation-key> pro Zeile. Wenn ein <translation-key id="Hostname">Hostname</translation-key> erkannt wird (z. B. innerhalb des src-Attributs eines iframe), wird der Inhalt nicht blockiert.','Backend / Cloud Scan / AlertNo external resource found.'=>'Keine externe Ressource gefunden.','Backend / Content Blockers Settings / HintRemoves iframes, blocked content and all output of the <translation-key id="Shortcodes">Shortcodes</translation-key> of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> in feeds. Due technical limitations it is not possible to provide the click-to-load functionality in feeds.'=>'Entfernt Iframes, gesperrte Inhalte und alle Ausgaben der <translation-key id="Shortcodes">Shortcodes</translation-key> von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> in Feeds. Aufgrund technischer Einschränkungen ist es nicht möglich, die Click-to-Load-Funktionalität in Feeds bereitzustellen.','Backend / Cloud Scan / AlertWe found no suggestions.'=>'Wir haben keine Vorschläge gefunden.','Backend / Content Blockers Settings / HintPlease confirm that you want to reset all <translation-key id="Content-Blocker">Content Blocker</translation-key> settings. They will be reset to their default settings.'=>'Bitte bestätigen Sie, dass Sie alle <translation-key id="Content-Blocker">Content-Blocker</translation-key>-Einstellungen zurücksetzen möchten. Sie werden dann auf ihre Standardeinstellungen zurückgesetzt.','Backend / Cloud Scan / BreadcrumbScanning'=>'Scannen','Backend / Content Blockers Settings / HintEvery <translation-key id="Location">Location</translation-key> of a disabled <translation-key id="Content-Blocker">Content Blocker</translation-key> is added to the <translation-key id="Virtual-Hostnames-Exclusion-List">Virtual Hostnames Exclusion List</translation-key>. When a <translation-key id="Hostname">Hostname</translation-key> is recognized the content will not be blocked.'=>'Jede <translation-key id="Location">Adresse</translation-key> eines deaktivierten <translation-key id="Content-Blocker">Content-Blockers</translation-key> wird in die <translation-key id="Virtual-Hostnames-Exclusion-List">Virtuelle Hostnamen-Ausschlussliste</translation-key> aufgenommen. Wenn ein <translation-key id="Hostname">Hostname</translation-key> erkannt wird, wird der Inhalt nicht gesperrt.','Backend / Cloud Scan / BreadcrumbScan results'=>'Scan-Ergebnisse','Backend / Content Blockers Settings / Things to know / HeadlineWhat is a <translation-key id="Hostname">Hostname</translation-key>?'=>'Was ist ein <translation-key id="Hostname">Hostname</translation-key>?','Backend / Cloud Scan / FieldCloud Scan ID'=>'Cloud-Scan-ID','Backend / Content Blockers Settings / Things to know / TextThe <translation-key id="Hostname">Hostname</translation-key> is the domain name of the website. For example, if the URL of the website is <strong><em>https://www.example.com</em></strong>, the <translation-key id="Hostname">Hostname</translation-key> is <strong><em>www.example.com</em></strong>.'=>'Der <translation-key id="Hostname">Hostname</translation-key> ist der Domain-Name der Website. Wenn die URL der Website zum Beispiel <strong><em>https://www.example.com</em></strong> ist, lautet der <translation-key id="Hostname">Hostname</translation-key> <strong><em>www.example.com</em></strong>.','Backend / Cloud Scan / FieldCreated at'=>'Erstellt am','Backend / Dashboard / Alert MessageNo data available yet. Please try again in a few hours.'=>'Es sind noch keine Daten verfügbar. Bitte versuchen Sie es in ein paar Stunden erneut.','Backend / Cloud Scan / FieldType'=>'Typ','Backend / Dashboard / BreadcrumbDashboard'=>'Dashboard','Backend / Cloud Scan / FieldURLs'=>'URLs','Backend / Dashboard / Button Title7 Days'=>'7 Tage','Backend / Cloud Scan / HeadlineCookies'=>'Cookies','Backend / Dashboard / Button Title30 Days'=>'30 Tage','Backend / Cloud Scan / HeadlineExternal resources'=>'Externe Ressourcen','Backend / Dashboard / Button TitleToday'=>'Heute','Backend / Cloud Scan / HeadlineScanned pages'=>'Gescannte Seiten','Backend / Dashboard / Button Title30 Days by Service'=>'30 Tage nach Service','Backend / Cloud Scan / HeadlineScan results'=>'Scan-Ergebnisse','Backend / Dashboard / Button TitleNo, I do not want to help'=>'Nein, ich möchte nicht helfen','Backend / Cloud Scan / HeadlineSuggested Packages Already Installed'=>'Vorgeschlagene Pakete bereits installiert','Backend / Dashboard / Button Title<span class="brlbs-cmpnt-heart-icon"></span><span>Yes, I would like to help</span>'=>'<span class="brlbs-cmpnt-heart-icon"></span><span>Ja, ich möchte helfen</span>','Backend / Cloud Scan / HeadlineSuggested Packages to Install'=>'Empfohlene Pakete zum Installieren','Backend / Dashboard / FieldAutomatic Update'=>'Automatische Aktualisierung','Backend / Cloud Scan / HeadlineSuggestions'=>'Vorschläge','Backend / Dashboard / FieldEnable Debug Logging'=>'Debug Logging einschalten','Backend / Cloud Scan / Table<translation-key id="External-hostname">External hostname</translation-key>'=>'<translation-key id="External-hostname">Externer Hostname</translation-key>','Backend / Dashboard / FieldImprove Borlabs Cookie'=>'Borlabs Cookie verbessern','Backend / Cloud Scan / Table<translation-key id="Failure-type">Failure type</translation-key>'=>'<translation-key id="Failure-type">Fehlertyp</translation-key>','Backend / Dashboard / HeadlineAcknowledgement'=>'Danksagung','Backend / Cloud Scan / TableHostname'=>'Hostname','Backend / Dashboard / HeadlineContributors'=>'Mitwirkende','Backend / Cloud Scan / TableLifetime'=>'Lebensdauer','Backend / Dashboard / Headline<span>Statistics</span> <small>-</small> <small>Cookie Version {{ cookieVersion }}</small>'=>'<span>Statistik</span> <small>-</small> <small>Cookie-Version {{ cookieVersion }}</small>','Backend / Cloud Scan / TableName'=>'Name','Backend / Dashboard / HeadlineImprove Borlabs Cookie'=>'Borlabs Cookie verbessern','Backend / Cloud Scan / Table<translation-key id="Number-of-resources">Number of resources</translation-key>'=>'<translation-key id="Number-of-resources">Anzahl der Ressourcen</translation-key>','Backend / Dashboard / HeadlineNews'=>'News','Backend / Cloud Scan / TableFound on page'=>'Gefunden auf Seite','Backend / Dashboard / HeadlinePlugin Updates &amp; Debugging'=>'Plugin-Aktualisierungen &amp; Debugging','Backend / Cloud Scan / TablePath'=>'Pfad','Backend / Dashboard / HeadlineQuick Start'=>'Schnellstart','Backend / Cloud Scan / TableResource URL'=>'Ressourcen-URL','Backend / Dashboard / TextDevelopment &amp; Infrastructure'=>'Entwicklung &amp; Infrastruktur','Backend / Cloud Scan / TableStatus'=>'Status','Backend / Dashboard / TextFurther Contributors'=>'Weitere Mitwirkende','Backend / Cloud Scan / TableSuggested package'=>'Empfohlenes Paket','Backend / Dashboard / Texthere'=>'hier','Backend / Cloud Scan / TableURL'=>'URL','Backend / Dashboard / TextIn memory of Sergii Kovalenko.'=>'Zum Gedenken an Sergii Kovalenko.','Backend / Cloud Scan / Textdays'=>'Tage','Backend / Dashboard / TextHelp us improve <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> by providing us with non-personal information about your website.'=>'Helfen Sie uns, <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> zu verbessern, indem Sie uns nicht-personenbezogene Informationen über Ihre Website zur Verfügung stellen.','Backend / Cloud Scan / TextFailed'=>'Fehlgeschlagen','Backend / Dashboard / TextFor more information about what data we need and for what purpose, <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>click here</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'Für weitere Informationen darüber, welche Daten wir benötigen und zu welchem Zweck, <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>klicken Sie hier</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Cloud Scan / TextSuccess'=>'Erfolgreich','Backend / Dashboard / TextThe dialog should now appear on your website. Open your website in incognito/private mode for testing. If you have any questions, please visit our <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Knowledge Base</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.'=>'Der Dialog sollte nun auf Ihrer Website erscheinen. Öffnen Sie Ihre Website zum Testen im Inkognito/Privatmodus. Wenn Sie Fragen haben, besuchen Sie bitte unsere <a class="brlbs-cmpnt-link brlbs-cmpnt-link-with-icon" href="%s" rel="nofollow noreferrer" target="_blank"><span>Wissensdatenbank</span><span class="brlbs-cmpnt-external-link-icon"></span></a>.','Backend / Cloud Scan / TextScan in progress'=>'Scanvorgang läuft','Backend / Dashboard / TextPlease disable your caching plugin if it is currently enabled. Once you have completed the setup of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>, you may re-enable it.'=>'Bitte deaktivieren Sie Ihr Caching-Plugin, falls es derzeit aktiviert ist. Sobald Sie das Setup von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> abgeschlossen haben, können Sie es wieder aktivieren.','Backend / Cloud Scan / TextScan is analysing'=>'Der Scan wird analysiert','Backend / Dashboard / TextUpdate the default provider data under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-provider"><translation-key id="Navigation-Consent-Management-Providers">Providers</translation-key></a> &raquo; <translation-key id="Owner-of-this-website">Owner of this website</translation-key>. Please update the data by adding your name and address, and ensure to include the URL for the <translation-key id="Privacy-Url">Privacy URL</translation-key>.'=>'Aktualisieren Sie die Standard Provider-Daten unter <translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-provider"><translation-key id="Navigation-Consent-Management-Providers">Provider</translation-key></a> &raquo; <translation-key id="Owner-of-this-website">Eigentümer dieser Website</translation-key>. Bitte aktualisieren Sie die Daten, indem Sie Ihren Namen und Ihre Adresse hinzufügen, und achten Sie darauf, die URL für die <translation-key id="Privacy-Url">Datenschutz-URL</translation-key> anzugeben.','Backend / Cloud Scan / TextScanning'=>'Scannen','Backend / Dashboard / TextClick on <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key></a> and select your <translation-key id="Privacy-Page">Privacy Page</translation-key> and <translation-key id="Imprint-Page">Imprint Page</translation-key>. Add both pages to <translation-key id="Hide-Dialog-on-Pages">Hide Dialog on Pages</translation-key> too.'=>'Klicken Sie auf <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Einstellungen</translation-key></a> und wählen Sie Ihre <translation-key id="Privacy-Page">Datenschutz-Seite</translation-key> und <translation-key id="Imprint-Page">Impressum-Seite</translation-key>. Fügen Sie beide Seiten auch zu <translation-key id="Hide-Dialog-on-Pages">Dialog auf Seiten ausblenden</translation-key>.','Backend / Cloud Scan / TextSession'=>'Session / Sitzungsende','Backend / Dashboard / TextEnable <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> under <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-settings"><translation-key id="Navigation-Settings">Settings</translation-key></a> &raquo; <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie Status</translation-key>.'=>'Aktivieren Sie <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> unter <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-settings"><translation-key id="Navigation-Settings">Einstellungen</translation-key></a> &raquo; <translation-key id="Borlabs-Cookie-Status">Borlabs Cookie-Status</translation-key>.','Backend / Cloud Scan / AlertThe scanner\'s analysis can make suggestions for installing packages that prevent the inclusion of external resources or improve compatibility between the theme and installed plugins.'=>'Die Analyse des Scanners kann Vorschläge zum Installieren von Paketen machen, die die Einbindung externer Ressourcen verhindern oder die Kompatibilität zwischen dem Theme und den installierten Plugins verbessern.','Backend / Dashboard / TextUse our scanner to check which cookies are set on your website and which services are used. Click on <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-cloud-scan"><translation-key id="Navigation-Scanner">Scanner</translation-key></a> &raquo; <translation-key id="Button-Add-New">Add New</translation-key> &raquo; <translation-key id="Button-Create-Scan">Create scan</translation-key> to add a new scan job. The <translation-key id="Scan-type">Scan type</translation-key> should be set to <translation-key id="Setup">Setup</translation-key>. '=>'Nutzen Sie unseren Scanner, um zu überprüfen, welche Cookies auf Ihrer Website gesetzt sind und welche Services genutzt werden. Klicken Sie auf <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-cloud-scan"><translation-key id="Navigation-Scanner">Scanner</translation-key></a> &raquo; <translation-key id="Button-Add-New">Neu hinzufügen</translation-key> &raquo; <translation-key id="Button-Create-Scan">Scan erstellen</translation-key>, um einen neuen Scanauftrag hinzuzufügen. Der <translation-key id="Scan-type">Scan-Typ</translation-key> sollte auf <translation-key id="Setup">Setup</translation-key> gesetzt werden. ','Backend / Cloud Scan / AlertClick on the <translation-key id="Button-Details">Details</translation-key> button to get more information about the package. Once the package is installed, you will be redirected back to this page to proceed with the installation of the next package.'=>'Klicken Sie auf den Button <translation-key id="Button-Details">Details</translation-key>, um weitere Informationen über das Paket zu erhalten. Sobald das Paket installiert ist, werden Sie wieder auf diese Seite weitergeleitet, um mit der Installation des nächsten Pakets fortzufahren.','Backend / Dashboard / TextAfter you have used the scanner and installed suggested packages, create a new scan job and set <translation-key id="Scan-type">Scan type</translation-key> to <translation-key id="Audit">Audit</translation-key>. This scan type is used to verify that your website does not load cookies or external resources without obtaining the appropriate consent.'=>'Nachdem Sie den Scanner verwendet und die vorgeschlagenen Pakete installiert haben, erstellen Sie einen neuen Scan-Auftrag und setzen den <translation-key id="Scan-type">Scan-Typ</translation-key> auf <translation-key id="Audit">Audit</translation-key>. Dieser Scan-Typ wird verwendet, um zu überprüfen, dass Ihre Website keine Cookies oder externen Ressourcen lädt, ohne die entsprechende Einwilligung eingeholt zu haben.','Backend / Cloud Scan / TipTo comply with data protection, cookies must be blocked in most cases until consent is given. Only essential cookies may be set without consent. An essential cookie could be one that, for instance, stores the shopping cart contents or the selected language.'=>'Aus Gründen des Datenschutzes müssen Cookies in den meisten Fällen gesperrt werden, bis eine Einwilligung erteilt wird. Nur essenzielle Cookies dürfen ohne Einwilligung gesetzt werden. Ein essenzielles Cookie kann z. B. der Inhalt des Warenkorbs oder die gewählte Sprache sein.','Backend / Dashboard / TextExplore our <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-library"><translation-key id="Navigation-Library">Library</translation-key></a> to have an overview of all our available packages. Here you can find templates for <translation-key id="Services">Services</translation-key> (e.g. Google Analytics) or <translation-key id="Content-Blockers">Content Blockers</translation-key> (e.g. YouTube) and much more.'=>'Erkunden Sie unsere <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-library"><translation-key id="Navigation-Library">Bibliothek</translation-key></a> um einen Überblick über alle unsere verfügbaren Pakete zu erhalten. Hier finden Sie Vorlagen für <translation-key id="Services">Services</translation-key> (z. B. Google Analytics) oder <translation-key id="Content-Blockers">Content-Blocker</translation-key> (z. B. YouTube) und vieles mehr.','Backend / Cloud Scan / TipClick the icon to view sample locations associated with the detected cookie.'=>'Klicken Sie auf das Symbol, um die mit dem erkannten Cookie verknüpften Adressen anzuzeigen.','Backend / Dashboard / TextIf you place ads on your website, you may need to enable the IAB TCF under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-settings"><translation-key id="Navigation-Consent-Management-IAB-TCF-Settings">Settings</translation-key></a> &raquo; <translation-key id="IAB-TCF-Status">IAB TCF Status</translation-key>. And then configure vendors under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-vendor"><translation-key id="Navigation-Consent-Management-IAB-TCF-Manage-Vendors">Manage Vendors</translation-key></a> &raquo; <translation-key id="Configure-Vendors">Configure Vendors</translation-key>.'=>'Wenn Sie Anzeigen auf Ihrer Website schalten, müssen Sie möglicherweise die IAB TCF unter <translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-settings"><translation-key id="Navigation-Consent-Management-IAB-TCF-Settings">Einstellungen</translation-key></a> &raquo; <translation-key id="IAB-TCF-Status">IAB TCF-Status</translation-key> aktivieren. Und dann konfigurieren Sie die Vendoren unter <translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-IAB-TCF">IAB TCF</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-iab-tcf-vendor"><translation-key id="Navigation-Consent-Management-IAB-TCF-Manage-Vendors">Vendoren verwalten</translation-key></a> &raquo; <translation-key id="Configure-Vendors">Vendoren konfigurieren</translation-key>.','Backend / Cloud Scan / Tip<translation-key id="Suggested-package">Suggested package</translation-key>: This column lists a recommended package to install to block the cookie if the cookie is not essential.'=>'<translation-key id="Suggested-package">Empfohlenes Paket</translation-key>: In dieser Spalte wird ein empfohlenes Paket zum Installieren aufgelistet, um das Cookie zu blockieren, wenn das Cookie nicht essenziell ist.','Backend / Dashboard / TextYou can customize the dialog texts under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-localization"><translation-key id="Navigation-Dialog-Widget-Dialog-Localization">Localization</translation-key></a>. The visual appearance (colors, spacing, etc.) can be customized under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-appearance"><translation-key id="Navigation-Dialog-Widget-Dialog-Appearance">Appearance</translation-key></a>. Everything else like layout, position, buttons, etc. you can define under <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Settings</translation-key></a>.'=>'Sie können die Dialogtexte unter <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-localization"><translation-key id="Navigation-Dialog-Widget-Dialog-Localization">Lokalisierung</translation-key></a> anpassen. Das Erscheinungsbild (Farben, Abstände usw.) kann unter <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-appearance"><translation-key id="Navigation-Dialog-Widget-Dialog-Appearance">Erscheinungsbild</translation-key></a> angepasst werden. Alles andere wie Layout, Position, Buttons, etc. können Sie unter <translation-key id="Navigation-Dialog-Widget">Dialog &amp; Widget</translation-key> &raquo; <translation-key id="Navigation-Dialog-Widget-Dialog">Dialog</translation-key> &raquo; <a class="brlbs-cmpnt-link" href="?page=borlabs-cookie-dialog-settings"><translation-key id="Navigation-Dialog-Widget-Dialog-Settings">Einstellungen</translation-key></a> festlegen.','Backend / Cloud Scan / TipCookies'=>'Cookies','Backend / Dashboard / TextThank you!'=>'Vielen Dank!','Backend / Cloud Scan / TipExternal resources'=>'Externe Ressourcen','Backend / Dashboard / URLhttps://borlabs.io/borlabs-cookie/telemetry/'=>'https://borlabs.io/borlabs-cookie/telemetry/','Backend / Cloud Scan / TipStatus'=>'Status','Backend / Dashboard / URLhttps://borlabs.io/support/?utm_source=Borlabs+Cookie&utm_medium=Dashboard+Link&utm_campaign=Analysis'=>'https://borlabs.io/support/?utm_source=Borlabs+Cookie&utm_medium=Dashboard+Link&utm_campaign=Analysis','Backend / Cloud Scan / TipExternal resources are resources that are loaded from a different domain than the page itself. For example, if you have a page with the URL <strong><em>https://www.example.com</em></strong> and this page loads a resource from <strong><em>https://www.example.org</em></strong>, then this resource is considered an external resource. To comply with data protection, in most cases, these external resources must be blocked until consent is given.'=>'Externe Ressourcen sind Ressourcen, die von einer anderen Domain geladen werden als die Seite selbst. Wenn Sie zum Beispiel eine Seite mit der URL <strong><em>https://www.example.com</em></strong> haben und diese Seite eine Ressource von <strong><em>https://www.example.org</em></strong> lädt, dann wird diese Ressource als externe Ressource betrachtet. Zur Einhaltung des Datenschutzes müssen diese externen Ressourcen in den meisten Fällen gesperrt werden, bis eine Einwilligung vorliegt.','Seeder / Default Content Blocker / DescriptionThe <strong><em>Default</em> Content Blocker</strong> is a special type that is always used when no specific <strong>Content Blocker</strong> was found.<br>Therefore it is not possible to use the <strong>Unblock all</strong> feature.'=>'Der <strong><em>Standard</em> Content-Blocker</strong> ist ein spezieller Typ, der immer dann verwendet wird, wenn kein spezifischer <strong>Content-Blocker</strong> gefunden wurde.<br>Daher ist es nicht möglich, die Funktion <strong>"Alle entsperren"</strong> zu verwenden.','Backend / Cloud Scan / TipClick on the icon to get detailed information about the external resource. In the details you can find examples of discovered resources and their respective locations.'=>'Klicken Sie auf das Symbol, um detaillierte Informationen über die externe Ressource zu erhalten. In den Details finden Sie Beispiele für gefundene Ressourcen und ihre jeweiligen Adressen.','Backend / Cloud Scan / Tip<translation-key id="External-hostname">External hostname</translation-key>: Resources are being loaded from this source.'=>'<translation-key id="External-hostname">Externer Hostname</translation-key>: Die Ressourcen werden von dieser Quelle geladen.','Backend / Cloud Scan / Tip<translation-key id="Number-of-resources">Number of resources</translation-key>: The number of resources loaded from this source. The resources found are limited to 10 per hostname.'=>'<translation-key id="Number-of-resources">Anzahl der Ressourcen</translation-key>: Die Anzahl der Ressourcen, die von dieser Quelle geladen wurden. Die Anzahl der gefundenen Ressourcen ist auf 10 pro Hostname begrenzt.','Backend / Cloud Scan / Tip<translation-key id="Suggested-package">Suggested package</translation-key>: This column lists a recommended package to install to block the external resource.'=>'<translation-key id="Suggested-package">Empfohlenes Paket</translation-key>: In dieser Spalte wird ein empfohlenes Paket zur Installation aufgeführt, um die externe Ressource zu blockieren.','Backend / Cloud Scan / TipFailed: The scanner could not scan the page. More information can be found in the <translation-key id="Failure-type">Failure type</translation-key> column.'=>'Fehlgeschlagen: Der Scanner konnte die Seite nicht scannen. Weitere Informationen finden Sie in der Spalte <translation-key id="Failure-type">Fehlertyp</translation-key>.','Backend / Cloud Scan / TipSuccess: The page was scanned successfully.'=>'Erfolg: Die Seite wurde erfolgreich gescannt.','Backend / Cloud Scan / TipScanning: The page is being scanned.'=>'Scannen: Die Seite wird gerade gescannt.','Backend / Cloud Scan / AlertNo <translation-key id="Scans">Scans</translation-key> configured.'=>'Keine <translation-key id="Scans">Scans</translation-key> konfiguriert.','Backend / Cloud Scan / HeadlineScanner'=>'Scanner','Backend / Cloud Scan / TableCloud Scan ID'=>'Cloud-Scan-ID','Backend / Cloud Scan / TableCreated at'=>'Erstellt am','Backend / Cloud Scan / TableScanned pages'=>'Gescannte Seiten','Backend / Cloud Scan / TableType'=>'Typ','Backend / Cloud Scan / Things to know / TextThe scanner will help you set up <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> that will help you make your website privacy compliant. Two scan options are available for this purpose.'