">Kompatibilitäts-Patches</translation-key>','Backend / Compatibility Patches / PlaceholderSearch key or file name...'=>'Key oder Dateiname suchen...','Backend / Compatibility Patches / Table HeadlinePackage'=>'Paket','Backend / Compatibility Patches / Table HeadlineFile name'=>'Dateiname ','Backend / Compatibility Patches / Table HeadlineHash'=>'Hash','Backend / Compatibility Patches / Table HeadlineID'=>'ID','Backend / Compatibility Patches / Table HeadlineValid'=>'Valide','Backend / Compatibility Patches / Things to knowClick on the icon to get detailed information about the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key>.'=>'Klicken Sie auf das Symbol, um detaillierte Informationen über den <translation-key id="Compatibility-Patch">Kompatibilitäts-Patch</translation-key> zu erhalten.','Backend / Compatibility Patches / Things to know / HeadlineWhat is the purpose of the <translation-key id="Compatibility-Patches">Compatibility Patches</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Compatibility-Patches">Kompatibilitäts-Patches</translation-key>?','Backend / Compatibility Patches / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Compatibility Patches / Things to knowThe file of the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is invalid. Please reinstall the package via the <translation-key id="Navigation-Library">Library</translation-key> to resolve this issue.'=>'Die Datei des <translation-key id="Compatibility-Patch">Kompatibilitäts-Patches</translation-key> ist ungültig. Bitte installieren Sie das Paket über die <translation-key id="Navigation-Library">Bibliothek</translation-key> neu, um dieses Problem zu beheben.','Backend / Compatibility Patches / Things to knowIn this section, you can see all <translation-key id="Compatibility-Patches">Compatibility Patches</translation-key> that have been installed by packages from the <translation-key id="Navigation-Library">Library</translation-key>.'=>'In diesem Bereich sehen Sie alle <translation-key id="Compatibility-Patches">Kompatibilitäts-Patches</translation-key>, die von Paketen aus der <translation-key id="Navigation-Library">Bibliothek</translation-key> installiert wurden.','Backend / Compatibility Patches / Things to knowA <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is used to enhance compatibility with other <translation-key id="Plugins">Plugins</translation-key>, <translation-key id="Themes">Themes</translation-key> external services.'=>'Ein <translation-key id="Compatibility-Patch">Kompatibilitäts-Patch</translation-key> wird verwendet, um die Kompatibilität mit anderen <translation-key id="Plugins">Plugins</translation-key>, <translation-key id="Themes">Themes</translation-key> und externen Services zu verbessern.','Backend / Compatibility Patches / Things to knowThe file of the <translation-key id="Compatibility-Patch">Compatibility Patch</translation-key> is valid.'=>'Die Datei des <translation-key id="Compatibility-Patch">Kompatibilitäts-Patches</translation-key> ist gültig.','Backend / Consent Log / Alert MessageThe <translation-key id="Consent-Log">Consent Log</translation-key> could not be found.'=>'Das <translation-key id="Consent-Log">Einwilligungs-Log</translation-key> konnte nicht gefunden werden.','Backend / Consent Log / Breadcrumb<translation-key id="Consent-Logs">Consent Logs</translation-key>'=>'<translation-key id="Consent-Logs">Einwilligungs-Logs</translation-key>','Backend / Consent Log / BreadcrumbDetails'=>'Details','Backend / Consent Log / FieldConsents'=>'Einwilligungen','Backend / Consent Log / FieldCookie Version'=>'Cookie Version','Backend / Consent Log / LabelIAB TCF TC String'=>'IAB TCF TC String','Backend / Consent Log / LabelIs Latest Consent'=>'Ist aktuellste Einwilligung','Backend / Consent Log / LabelUID'=>'UID','Backend / Consent Log / HintA version number is assigned to the cookie of <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. It is used to ask the visitor for consent again when changes are made to the cookies. If the version number in the cookie differs from the current version number, the consent dialog appears to the visitor.'=>'Dem Cookie von <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> wird eine Versionsnummer zugewiesen. Sie wird verwendet, um den Besucher bei Änderungen an den Cookies erneut um seine Einwilligung zu bitten. Wenn die Versionsnummer im Cookie von der aktuellen Versionsnummer abweicht, wird dem Besucher der Dialog zur Einwilligung angezeigt.','Backend / Consent Log / HintThe <translation-key id="TC-String">TC String</translation-key> is an encoded depiction of user consent choices, generated through interactions with <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>. It informs publishers, advertisers, and ad tech vendors of the permitted uses of user data, based on users\' consent decisions.'=>'Der <translation-key id="TC-String">TC String</translation-key> ist eine kodierte Darstellung der Einwilligungsentscheidungen der Nutzer, die durch Interaktionen mit <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> generiert werden. Er informiert Publisher, Werbetreibende und Vendoren über die erlaubte Nutzung von Nutzerdaten, basierend auf den Einwilligungen der Nutzer.','Backend / Consent Log / HintThe <translation-key id="UID">UID</translation-key> is a unique identifier of the user, generated through interactions with <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key>.'=>'Die <translation-key id="UID">UID</translation-key> ist eine eindeutige Kennung des Benutzers, die durch Interaktionen mit <translation-key id="Borlabs-Cookie">Borlabs Cookie</translation-key> erzeugt wird.','Backend / Consent Log / Alert MessageNo <translation-key id="Consent-Logs">Consent Logs</translation-key> stored.'=>'Es werden keine <translation-key id="Consent-Logs">Einwilligungs-Logs</translation-key> gespeichert.','Backend / Consent Log / Headline<translation-key id="Consent-Logs">Consent Logs</translation-key>'=>'<translation-key id="Consent-Logs">Einwilligungs-Logs</translation-key>','Backend / Consent Log / PlaceholderSearch UID...'=>'UID suchen...','Backend / Consent Log / Table HeadlineCookie Version'=>'Cookie Version','Backend / Consent Log / Table Headline<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>'=>'<translation-key id="IAB-TCF-Consent">IAB TCF-Einwilligung</translation-key>','Backend / Consent Log / Table HeadlineService Consents'=>'Service-Einwilligungen','Backend / Consent Log / Table HeadlineStamp'=>'Datum und Uhrzeit','Backend / Consent Log / Table HeadlineUID'=>'UID','Backend / Consent Log / Things to know / HeadlineClick on the icon to view details of the user\'s consents.'=>'Klicken Sie auf das Symbol, um Details zu den Einwilligungen des Nutzers anzuzeigen.','Backend / Consent Log / Things to know / TextThe <translation-key id="Consent-Logs">Consent Logs</translation-key> show you the history of the user\'s consents. You can see which services the user has consented to and which not.'=>'Die <translation-key id="Consent-Logs">Einwilligungs-Logs</translation-key> zeigen Ihnen die Historie der Einwilligungen des Nutzers. Sie können sehen, welchen Services der Nutzer eingewilligt hat und welchen nicht.','Backend / Consent Log / Things to know / TextDue to the volume of consent logs that can be accumulated, only consent logs from the past 7 days are displayed here. However, you can access older log entries by inputting the UID into the search field.'=>'Aufgrund der Menge der Einwilligungs-Logs, die sich ansammeln können, werden hier nur die Einwilligungs-Logs der letzten 7 Tage angezeigt. Sie können jedoch auf ältere Log-Einträge zugreifen, indem Sie die UID in das Suchfeld eingeben.','Backend / Consent Log / Things to know / HeadlineWhat are Consent Logs?'=>'Was sind Einwilligungs-Logs?','Backend / Consent Log / Things to know / HeadlineSymbols explained'=>'Symbole erklärt','Backend / Consent Log / Things to know / Text<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>: The last consent has granted consent to the <translation-key id="IAB-TCF-Vendors">Vendors</translation-key> of the IAB TCF.'=>'<translation-key id="IAB-TCF-Consent">IAB TCF-Einwilligung</translation-key>: Mit der letzten Einwilligung haben die <translation-key id="IAB-TCF-Vendors">Vendoren</translation-key> der IAB TCF ihre Einwilligung erteilt.','Backend / Consent Log / Things to know / Text<translation-key id="IAB-TCF-Consent">IAB TCF Consent</translation-key>: The last consent did not granted consent to the <translation-key id="IAB-TCF-Vendors">Vendors</translation-key> of the IAB TCF.'=>'<translation-key id="IAB-TCF-Consent">IAB TCF-Einwilligung</translation-key>: Die letzte Einwilligung wurde den <translation-key id="IAB-TCF-Vendors">Vendoren</translation-key> der IAB TCF nicht erteilt.','Backend / Content Blockers Appearance / BreadcrumbContent Blocker - Appearance'=>'Content-Blocker - Erscheinungsbild','Backend / Content Blockers Appearance / Label<translation-key id="Background-Color">Background Color</translation-key>'=>'<translation-key id="Background-Color">Hintergrundfarbe</translation-key>','Backend / Content Blockers Appearance / LabelBorder Radius'=>'Rahmenradius (border-radius)','Backend / Content Blockers Appearance / LabelBottom Left'=>'Unten links','Backend / Content Blockers Appearance / LabelBottom Right'=>'Unten rechts','Backend / Content Blockers Appearance / LabelButton'=>'Button','Backend / Dialog Appearance / LabelButton Border Radius'=>'Button-Rahmenradius (border-radius)','Backend / Content Blockers Appearance / LabelButton Color'=>'Button-Farbe','Backend / Content Blockers Appearance / LabelButton Text Color'=>'Button-Textfarbe','Backend / Cont