translation-key id="Content-Blockers">Content Blockers</translation-key> settings. They will be reset to their default settings.'=>'Bitte bestätigen Sie, dass Sie alle <translation-key id="Content-Blockers">Content-Blocker</translation-key>-Einstellungen zurücksetzen möchten. Sie werden dann auf ihre Standardeinstellungen zurückgesetzt.','Backend / Content Blockers Appearance / Input PlaceholderEnter custom font family'=>'Benutzerdefinierte Schriftart (font-family) eingeben','Backend / Content Blockers Appearance / Things to know / Headline<translation-key id="Content-Blocker">Content Blocker</translation-key> Individual Settings'=>'<translation-key id="Content-Blocker">Content-Blocker</translation-key> Individuelle Einstellungen','Backend / Content Blockers Appearance / Things to know / TextPlease note that the settings for <translation-key id="Button-Radius">Button Radius</translation-key>, <translation-key id="Button-Color">Button Color</translation-key>, and <translation-key id="Button-Text-Color">Button Text Color</translation-key> are often overwritten with the individual settings of a <translation-key id="Content-Blocker">Content Blocker</translation-key>.'=>'Bitte beachten Sie, dass die Einstellungen für <translation-key id="Button-Radius">Button-Radius</translation-key>, <translation-key id="Button-Color">Button-Farbe</translation-key> und <translation-key id="Button-Text-Color">Button-Textfarbe</translation-key> oft mit den individuellen Einstellungen eines <translation-key id="Content-Blocker">Content-Blockers</translation-key> überschrieben werden.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Content-Blocker">Content Blocker</translation-key> is not available in the current language.'=>'Der ausgewählte <translation-key id="Content-Blocker">Content-Blocker</translation-key> ist in der aktuellen Sprache nicht verfügbar.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> does not match the <translation-key id="Provider">Provider</translation-key> of the <translation-key id="Service">Service</translation-key>.'=>'Der ausgewählte <translation-key id="Provider">Provider</translation-key> stimmt nicht mit dem <translation-key id="Provider">Provider</translation-key> des <translation-key id="Service">Services</translation-key> überein.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> is not available in the current language.'=>'Der ausgewählte <translation-key id="Provider">Provider</translation-key> ist in der aktuellen Sprache nicht verfügbar.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Provider">Provider</translation-key> does not exist.'=>'Der ausgewählte <translation-key id="Provider">Provider</translation-key> existiert nicht.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Service">Service</translation-key> does not exist.'=>'Der ausgewählte <translation-key id="Service">Service</translation-key> existiert nicht.','Backend / Content Blockers / Alert MessageThe selected <translation-key id="Service">Service</translation-key> is not available in the current language.'=>'Der ausgewählte <translation-key id="Service">Service</translation-key> ist in der aktuellen Sprache nicht verfügbar.','Backend / Content Blockers / BreadcrumbEdit: {{ name }}'=>'Bearbeiten: {{ name }}','Backend / Content Blockers / BreadcrumbContent Blockers'=>'Content-Blocker','Backend / Content Blockers / BreadcrumbNew'=>'Neu','Backend / Content Blockers / Button TitleApply Preset'=>'Voreinstellung anwenden','Backend / Content Blockers / Button TitleSelect or Upload Image'=>'Bild auswählen oder hochladen','Backend / Content Blockers / Button TitleUse this media'=>'Dieses Medium verwenden','Backend / Content Blockers / LabelHost(s)'=>'Host(s)','Backend / Content Blockers / Label<translation-key id="Global">Global</translation-key>'=>'<translation-key id="Global">Global</translation-key>','Backend / Content Blockers / LabelID'=>'ID','Backend / Content Blockers / LabelName'=>'Name','Backend / Content Blockers / LabelPreset'=>'Voreinstellung','Backend / Content Blockers / Label<translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key>'=>'<translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key>','Backend / Content Blockers / Label<translation-key id="Preview-Blocked-Content-Image">Image</translation-key>'=>'<translation-key id="Preview-Blocked-Content-Image">Bild</translation-key>','Backend / Content Blockers / LabelProvider List'=>'Provider-Liste','Backend / Content Blockers / LabelService'=>'Service','Backend / Content Blockers / Label<translation-key id="Shortcode">Shortcode</translation-key>'=>'<translation-key id="Shortcode">Shortcode</translation-key>','Backend / Content Blockers / LabelStatus'=>'Status','Backend / Content Blockers / HeadlineAdditional Settings'=>'Zusätzliche Einstellungen','Backend / Content Blockers / HeadlineContent Blocker Information'=>'Content-Blocker-Informationen','Backend / Content Blockers / HeadlineContent Blocker Settings'=>'Content-Blocker-Einstellungen','Backend / Content Blockers / HeadlineJavaScript'=>'JavaScript','Backend / Content Blockers / Headline<translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key>'=>'<translation-key id="Preview-Blocked-Content">Vorschau gesperrter Inhalte</translation-key>','Backend / Content Blockers / HeadlineProvider Information'=>'Provider-Informationen','Backend / Content Blockers / HeadlineService Information'=>'Service-Informationen','Backend / Content Blockers / HintOnly use JavaScript, do not use <strong><em>&lt;script&gt;</em></strong> tags!'=>'Verwenden Sie nur JavaScript und keine <strong><em>&lt;script&gt;</em></strong>-Tags!','Backend / Content Blockers / Hint<translation-key id="ID">ID</translation-key> must be set. The <translation-key id="ID">ID</translation-key> must be at least 3 characters long and may only contain: <strong><em>a-z - _</em></strong>'=>'<translation-key id="ID">ID</translation-key> muss festgelegt werden. Die <translation-key id="ID">ID</translation-key> muss mindestens 3 Zeichen lang sein und darf nur enthalten: <strong><em>a-z - _</em></strong>','Backend / Content Blockers / HintThe name of the <translation-key id="Content-Blocker">Content Blocker</translation-key> which can be used within the <translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> code by using the variable <strong><em>{{ name }}</em></strong>.'=>'Der Name des <translation-key id="Content-Blocker">Content-Blockers</translation-key>, der in der <translation-key id="Preview-Blocked-Content">Vorschau gesperrter Inhalte</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> Code durch Verwendung der Variable <strong><em>{{ name }}</em></strong> verwendet werden kann.','Backend / Content Blockers / HintThis CSS will be used for the preview of the blocked content.'=>'Dieses CSS wird für die Vorschau des gesperrten Inhalts verwendet.','Backend / Content Blockers / HintThis HTML will be used as the preview of the blocked content. You can use the following variables within the HTML code: <strong><em>{{ name }}</em></strong> to place the name of the <translation-key id="Content-Blocker">Content Blocker</translation-key> and <strong><em>{{ previewImage }}</em></strong> to place the URL of the <translation-key id="Preview-Blocked-Content-Image">Image</translation-key>.'=>'Dieser HTML-Code wird als Vorschau für den blockierten Inhalt verwendet. Sie können die folgenden Variablen innerhalb des HTML-Codes verwenden: <strong><em>{{ name }}</em></strong> um den Namen des <translation-key id="Content-Blocker">Content-Blockers</translation-key> zu platzieren und <strong><em>{{ previewImage }}</em></strong> um die URL des <translation-key id="Preview-Blocked-Content-Image">Bildes</translation-key> zu platzieren.','Backend / Content Blockers / HintThis image is used as a preview for the blocked content (only with <translation-key id="Preset-B">Preset B</translation-key> and <translation-key id="Preset-C">Preset C</translation-key>). The URL of the image can be accessed within the <translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> with the <strong><em>{{ previewImage }}</em></strong> variable.'=>'Dieses Bild wird als Vorschau für den gesperrten Inhalt verwendet (nur bei <translation-key id="Preset-B">Voreinstellung B</translation-key> und <translation-key id="Preset-C">Voreinstellung C</translation-key>). Die URL des Bildes kann in der <translation-key id="Preview-Blocked-Content">Vorschau gesperrter Inhalte</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> mit der <strong><em>{{ previewImage }}</em></strong> Variable aufgerufen werden.','Backend / Content Blockers / HintUse this <translation-key id="Shortcode">Shortcode</translation-key> if automatic detection does not work.'=>'Verwenden Sie diesen <translation-key id="Shortcode">Shortcode</translation-key>, wenn die automatische Erkennung nicht funktioniert.','Backend / Content Blockers / HintThe status of this <translation-key id="Content-Blocker">Content Blocker</translation-key>. If enabled it does block content (iframes) of the configured <translation-key id="Locations">Locations</translation-key>.'=>'Der Status dieses <translation-key id="Content-Blocker">Content-Blockers</translation-key>. Wenn er aktiviert ist, blockiert er Inhalte (iframes) der konfigurierten <translation-key id="Locations">Adressen</translation-key>.','Backend / Content Blockers / OptionNo Service'=>'Kein Service','Backend / Content Blockers / OptionPreset A - Default'=>'Voreinstellung A - Standard','Backend / Content Blockers / Option<translation-key id="Preset-B">Preset B</translation-key> - Default + Background Image'=>'<translation-key id="Preset-B">Voreinstellung B</translation-key> - Standard-Hintergrundbild','Backend / Content Blockers / Option<translation-key id="Preset-C">Preset C</translation-key> - Video Player'=>'<translation-key id="Preset-C">Voreinstellung C</translation-key> - Videoplayer','Backend / Content Blockers / Input Placeholder...block this...'=>'...dies blockieren...','Backend / Content Blockers / Things to know / TextThe code is executed in a function that uses the variable <strong><em>el</em></strong> as a parameter. <strong><em>el</em></strong> contains the unlocked object.'=>'Der Code wird in einer Funktion ausgeführt, die die Variable <strong><em>el</em></strong> als Parameter verwendet. <strong><em>el</em></strong> enthält das entsperrte Objekt.','Backend / Content Blockers / Things to know / Code Examplefunction (contentBlockerData, el) { /* Here is your initialization code */ }'=>'function (contentBlockerData, el) { /* Here is your initialization code */ }','Backend / Content Blockers / Things to know / HeadlineFor Developers'=>'Für Entwickler','Backend / Content Blockers / Things to know / HeadlineGlobal JavaScript'=>'Global-JavaScript','Backend / Content Blockers / Things to know / HeadlineInitialization JavaScript'=>'Initialisierung JavaScript','Backend / Content Blockers / Things to know / HeadlineWhat is the purpose of <translation-key id="Provider">Provider</translation-key> information?'=>'Wozu dienen die Informationen des <translation-key id="Provider">Providers</translation-key>?','Backend / Content Blockers / Things to know / HeadlineWhat is the purpose of <translation-key id="Service">Service</translation-key> information?'=>'Wozu dienen die Informationen des <translation-key id="Service">Services</translation-key>?','Backend / Content Blockers / Things to know / Headline<translation-key id="Shortcode">Shortcode</translation-key> explained'=>'<translation-key id="Shortcode">Shortcode</translation-key> erklärt','Backend / Content Blockers / Things to know / TextJavaScript stored in the <translation-key id="Global">Global</translation-key> field is executed once a blocked content is unblocked by the visitor (meaning only once per page). Use this, for example, to load an external JavaScript library.'=>'Das im Feld <translation-key id="Global">Global</translation-key> gespeicherte JavaScript wird ausgeführt, sobald ein gesperrter Inhalt vom Besucher entsperrt wird (also nur einmal pro Seite). Verwenden Sie dies zum Beispiel, um eine externe JavaScript-Bibliothek zu laden.','Backend / Content Blockers / Things to know / TextTo execute the JavaScript stored in the <translation-key id="Global">Global</translation-key> field before the blocked content is loaded, activate the option <translation-key id="Execute-Global-code-before-unblocking">Execute Global code before unblocking</translation-key>.'=>'Um das im Feld <translation-key id="Global">Global</translation-key> gespeicherte JavaScript auszuführen, bevor der gesperrte Inhalt geladen wird, aktivieren Sie die Option <translation-key id="Execute-Global-code-before-unblocking">Global-Code vor der Entsperrung ausführen</translation-key>.','Backend / Content Blockers / Things to know / TextIf this option is enabled and a visitor unblocks the content, the JavaScript from the <translation-key id="Global">Global</translation-key> field will be executed before the blocked content is loaded.'=>'Wenn diese Option aktiviert ist und ein Besucher den Inhalt entsperrt, wird das JavaScript aus dem Feld <translation-key id="Global">Global</translation-key> ausgeführt, bevor der gesperrte Inhalt geladen wird.','Backend / Content Blockers / Things to know / Code Examplefunction (contentBlockerData) { /* Here is your global code */ }'=>'function (contentBlockerData) { /* Here is your global code */ }','Backend / Content Blockers / Things to know / TextJavaScript stored in the <translation-key id="Initialization">Initialization</translation-key> field is executed with every unblock of blocked content (meaning as many times as the visitor unblocks content). It is executed after the JavaScript from the <translation-key id="Global">Global</translation-key> field.'=>'Das im Feld <translation-key id="Initialization">Initialisierung</translation-key> gespeicherte JavaScript wird bei jeder Freigabe eines gesperrten Inhalts ausgeführt (d. h. so oft, wie der Besucher den Inhalt entsperrt). Es wird nach dem JavaScript aus dem Feld <translation-key id="Global">Global</translation-key> ausgeführt.','Backend / Content Blockers / Things to know / TextFor legal compliance, every <translation-key id="Content-Blocker">Content Blocker</translation-key> must be linked to a specific <translation-key id="Provider">Provider</translation-key>.'=>'Aus Gründen der Rechtssicherheit muss jeder <translation-key id="Content-Blocker">Content-Blocker</translation-key> mit einem bestimmten <translation-key id="Provider">Provider</translation-key> verknüpft sein.','Backend / Content Blockers / Things to know / TextIn the <translation-key id="Provider">Provider</translation-key> section (found under <translation-key id="Navigation-Consent-Management">Consent Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Providers">Providers</translation-key>), you will find more information and also have the option to edit or create new <translation-key id="Provider">Provider</translation-key> entries.'=>'Im Bereich <translation-key id="Provider">Provider</translation-key> (zu finden unter <translation-key id="Navigation-Consent-Management">Consent-Management</translation-key> &raquo; <translation-key id="Navigation-Consent-Management-Providers">Provider</translation-key>), finden Sie weitere Informationen und haben auch die Möglichkeit, <translation-key id="Provider">Provider</translation-key>-Einträge zu bearbeiten oder neu zu erstellen.','Backend / Content Blockers / Things to know / TextIt\'s optional, but there are two good reasons why you should link a <translation-key id="Content-Blocker">Content Blocker</translation-key> to a specific <translation-key id="Service">Service</translation-key>.'=>'Es ist zwar optional, aber es gibt zwei gute Gründe, warum Sie einen <translation-key id="Content-Blocker">Content-Blocker</translation-key> mit einem bestimmten <translation-key id="Service">Service</translation-key> verknüpfen sollten.','Backend / Content Blockers / Things to know / TextLinking a <translation-key id="Content-Blocker">Content Blocker</translation-key> to a <translation-key id="Service">Service</translation-key> enables automatic unblocking of content for visitors upon granting consent to the  <translation-key id="Service">Service</translation-key> through the <translation-key id="Dialog">Dialog</translation-key>.'=>'Die Verknüpfung eines <translation-key id="Content-Blocker">Content-Blockers</translation-key> mit einem <translation-key id="Service">Service</translation-key> ermöglicht die automatische Entsperrung von Inhalten für Besucher, die dem <translation-key id="Service">Service</translation-key> über den <translation-key id="Dialog">Dialog</translation-key> eingewilligt haben.','Backend / Content Blockers / Things to know / TextYou can extend the information about the <translation-key id="Content-Blocker">Content Blocker</translation-key>, for example with cookie information, via the linked <translation-key id="Service">Service</translation-key>.'=>'Sie können die Informationen über den <translation-key id="Content-Blocker">Content-Blocker</translation-key>, z. B. mit Cookie-Informationen, über den verlinkten <translation-key id="Service">Service</translation-key> erweitern.','Backend / Content Blockers / Things to know / TextUse the <translation-key id="Shortcode">Shortcode</translation-key> to block content that is not automatically blocked. If contents use the oEmbed format, for example <strong>Pinterest</strong> links, use the <translation-key id="Shortcode">Shortcode</translation-key> to avoid display errors and block the content: {{ shortcode }}'=>'Verwenden Sie den <translation-key id="Shortcode">Shortcode</translation-key>, um Inhalte zu blockieren, die nicht automatisch gesperrt werden. Wenn Inhalte das oEmbed-Format verwenden, zum Beispiel <strong>Pinterest</strong>-Links, verwenden Sie den <translation-key id="Shortcode">Shortcode</translation-key>, um Anzeigefehler zu vermeiden und den Inhalt zu blockieren: {{ shortcode }}','Backend / Content Blockers / Things to know / TextThe <translation-key id="Shortcode">Shortcode</translation-key> is not available until the <translation-key id="Content-Blocker">Content Blocker</translation-key> is created.'=>'Der <translation-key id="Shortcode">Shortcode</translation-key> ist erst verfügbar, wenn der <translation-key id="Content-Blocker">Content-Blocker</translation-key> erstellt ist.','Backend / Content Blocker / Label<translation-key id="Execute-Global-code-before-unblocking">Execute Global code before unblocking</translation-key>'=>'<translation-key id="Execute-Global-code-before-unblocking">Globalen Code vor Entsperrung ausführen</translation-key>','Backend / Content Blocker / HintIf this option is enabled and a visitor unblocks the content, the JavaScript in the <translation-key id="Global">Global</translation-key> field will be executed before the blocked content is loaded.'=>'Wenn diese Option aktiviert ist und ein Besucher den Inhalt entsperrt, wird das JavaScript im Feld <translation-key id="Global">Global</translation-key> ausgeführt, bevor der gesperrte Inhalt geladen wird.','Backend / Content Blocker Language String / Alert MessageNo <translation-key id="Text-Placeholder">Text Placeholder</translation-key> configured.'=>'Kein <translation-key id="Text-Placeholder">Text-Platzhalter</translation-key> konfiguriert.','Backend / Content Blocker Language String / ButtonAdd Text Placeholder'=>'Text-Platzhalter hinzufügen','Backend / Content Blocker Host / LabelKey'=>'Key','Backend / Content Blocker Host / LabelText'=>'Text','Backend / Content Blocker Language String / Headline<translation-key id="Text-Placeholder">Text Placeholder</translation-key>'=>'<translation-key id="Text-Placeholder">Text-Platzhalter</translation-key>','Backend / Content Blocker Language String / Table Headline<translation-key id="Key">Key</translation-key>'=>'<translation-key id="Key">Key</translation-key>','Backend / Content Blocker Language String / Table Headline<translation-key id="Text">Text</translation-key>'=>'<translation-key id="Text">Text</translation-key>','Backend / Content Blocker Language String / Things to know / HeadlineWhat is the purpose of the <translation-key id="Text-Placeholder">Text Placeholder</translation-key> section?'=>'Welchen Zweck erfüllt der Bereich <translation-key id="Text-Placeholder">Text-Platzhalter</translation-key>?','Backend / Content Blocker Language String / Things to know / Text<translation-key id="Text-Placeholder">Text Placeholder</translation-key> facilitates the creation of text placeholders for your <translation-key id="Content-Blocker">Content Blocker</translation-key>, streamlining your text adjustment process.'=>'<translation-key id="Text-Placeholder">Text-Platzhalter</translation-key> erleichtert die Erstellung von Text-Platzhaltern für Ihren <translation-key id="Content-Blocker">Content-Blocker</translation-key> und vereinfacht den Prozess der Textanpassung.','Backend / Content Blocker Language String / Things to know / TextThe <translation-key id="Key">Key</translation-key> you specify can be placed in your <translation-key id="Preview-Blocked-Content">Preview Blocked Content</translation-key> &raquo; <translation-key id="Preview-Blocked-Content-HTML">HTML</translation-key> code 